INSERT INTO `tbl_catalogue_product` (`id`, `id_tbl_catalogue_product`, `id_tbl_lingua`, `title`, `description`, `description_notag`, `short_description`, `cod`, `id_tbl_photo_cat`, `template`, `pub`, `featured`, `position`, `coordinate`, `indirizzo`, `classe_energetica`, `prezzo`, `planimetria`, `anno_costruzione`, `piano`, `mq`, `posti_letto`) VALUES
(8, 8, 4, 'Centromare 7', '<p>Condominio frontemare in Piazza Mazzini con parcheggio e posto spiaggia riservati. Quadrilocale con 3 camere, sogg/pranzo, cucina separata, 2 bagni ed ampio terrazzo con vista mare frontale.</p>', NULL, 'Condominio frontemare in Piazza Mazzini,  con parcheggio e posto spiaggia riservati.', NULL, 15, NULL, 1, 0, 1, '45.495492, 12.617747', 'Via Zara, 5', NULL, NULL, '/uploads/planimetrie/appartamenti-case-vacanza-centromare-7-planimetria.pdf', NULL, NULL, NULL, NULL),
(11, 11, 4, 'Centromare 11', '<p>Condominio frontemare in Piazza Mazzini con parcheggio&nbsp;, posto spiaggia riservati e servizio di portineria. Monolocale al piano rialzato con terrazzo con vista mare laterale ovest, composto da una zona notte con letto matrimoniale, da una zona giorno con angolo cottura, bagno con doccia. L''appartamento &egrave; dotato di TV.</p>', NULL, 'Condominio frontemare in Piazza Mazzini,  con parcheggio e posto spiaggia riservati.', NULL, 18, NULL, 1, 0, NULL, '45.495492, 12.617747', 'Via Zara, 5', NULL, NULL, NULL, NULL, 'rialzato', NULL, '3'),
(12, 12, 4, 'Centromare 29', '<p><span style="color: #737373; font-family: Roboto, Tahoma, Arial, helvetica, sans-serif; font-size: 14px; line-height: 22.4px;">Condominio frontemare in Piazza Mazzini con parcheggio e posto spiaggia riservati. Trilocale al primo piano, con ascensore. composta da una camera matrmoniale, una seconda &nbsp;cameretta con due letti singoli, bagno con doccia, ripostiglio &nbsp;ed ampio terrazzo abitabile &nbsp;con vista mare laterale est. L''appartamento &egrave; dotato, di TV, lavatrice ed aria condizionata.</span></p>', NULL, 'Condominio frontemare in Piazza Mazzini,  con parcheggio e posto spiaggia riservati.', NULL, 19, NULL, 1, 0, NULL, '45.495492, 12.617747', 'Via Zara, 5', NULL, NULL, NULL, NULL, NULL, NULL, '4'),
(13, 13, 4, 'Centromare 49', '<p>Condominio frontemare in Piazza Mazzini con parcheggio e posto spiaggia riservati. Bilocale al terzo piano, con ascensore, composto &nbsp;da una camera matr. + 1 letto singolo nella stessa, soggiorno/pranzo con angolo cottura ed ampio terrazzo abitabile con vista mare laterale ovest. L''appartamento &egrave; dotato di TV, lavatrice ed aria condizionata.</p>', NULL, 'Condominio frontemare in Piazza Mazzini,  con parcheggio e posto spiaggia riservati.', NULL, 20, NULL, 1, 0, NULL, '45.495492, 12.617747', 'Via Zara, 5', NULL, NULL, NULL, NULL, NULL, NULL, '4'),
(14, 14, 4, 'Adriatico 42', '<p>Condominio frontemare con parcheggio condominiale (non assegnato) e servizio spiaggia. Disponiamo di &nbsp;un appartamento al secondo piano, con ascensore. composto da &nbsp;ampio soggiorno con cucinotto separato, 3 camere da letto (un totale di 6 posti letto), due bagni ed ampio terrazzo panoramico fronte mare. L''appartamento &egrave; dotato di TV, lavatrice e microonde.</p>', NULL, 'Condominio frontemare con parcheggio condominiale e servizio spiaggia.', NULL, 21, NULL, 1, 0, 2, '45.62796439558515, 12.572822570800781', 'Via Padova, 21', NULL, NULL, NULL, NULL, NULL, NULL, '6'),
(15, 15, 4, 'Adriatico 54', '<p>Condominio frontemare con parcheggio condominiale (non assegnato) e servizio spiaggia . Disponiamo di&nbsp;un appartamento al quinto ed ultimo piano, con ascensore, composto da ampio soggiorno con cucinotto separato, 3 camere da letto (un totale di 6 posti letto), due bagni e spazioso terrazzo frontale con spledida vista sul mare. L''appartamento &egrave; dotato di TV e lavatrice.</p>', NULL, 'Condominio frontemare con parcheggio condominiale e servizio spiaggia.', NULL, 22, NULL, 1, 0, NULL, '45.489471, 12.603694', 'Via Padova, 21', NULL, NULL, NULL, NULL, NULL, NULL, '6'),
(16, 16, 4, 'Desiree 14', '<p>Condominio fronte mare in posizione centralissima, vicinanze Piazza Mazzini, &nbsp;dotato di parcheggio riservato, posto spiaggia e piccola piscina per bimbi. L''appartamentosi trova &nbsp;al primo piano, con ascensore, &egrave; &nbsp;composto da sogg/pranzo con angolo cottura, una camera matr, &nbsp;bagno finestrato e terrazzo con vista mare laterale est. Il bilocale &egrave; dotato di TV, lavatrice e cassaforte.</p>', NULL, 'Condominio fronte mare in posizione centralissima dotato di parcheggio riservato, posto spiaggia e piccola piscina per bimbi.', NULL, 23, NULL, 1, 0, NULL, '45.497403, 12.624220', 'Via Bafile, 22 acc. mare - n.4', NULL, NULL, NULL, NULL, '1', NULL, '4'),
(17, 17, 4, 'Desiree 15', '<p>Condominio fronte mare in posizione centralissima, pressi di Piazza Mazzini, &nbsp;dotato di parcheggio riservato, posto spiaggia e piccola piscina per bimbi. Appartamento bilocale al primo piano, con ascensore, composto da sogg/pranzo con angolo cottura, una camera con letto matrimoniale + letto a castello nella stessa, bagno finestrato &nbsp;ed ampio terrazzo laterale vista mare. L''appartamento &egrave; dotato di TV, lavatrice ed aria condizionata.</p>', NULL, 'Condominio fronte mare in posizione centralissima , dotato di parcheggio riservato, posto spiaggia e piccola piscina per bimbi.', NULL, 24, NULL, 1, 0, NULL, '45.497403, 12.624220', 'Via Bafile, 22 acc. mare - n.4', NULL, NULL, NULL, NULL, '1', NULL, '4'),
(18, 18, 4, 'Desiree 26', '<p>Condominio fronte mare in posizione centralissima, pressi Piazza Mazzini, &nbsp;dotato di parcheggio riservato, posto spiaggia e piccola piscina per bimbi. Appartamento trilocale, al terzo piano, con ascensore, &nbsp;composto da soggiorno/pranzo con angolo cottura, una camera matrimoniale, seconda &nbsp;cameretta con letto a castello, bagno finestrato con doccia &nbsp;e &nbsp;terrazzo con vista mare frontale. L''appartamento &egrave; dotato di TV, lavatrice &nbsp;ed aria condizionata.</p>', NULL, 'Condominio fronte mare in posizione centralissima dotato di parcheggio riservato, posto spiaggia e piccola piscina per bimbi.', NULL, 25, NULL, 1, 0, NULL, '45.497403, 12.624220', 'Via Bafile, 22 acc. mare - n.4', NULL, NULL, NULL, NULL, NULL, NULL, '5'),
(19, 19, 4, 'Desiree 27', '<p>Condominio fronte mare in posizione centralissima dotato di parcheggio riservato, posto spiaggia e piccola piscina per bimbi. Appartamento trilocale, al terzo piano, con ascensore, &nbsp;composto da soggiorno/pranzo con angolo cottura,camera matrimoniale, &nbsp; cameretta con letto a castello, bagno e &nbsp;terrazzo con vista mare laterale.</p>', NULL, 'Condominio fronte mare in posizione centralissima dotato di parcheggio riservato, posto spiaggia e piccola piscina per bimbi.', NULL, 26, NULL, 1, 0, NULL, '45.497403, 12.624220', 'Via Bafile, 22 acc. mare - n.4', NULL, NULL, NULL, NULL, NULL, NULL, '5'),
(20, 20, 4, 'Desiree 30', '<p>Condominio fronte mare in posizione centralissima, pressi Piazza Mazzini, &nbsp;dotato di parcheggio riservato, posto spiaggia e piccola piscina per bimbi. Appartamento bilocale, al terzo piano, con ascensore, &nbsp;composto da &nbsp;soggiorno / pranzo con angolo cottura, &nbsp;una camera da letto matrimoniale , bagno finestrato con doccia e terrazzo laterale est vista mare. L''appartamento &egrave; dotato di TV, lavatrice ed aria condizionata.</p>', NULL, 'Condominio fronte mare in posizione centralissima dotato di parcheggio riservato, posto spiaggia e piccola piscina per bimbi.', NULL, 27, NULL, 1, 0, NULL, '45.497403, 12.624220', 'Via Bafile, 22 acc. mare - n.4', NULL, NULL, NULL, NULL, NULL, NULL, '4'),
(21, 21, 4, 'Helvetia int 64B', '<p>Condominio frontemare con parcheggio condominiale (non assegnato), spiaggia privata e servizio di portineria. Disponiamo di&nbsp;un appartamento al 4&deg; piano, con ascensore, composto &nbsp;ampio soggiorno con cucinotto separato, &nbsp;due ampie camere da letto matrimoniali &nbsp;ed un piccola cameretta con un letto singolo (in totale 7 posti letto), due bagni e terrazzo abitabile con vista frontale sul mare. L''appartamento &egrave; dotato di TV, lavatrice e lavastoviglie.</p>', NULL, 'Condominio frontemare con parcheggio condominiale, spiaggia privata e servizio di portineria.', NULL, 36, NULL, 1, 0, NULL, '45.485115, 12.595051', 'Vicino a Piazza Nember  - Via Padova n. 53', NULL, NULL, NULL, NULL, NULL, NULL, '7'),
(28, 28, 4, 'Villa Elsa 2 camere', '<p>Recente costruzione fronte mare in Piazza Mazzini, con 2 piscine (una per adulti e per bimbi), parcheggio coperto, posto&nbsp;spiaggia riservato (due lettini ed un ombrellone per appartamento). Disponiamo di trilocali , al 3&deg; e 4&deg; piano, con ascensore, composti da &nbsp;due camere da letto (dai 4 ai 5 posti letto), &nbsp;bagno finestrato con doccia &nbsp;e due ampi terrazzi laterli vista mare. Gli appartamenti sono tutti &nbsp;dotati di TV, lavatrice, aria condizionata, lavastoviglie, mircoonde, cassaforte e &nbsp;porta blindata.</p>', NULL, 'Condominio di recente costruzione in posizione centralissima di Jesolo. Frontemare  con due piscine, parcheggio coperto e posto spiaggia riservato.', NULL, 50, NULL, 1, 0, NULL, '45.496088, 12.619294', 'Piazza Mazzini, 8', NULL, NULL, NULL, NULL, NULL, NULL, '5'),
(29, 29, 4, 'Villa Emy 2 camere', '<p>Piccolo condominio frontemare in posizione centralissima, vicinanze Piazza Aurora, dotato di parcheggio &nbsp;riservato e di spiaggia privata. Disponiamo di trilocali (max 5 posti letto), tutti con terrazza panoramica frontale sul mare o piccolo scoperto privato, composti da soggiorno/pranzo con angolo cottura , camera matrimoniale, seconda &nbsp;cameretta con letto a castello e bagno finestrato con doccia. Sono dotati di aria condizionata, lavatrice, microonde, cassaforte, porta blindata, &nbsp;di un posto auto riservato e di un posto spiaggia nell''area privata (un ombrellone , una sedia sdraio ed un lettino per appartamento).</p>', NULL, 'Piccolo condominio di piccole dimensioni sul fronte mare con parcheggio  e spiaggia privata.', NULL, 51, NULL, 1, 0, NULL, '45.493611, 12.614631', 'Via Carducci, 1', NULL, NULL, NULL, NULL, NULL, NULL, '4'),
(30, 30, 4, 'Desiree 10', '<p>Condominio fronte mare in posizione centralissima, pressi di Piazza Mazzini, &nbsp;dotato di parcheggio riservato, posto spiaggia e piccola piscina per bimbi. Appartamento trilocale, al primo piano, con ascensore, &nbsp;composto da soggiorno/pranzo con angolo cottura, camera matrimoniale, seconda cameretta con letto a castello, &nbsp;bagno &nbsp;finestrato con doccia, terrazzo con vista mare frontale. Appartamento dotato di TV, lavatrice e pale di ventilazione al soffitto nella camera matrimoniale.</p>', NULL, 'Condominio fronte mare in posizione centralissima dotato di parcheggio riservato, posto spiaggia e piccola piscina per bimbi.', NULL, 52, NULL, 1, 0, NULL, '45.497403, 12.624220', 'Via Bafile, 22 acc. mare - n.4', NULL, NULL, NULL, NULL, NULL, NULL, '5'),
(32, 32, 4, 'Riviera', '<p>Condominio frontemare con spiaggia privata e servizio di portineria. Disponibile monolocale, al piano rialzato, con letto matrimoniale nella zona notte, angolo cottura e divano letto nella zona giorno, bagno con doccia, ampio terrazzo vista mare laterale ovest.</p>', NULL, 'Condominio frontemare con servizio di portineria e spiaggia privata.', NULL, 54, NULL, 1, 1, NULL, '45.487565, 12.600182', 'Vicino Piazza Nember, Via Caboto n.1', NULL, NULL, NULL, NULL, NULL, NULL, '3'),
(33, 33, 4, 'Shopping Center F7', '<p>Condominio frontemare nei pressi di Piazza Mazzini con parcheggio e posto spiaggia riservati. Appartamento al 3&deg; piano , con acensore, &nbsp;composto da 2 camere da letto &nbsp;(in totale 5 posti letto), &nbsp;ampio sogg/pranzo, cucinotto separato, bagno finestrato ed ampio &nbsp;terrazzo vista mare laterale est. L''appartamento &egrave; dotato di TV, lavatrice, lavastoviglie ed aria condizionata.</p>', NULL, 'Condominio frontemare con parcheggio e posto spiaggia riservati.', NULL, 55, NULL, 1, 1, NULL, '45.496379, 12.622294', 'Vicinanze Piazza Mazzini - Larco Centro Commerciale n. 46', NULL, NULL, NULL, NULL, NULL, NULL, '5'),
(34, 34, 4, 'Condominio Marconi', '<p>Condominio frontemare nei pressi di Piazza Nember con parcheggio condominiale (non assegnato) , posto spiaggia e servizio di portineria. Appartamento al 2&deg; piano, con ascensore, composto da ampio sogg/pranzo con angolo cottura, camera matrimoniale con letto a castello nella stessa, seconda cameretta con due letti singoli, 2 &nbsp;bagni, &nbsp; terrazzo con vista mare laterale est. L''appartamento &egrave; dotato di TV e lavatrice.</p>', NULL, 'Condominio frontemare con parcheggio condominiale , servizio spiaggia e portineria.', NULL, 56, NULL, 1, 0, NULL, '45.485731, 12.596433', 'Vicino a Piazza Nember  - Via Dandolo n.5', NULL, NULL, NULL, NULL, NULL, NULL, '6'),
(35, 35, 4, 'Union bilocale int 6', '<p>Condominio fronte mare in zona centrale, pressi di Piazza Marconi, &nbsp;dotato di parcheggio &nbsp;e posto spiaggia riservati. Appartamento al piano rialzato, composto da soggiorno/pranzo con angolo cottura e divano letto, &nbsp;ampia camera con letto matrimoniale ed un singolo, &nbsp;bagno finestrato &nbsp;con doccia &nbsp;e terrazza vista mare laterale est. L''appartamento &egrave; dotato di TV.</p>', NULL, 'Condominio fronte mare con parcheggio e posto spiaggia riservati.', NULL, 57, NULL, 1, 0, NULL, '45.504703, 12.646369', '2 Accesso al Mare Via Bafile n. 3', NULL, NULL, NULL, NULL, NULL, NULL, '4'),
(36, 36, 4, 'Union 9 FM', '<p>Condominio fronte mare in zona centrale, pressi di Piazza Marconi, &nbsp;dotato di parcheggio &nbsp;e posto spiaggia riservati. Appartamento al piano primo, con ascensore, &nbsp;composto &nbsp;da &nbsp;soggiorno/pranzo con angolo cottura ,ampia camera con letto matrimoniale +&nbsp;un singolo, seconda cameretta con due letti&nbsp;singoli, &nbsp;, bagno con doccia ed ampia terrazza con vista panoramica frontale sul mare. L''appartamento &egrave; dotato di TV e lavatrice.</p>', NULL, 'Condominio fronte mare con parcheggio e posto spiaggia riservati.', NULL, 58, NULL, 1, 0, NULL, '45.504703, 12.646369', '2 Accesso al Mare Via Bafile n. 3', NULL, NULL, NULL, NULL, NULL, NULL, '5'),
(37, 37, 4, 'Puerto del Sol', '<p>Condominio frontemare con piscina, pressi di Piazza Milano, &nbsp;dotato di parcheggio coperto e posto spiaggia riservato nell''area della piscina. &nbsp;Appartamento al 4&deg; piano, con ascensore, composto da sogg/pranzo con angolo cottura, camera matrimoniale, seconda cameretta con letto a castello, &nbsp;bagno con doccia &nbsp;e terrazzino. L''appartamento &egrave; dotato di TV e lavatrice.</p>', NULL, 'Condominio frontemare con piscina, dotato di parcheggio riservato e coperto e posto spiaggia.', NULL, 59, NULL, 1, 0, NULL, '45.512679, 12.667707', 'Via Levantina , 152', NULL, NULL, NULL, NULL, NULL, NULL, '4'),
(38, 38, 4, 'La Quercia  - app.  D24', '<p>Jesolo - Piazza Mazzini - Costruzione fronte mare dotata di piscina, sia per adulti che&nbsp;&nbsp;una pi&ugrave; piccola per bimbi, di spiaggia riservata e servizio di portineria. Disponiamo di &nbsp;un appartamento al primo piano, con ascensore, composto &nbsp;da soggiorno con angolo cottura, due camere da letto (una matrimoniale + un singolo e la 2&deg; con un &nbsp;letto a castello, per un totale di 5 posti letto ), &nbsp;bagno finestrato con doccia e terrazzo NO vista mare. L''appartamento &egrave; dotato di TV, lavatrice, aria condizionata e di un posto auto riservato.</p>', NULL, 'Condominio centralissimo con piscina, dotato di posto spiaggia riservato e di parcheggio.', NULL, 60, NULL, 1, 1, NULL, '45.495158, 12.616989', 'Via Zara, 9', NULL, NULL, NULL, NULL, NULL, NULL, '5'),
(39, 39, 4, 'La Quercia  - app.  D66', '<p>Jesolo Lido - Costruzione fronte mare nella centralissima Piazza Mazzini &nbsp;dotata di piscina, per adulti ed una pi&ugrave; piccola per bimbi, di spiaggia riservata e servizio di portineria. Disponiamo di &nbsp;un appartamento al quarto piano, con ascensore, composto da due camere da letto (una matrimoniale + un letto singolo e la 2&deg; con letto a castello), soggiorno con angolo cottura e bagno e terrazzino NO &nbsp;vista mare.&nbsp;L''appartamento &egrave; dotato di TV, lavatrice ed aria condizionata.</p>', NULL, 'Condominio centralissimo in Piazza Mazzini sul fronte mare con piscina, dotato di posto spiaggia riservato , di parcheggio e di servizio di portineria.', NULL, 61, NULL, 1, 0, NULL, '45.495158, 12.616989', 'Via Zara, 9', NULL, NULL, NULL, NULL, '4', NULL, '5'),
(41, 41, 4, 'La Quercia  - app.  D58', '<p>Costruzione fronte mare nella centralissima Piazza Mazzini, &nbsp;dotata di piscina, per adulti ed una pi&ugrave; piccola per bimbi, di spiaggia riservata e servizio di portineria. Disponiamo di &nbsp;un appartamento al quarto piano, con ascensore, composto da due camere da letto (una matrimoniale + un singolo e la 2&deg; con due letti singoli), soggiorno con angolo cottura , bagno finestrato con doccia &nbsp;e terrazzo &nbsp;vista mare laterale est. L''appartamento &egrave; dotato di TV, lavatrice ed aria condizionata.</p>', NULL, 'Condominio centralissimo con piscina, dotato di posto spiaggia riservato e di parcheggio.', NULL, 63, NULL, 1, 0, NULL, '45.495158, 12.616989', 'Via Zara, 9', NULL, NULL, NULL, NULL, NULL, NULL, '5'),
(42, 42, 4, 'Villa Elsa - app.  A3', '<p>Residence di recente costruzione fronte mare nella centralissima Piazza Mazzini , con 2 piscine ( una per adulti ed una per bimbi), parcheggio coperto e posto spiaggia riservato. Disponiamo di un trilocale al piano terra, composto da due camere da letto (5 posti letto in totale), sogg/pranzo con angolo cottura, bagno con doccia ed ampio giardino privato ed attrezzato. L''appartamento &egrave; dotato di TV, lavatrice, lavastoviglie, cassaforte, porta blindata ed aria condizionata.</p>', NULL, 'Residence fronte mare,  di recente costruzione , posizione centralissima. Dotato di due piscine, parcheggio coperto e posto spiaggia riservato.', NULL, 64, NULL, 1, 0, NULL, '45.496088, 12.619294', 'Piazza Mazzini, 8', NULL, NULL, NULL, NULL, NULL, NULL, '5'),
(43, 43, 4, 'Villa Elsa - app.  B12', '<p>Recente costruzione fronte mare nella centralissima Piazza Mazzini, con 2 piscine (una per adulti ed una per bimbi), parcheggio coperto e posto spiaggia riservato. Disponiamo di un trilocale al piano primo, con ascensore, composto da sogg/pranzo con angolo cottura, &nbsp;camera &nbsp;da letto matrimoniale + un letto singolo, seconda cameretta con due letti singoli, &nbsp;bagno finestrato con doccia e due ampie terrazze vista mare laterale est. L''appartamento &egrave; dotato di TV, lavatrice, lavastoviglie, aria condizionata, cassaforte e porta blindata.</p>', NULL, 'Condominio frontemare in posizione centralissima. Dotato di  due piscine, parcheggio coperto e posto spiaggia riservato.', NULL, 65, NULL, 1, 0, NULL, '45.496088, 12.619294', 'Piazza Mazzini, 8', NULL, NULL, NULL, NULL, NULL, NULL, '5'),
(44, 44, 4, 'Villa Elsa frontemare  3 camere', '<p>Appartamenti in&nbsp;condominio &nbsp;fronte mare in Piazza Mazzini, con 2 piscine ( una per adulti ed una &nbsp;per bimbi), parcheggio per due auto&nbsp;e posto spiaggia riservato. Disponiamo di quadrilocali , al 3&deg; e 4&deg; piano, con ascensore, composti da tre camere da letto (6 posti letto), due bagni ed ampio terrazzo panoramico con&nbsp;vista mare laterale o frontale. &nbsp;Gli appartamenti sono tutti&nbsp;dotati di aria condizionata, &nbsp;lavatrice, lavastoviglie, microonde, TV, cassaforte&nbsp; e &nbsp;porta blindata.</p>', NULL, 'Appartamento in condominio  fronte mare  in posizione centralissima di Jesolo, con 2  piscine, parcheggio coperto e posto spiaggia riservato.', NULL, 66, NULL, 1, 1, NULL, '45.496088, 12.619294', 'Piazza Mazzini, 8', NULL, NULL, NULL, NULL, NULL, NULL, '6'),
(45, 45, 4, 'Villa Farina 3 camere', '<p>Piccola costruzione di poche unit&agrave; sul fronte mare, in posizione centralissima, &nbsp;con posto &nbsp;spiaggia e parcheggio riservato per due &nbsp;auto. Disponiamo di un appartamento al primo piano, &nbsp;completamente ristrutturato , composto da un ampio soggiorno con cucinotto separato, spaziosa &nbsp;terrazza panoramica fronte mare, &nbsp; 3 camere da letto (in totale 6 posti letto) e doppi servizi . L''appartamento &egrave; dotato di aria condizionata, lavatrice, lavastoviglie, TV.</p>', NULL, 'Piccola costruzione di poche unit sul fronte mare, con spiaggia privata e parcheggio riservato per due posti auto. Disponiamo di un ampio appartamento al primo piano fronte mare', NULL, 67, NULL, 1, 1, NULL, '45.498201, 12.627233', 'Tra Piazza Mazzini e Piazza Brescia - 16 accesso al mare', NULL, NULL, NULL, NULL, NULL, NULL, '6'),
(46, 46, 4, 'Casa Alberti 2 camere - app.  int. 2', '<p>Piccola costruzione circondata da giardino, posizione centralissima nei pressi di Piazza Aurora a pochi passi dal mare, con parcheggio comodo. Appartamento al primo piano, composto da due camere da letto (in totale 5 posti letto), sogg/pranzo con angolo cottura, bagno e terrazzino. L''appartamento &egrave; dotato di TV, lavatrice, cassaforte e pale ventilatrice al soffitto.</p>', NULL, 'Piccola costruzione circondata dal verde in posizione centralissima. Appartamenti con due camere, sogg/pranzo, bagno e terrazzo.', NULL, 68, NULL, 1, 0, NULL, '45.494523, 12.610042', 'Vicino Piazza Aurora - Via Alberti, n 18', NULL, NULL, NULL, NULL, NULL, NULL, '5'),
