(52, 52, 4, 'Casa Carlotta 3 camere - int. 2', '<p>Piccola costruzione su accesso al mare vicino alla&nbsp;centralissima Piazza Mazzini con parcheggio e posto spiaggia riservati. Appartamento su due livelli: <strong>primo piano</strong> composto da sogg/pranzo con angolo cottura, camera matrimoniale , bagno ed ampia terrazza sul corso principale , <strong>piano mansardato</strong>:due camere da letto &nbsp;con bagno con doccia. L''appartamento &egrave; dotato di TV, lavatrice ed aria condizionata nella zona mansardata, due posti auto riservati ed un posto spiaggia.</p>', NULL, 'Piccola costruzione su accesso al mare in posizione centralissima. Trilocali, disponibili al primo piano con posto auto e posto spiaggia..', NULL, 74, NULL, 1, 0, NULL, '45.497633, 12.622264', 'Pressi P.zza Mazzini 25 accesso al mare', NULL, NULL, NULL, NULL, NULL, NULL, '6'),
(53, 53, 4, 'Casa Carlotta 3 camere - int.3', '<p>Jesolo Lido , pressi Piazza Mazzini &nbsp;piccola costruzione su accesso al mare in posizione centralissima con parcheggio e posto spiaggia riservati. Appartamento su due livelli: <strong>primo piano</strong> composto da sogg/pranzo con angolo cottura, camera da letto&nbsp;matrimoniale , bagno ed ampia terrazza sul corso principale <strong>, piano mansardato</strong>: due camere da letto &nbsp;con bagno (totale di 6 posti letto). L''appartamento &egrave; dotato di TV, lavatrice, lavastoviglie ed aria condizionata nella zona mansardata, due posti auto riservati ed un posto spiaggia.</p>', NULL, 'Piccola costruzione di poche unit su accesso al mare,  posizione centralissima . Appartamento disponibili con 3 camere da letto ,  posto auto  e posto spiaggia.', NULL, 75, NULL, 1, 0, NULL, '45.497633, 12.622264', 'Pressi P.zza Mazzini 25 accesso al mare', NULL, NULL, NULL, NULL, NULL, NULL, '6'),
