(55, 55, 4, 'Casa Trentin 1 camera attico', '<p>Condominio ristrutturato in Piazza Aurora sul corso principale &nbsp;a soli 50 mt dal mare con posto auto riservato. Disponiamo di un bilocale al secondo ed ultimo piano attico, &nbsp; composto da &nbsp;1 camera da letto matrimoniale , sogg/pranzo con angolo cottura e divano letto (in totale 4 posti letti) , un &nbsp;bagno finestrato ed ampia terrazza panoramica di circa 60 mq. &nbsp; Dotato di &nbsp;aria condizionata, TV , lavatrice &nbsp;e porta blindata.</p>', NULL, 'Piccola costruzione a 50 mt dal mare in posizione centralissima  con parcheggio riservato.', NULL, 77, NULL, 1, 0, NULL, '45.494197, 12.613041', 'Vicino Piazza Aurora Via Trentin, 117', NULL, NULL, NULL, NULL, NULL, NULL, '4'),
(56, 56, 4, 'Albatros bilocale int.9A', '<p>Condominio nella centralissima Piazza Aurora a pochi metri dal mare con posto spiaggia riservato e posto auto coperto. Appartamento al 3&deg;piano, con ascensore, composto da camera da letto matrimoniale, sogg/pranzo con angolo cottura e divano letto (totale di 4 posti letto) , bagno ed ampio terrazzo abitabile e &nbsp;panoramico rivolto a sud / ovest. &nbsp;L''appartamento &egrave; dotato di TV , lavatrice, cassaforte ed aria condizionata.</p>', NULL, 'Condominio nella  centralissima Piazza Aurora  a pochi metri dal mare con posto spiaggia.', NULL, 78, NULL, 1, 1, NULL, '45.493198, 12.611965', 'Piazza Aurora', NULL, NULL, NULL, NULL, NULL, NULL, '4'),
(57, 57, 4, 'Albatros bilocale int.12A', '<p>Condominio nella centralissima Piazza Aurora&nbsp;a pochi metri dal mare con posto spiaggia riservato e parcheggio riservato a 200 mt dallo stabile. Appartamento al 4&deg;piano, con ascensore, composto da camera &nbsp;con letto matrimoniale + letto a castello nella stessa, sogg/pranzo con angolo cottura, bagno ed ampio terrazzo abitabile e &nbsp;panoramico rivolto verso sud / ovest. Posto auto e posto spiaggia riservati. L''appartamento &egrave; dotato di TV.</p>', NULL, 'Condominio nella centralissima Piazza Aurora  a pochi metri dal mare con posto spiaggia riservato.', NULL, 79, NULL, 1, 0, NULL, '45.493198, 12.611965', 'Piazza Aurora - Via Foscolo, 9', NULL, NULL, NULL, NULL, NULL, NULL, '4'),
(58, 58, 4, 'Albatros  3 camere  int. B16', '<p>Condominio nella&nbsp;centralissima Piazza Aurora a pochi passi dal mare con parcheggio e posto spiaggia riservati. &nbsp;Appartamento al 4&deg; piano, composto da &nbsp;3 camere da letto (6 posti letto), spazioso&nbsp;soggiorno, cucina separata , 2 bagni ed ampio &nbsp;terrazzo panoramico . L''appartamento &egrave; dotato di lavatrice, lavastoviglie, aria condizionata e TV.</p>', NULL, 'Condominio nella  centralissima Piazza Aurora  a pochi metri dal mare con posto auto e posto spiaggia riservati.', NULL, 80, NULL, 1, 0, NULL, '45.493198, 12.611965', 'Piazza Aurora, Via Foscolo n. 9', NULL, NULL, NULL, NULL, NULL, NULL, '6'),
(60, 60, 4, 'Arena  2 camere', '<p>Condominio nella centralissima Piazza Aurora&nbsp;con parcheggio riservato. Appartamento al primo piano, composto da soggiorno/pranzo con angolo cottura, camera matrimoniale, seconda camera con due letti singoli, bagno con doccia ed ampia terrazza abitabile ed attrezzata che si affaccia sul corso principale. L''appartamento &egrave; dotato di TV, lavatrice ed aria condizionata.</p>', NULL, 'Condominio nella  centralissima Piazza Aurora con parcheggio riservato.', NULL, 82, NULL, 1, 0, NULL, '45.494165, 12.612809', 'Piazza Aurora - Via Trentin,  123', NULL, NULL, NULL, NULL, NULL, NULL, '4'),
(61, 61, 4, 'Barracuda 3 camere', '<p>Condominio sul corso principale nei pressi di Piazza Marconi a pochi passi dal mare con parcheggio riservato. Appartamento al primo piano, composto da tre ampie camere matrimoniali (7 posti letto), due bagni, soggiorno, cucina separata &nbsp;ed ampia terrazza abitabile che si affaccia sul corso principale. L''appartamento &egrave; dotato di TV e lavatrice.</p>', NULL, 'Condominio sul corso principale a pochi passi dal mare  con parcheggio riservato.', NULL, 83, NULL, 1, 0, NULL, '45.505186, 12.641660', 'Pressi P.Marconi - Via Barracuda, 4', NULL, NULL, NULL, NULL, NULL, NULL, '7'),
(62, 62, 4, 'Cristallo monolocale', '<p>Condominio in posizione centrale a 100 mt dal mare con parcheggio riservato e chiuso e posto spiaggia. Monolocale al primo piano, composto da una zona notte con un letto matrimoniale ed una zona giorno, con angolo cottura , bagno con doccia e terrazzino. Il monolocale &egrave; dotato di TV e di cassaforte.</p>', NULL, 'Piazza Aurora - Condominio  in posizione centrale con parcheggio e posto spiaggia riservati.', NULL, 84, NULL, 1, 0, NULL, '45.493675, 12.610712', 'Piazza Aurora - Via Alberti,  12', NULL, NULL, NULL, NULL, NULL, NULL, '3'),
(63, 63, 4, 'Diana 2 camere', '<p>Condominio sul corso principale nelle vicinanze di Piazza Marina a soli 100 m dal mare &nbsp;con spiaggia riservato. Disponiamo di splendido attico al 5&deg; ed ultimo piano, con ascensore, composto da soggiorno/ pranzo con angolo cottura, ampio terrazzo panoramico, due camere da letto (totale di 5 posti letto) e &nbsp;bagno finestrato con doccia. Dispone di aria condizionata, TV e lavatrice.</p>', NULL, 'Condominio sul corso principale  nei pressi di Piazza Marina a 100 m dal mare con spiaggia riservata.', NULL, 85, NULL, 1, 0, NULL, '45.490837, 12.605091', 'Pressi Piazza Marina - Via Verdi, 84', NULL, NULL, NULL, NULL, NULL, NULL, '5'),
(64, 64, 4, 'Flaminia 2 camere  int.2', '<p>Condominio su accesso al mare a pochi passi dal mare in posizione centralissima, vicinanze Piazza Mazzini. Appartamento al piano rialzato, composto da ampio soggiorno con cucinotto, camera da letto con matrimoniale + un letto a castello, seconda camera con letto matrimoniale, bagno con doccia finestrato e terrazzo Dispone di un posto auto &nbsp;ed un posto spiaggia riservati inoltre &egrave; dotato di TV e lavatrice.&nbsp;</p>', NULL, 'Condominio su accesso al mare in posizione centralissima con posto auto e posto spiaggia riservati.', NULL, 86, NULL, 1, 0, NULL, '45.498272, 12.624657', '20 acc mare Via Bafile, n. 359', NULL, NULL, NULL, NULL, NULL, NULL, '5'),
(65, 65, 4, 'Grazia 2 camere int.18', '<p>Condominio &nbsp;sul corso principale, nelle vicinanze di Piazza Marina a 100 mt dal mare. Dotato di parcheggio chiuso e di un posto spiaggia riservato. Appartamento al terzo piano, con ascensore, composto da camera matrimoniale, cameretta con due letti singoli, sogg/pranzo, bagno finestrato e terrazzo. L''appartamento &egrave; dotato di TV e lavatrice.</p>', NULL, 'Condominio sul corso principale  nei pressi di Piazza Marina con parcheggio e posto spiaggia riservati.', NULL, 87, NULL, 1, 0, NULL, '45.489750, 12.602587', 'pressi Piazza Marina - Via Verdi, 84', NULL, NULL, NULL, NULL, NULL, NULL, '5'),
(66, 66, 4, 'Olimpo 2 camere  int.3', '<p>Condominio sul corso principale in Piazza Brescia &nbsp;a pochi passi dal mare con parcheggio e posto spiaggia riservati. Appartamento al 1&deg;piano, con ascensore, composto &nbsp;da sogg/pranzo con angolo cottura, &nbsp;2 camere da letto ( la prima matrimoniale + un singolo e la seconda con due letti singoli - max 5 posti letto), bagno ed ampia terrazza abitabile che si affaccia sul corso principale. Dotato di TV ed aria condizionata.</p>', NULL, 'Piazza Brescia - Condominio sul corso principale con parcheggio e posto spiaggia riservati.', NULL, 88, NULL, 1, 0, NULL, '45.502145, 12.635141', 'Via dei Pioppi n. 10 - pressi Piazza Brescia', NULL, NULL, NULL, NULL, NULL, NULL, '5'),
(67, 67, 4, 'Olimpo 2 camere  int. 4', '<p>Piazza Brescia Condominio sul corso principale a pochi passi dal mare con parcheggio e posto spiaggia riservati. Appartamento al 1&deg;piano, con ascensore, composto da 2 camere da letto ( la prima matrimoniale + un singolo e la seconda con due letti singoli - max 5 posti letto), sogg/pranzo con angolo cottura, bagno ed ampia terrazza abitabile che si affaccia sul corso principale. Dotato di TV , porta blindata ed&nbsp;aria condizionata.</p>', NULL, 'Condominio sul corso principale con parcheggio e posto spiaggia riservati.', NULL, 89, NULL, 1, 0, NULL, '45.502145, 12.635141', 'Via dei Pioppi n. 10 - pressi Piazza Brescia', NULL, NULL, NULL, NULL, NULL, NULL, '5'),
(68, 68, 4, 'Parigi 2 camere  int.6', '<p>Condominio su accesso al mare, in Piazza Mazzini, con &nbsp;parcheggio e posto &nbsp;spiaggia riservati. &nbsp;Appartamento al secondo piano, composto da &nbsp;camera matrimoniale , piccola cameretta conn letto letto a castello , sogg/pranzo con angolo cottura, bagno e terrazzino. Dotato di TV e di pale ventilatrici.</p>', NULL, 'Piazza Mazzini - Condominio su accesso al mare in posizione centralissima con posto auto e posto spiaggia riservati.', NULL, 90, NULL, 1, 0, NULL, '45.497039, 12.620172', '29 accesso al mare, n 4  - pressi  Piazza Mazzini', NULL, NULL, NULL, NULL, NULL, NULL, '4'),
(69, 69, 4, 'Soyus 1 camera int. 4', '<p>Condominio su accesso al mare nei pressi di Piazza Marconi con parcheggio riservato e posto spiaggia . Appartamento al piano rialzato, composto da camera matrimoniale (letto matrimoniale + letto a castello - totale 4 posti letto), sogg/pranzo con angolo cottura , bagno e terrazzino. Dotato di TV.</p>', NULL, 'Condominio su accesso al mare nei pressi di Piazza Marconi  con parcheggio e posto spiaggia riservati.', NULL, 91, NULL, 1, 1, NULL, '45.505617, 12.644466', 'Via dello Storione n. 6, pressi Piazza Marconi', NULL, NULL, NULL, NULL, NULL, NULL, '4'),
(70, 70, 4, 'Sunny Home  int A19', '<p>Jesolo - Piazza Mazzini Condominio sul corso principale in posizione centralissima. Appartamento al 4&deg; piano, con ascensore, composto da sogg/pranzo con angolo cottura, camera matrimoniale, cameretta con due letti, bagno finestrato e piccolo terrazzino. Dotato di TV, lavatrice ed aria condizionata.</p>', NULL, 'Condominio in Piazza Mazzini a due passi dal mare  con posto spiaggia riservato.', NULL, 92, NULL, 1, 0, NULL, '45.496042, 12.616424', 'Via S. Trentin, 42   P.zza Mazzini', NULL, NULL, NULL, NULL, NULL, NULL, '5'),
(71, 71, 4, 'Toniolo Monolocale', '<p>Condominio in posizione centrale nei pressi di Piazza Marconi &nbsp;a pochi passi dal mare, dotato di parcheggio riservato e chiuso. Disponiamo di un monolocale al primo piano, &nbsp;con letto matrimoniale, zona con angolo cottura separata, bagno con doccia. Dotato di TV , aria condizionata e posto auto.</p>', NULL, 'Condominio sul corso principale nei pressi di Piazza Marconi a pochi passi dal mare con parcheggio riservato', NULL, 93, NULL, 1, 0, NULL, '45.505233, 12.642646', 'Via Ninfee n.1, pressi Piazza Marconi', NULL, NULL, NULL, NULL, NULL, NULL, '2'),
(72, 72, 4, 'Toniolo 2 camere', '<p>Condominio in posizione centrale nei pressi di Piazza Marconi a soli &nbsp;pochi passi dal mare, dotato di parcheggio riservato e chiuso. Disponiamo di un trilocale&nbsp;&nbsp;al secondo piano, &nbsp;composto da soggiorno con angolo cottura, camera matrimoniale, seconda cameretta con letto a castello, bagno con doccia. L''appartamento &egrave; dotato di TV, lavatrice, di aria condizionata e di un posto auto riservato.</p>', NULL, 'Condominio sul corso principale nei pressi di Piazza Marconi ed a soli pochi passi dal mare con parcheggio riservato.', NULL, 94, NULL, 1, 0, NULL, '45.505233, 12.642646', 'Via Ninfee n.1, pressi Piazza Marconi', NULL, NULL, NULL, NULL, NULL, NULL, '4'),
(73, 73, 4, 'Verdi 2 camere int  28', '<p>Condominio sul corso principale nei pressi di Piazza Marina a 100 m dal mare con parcheggio e posto spiaggia riservati. Appartamento al 6&deg; piano, con ascensore, composto da 2 camere da letto (in totale 5 posti letto), sogg/pranzo con angolo cottura, bagno con doccia. Dotato di TV, lavatrice ed aria condizionata.</p>', NULL, 'Jesolo - Piazza Marina .Condominio sul corso principale a 100 m dal mare con parcheggio e posto spiaggia riservati.', NULL, 95, NULL, 1, 0, NULL, '45.490403, 12.604140', 'Via Verdi , tra P.zza Marina e Nember', NULL, NULL, NULL, NULL, '6', NULL, '5'),
(74, 74, 4, 'Milano bilocale int  48', '<p>Jesolo - Piazza Milano - Condominio in posizione centrale comoda al mare, con parcheggio riservato e coperto e posto spiaggia. Appartamento al 4&deg; piano, con ascensore, composto da camera matrimoniale, sogg/pranzo con angolo cottura e divano letto, bagno finestrato con doccia e terrazza abitabile. Dotato di TV, lavatrice, cassaforte &nbsp;, porta blindata ed aria condizionata.</p>', NULL, 'Piazza Milano - Condominio a pochi passi dal mare con parcheggio coperto e posto spiaggia.', NULL, 96, NULL, 1, 0, NULL, '45.514127, 12.670922', 'Piazza Milano, 9', NULL, NULL, NULL, NULL, NULL, NULL, '3'),
(75, 75, 4, 'Everest bilocale int 37', '<p>Jesolo / Piazza Nember . Condominio &nbsp;a pochi passi dal mare con piscina, posto auto e posto spiaggia riservati . Bilocale al 4&deg; piano, con ascensore, &nbsp;composto da sogg/pranzo con angolo cottura e terrazzino , camera da letto con &nbsp;matrimoniale + letto &nbsp;a a castello nella stessa &nbsp;e &nbsp;bagno con doccia. L''appartamento &egrave; dotato di Tv ed aria condizionata. &nbsp;</p>', NULL, 'Piazza Nember Condominio a 50 m dal mare con piscina , dotato di posto auto e posto spiaggia riservati.', NULL, 97, NULL, 1, 0, NULL, '45.487131, 12.597290', 'Piazza Nember, 10', NULL, NULL, NULL, NULL, NULL, NULL, '4'),
(76, 76, 4, 'Villa Carla monoloce', '<p>Piccola costruzione di sole 10 unit&agrave; in Piazza Mazzini in &nbsp;posizione centralissima a pochi passi dal mare con parcheggio e posto spiaggia riservati. &nbsp;Disponibili &nbsp;monolocali sia al piano terra che al primo piano, &nbsp;hanno &nbsp;una zona notte con letto matrimoniale &nbsp;ed &nbsp;una zona giorno con angolo cottura ed un divano letto (un totale di 3 posti letto) , bagno e terrazzino. Sono tutti dotati di TV e pale ventilatrici al soffitto.</p>', NULL, 'Piccola costruzione di  sole 10 unit in Piazza Mazzini in  posizione centralissima e comoda al mare con parcheggio e posto spiaggia riservati.', NULL, 98, NULL, 1, 0, NULL, '45.495744, 12.617857', 'Via Zara, 10  pressi Piazza Mazzini -', NULL, NULL, NULL, NULL, NULL, NULL, '3'),
(77, 77, 4, 'Villa delle Robinie  int 5', '<p>Costruzione centralissima, nelle vicinanze di Piazza Mazzini, &nbsp;a pochi passi dal mare con parcheggio riservato e chiuso e posto spiaggia. Bilocale al primo piano, composto da camera matrimoniale (3 letti), sogg/pranzo con angolo cottura , bagno con doccia e terrazzino. Dotato di TV.</p>', NULL, 'Condominio a pochi passi dal mare in posizione centralissima  con parcheggio e posto spiaggia riservati.', NULL, 99, NULL, 1, 0, NULL, '45.495133, 12.616628', 'Via Zara,  18', NULL, NULL, NULL, NULL, NULL, NULL, '3'),
(78, 78, 4, 'Villa delle Robinie  int 12', '<p>Costruzione centralissima a pochi passi dal mare, nelle vicinanze di Piazza Mazzini, &nbsp;con parcheggio riservato e chiuso e posto spiaggia. Bilocale al secondo piano, composto da sogg/pranzo con angolo cottura e divano letto , da una camera da letto &nbsp;matrimoniale , bagno con doccia e terrazzino. Dotato di TV ed aria condizionata.</p>', NULL, 'Condominio a pochi passi dal mare in posizione centralissima  con parcheggio e posto spiaggia riservati.', NULL, 100, NULL, 1, 0, NULL, '45.495133, 12.616628', 'Via Zara , 18', NULL, NULL, NULL, NULL, NULL, NULL, '3'),
(79, 79, 4, 'Villa Gabbiano int 2A', '<p>Piccols casa , nei pressi di Piazza Aurora, composta da tre unit&agrave;, &nbsp;vicinissima al &nbsp;mare, &nbsp;con ampio spazio comune, con &nbsp;parcheggio numerato e riservato &nbsp;e posto spiaggia. Appartamento al 1&deg; piano, composto da sogg/pranzo con angolo cottura, 3 camere da letto (6 posti letto) , &nbsp; bagno finestrato - &nbsp;No terrazza. L''appartamento &egrave; dotato di TV, aria condizionata, lavatrice e lavastoviglie.</p>', NULL, 'Piccola casa di  sole tre unit a 40 mt dal mare con parcheggio e posto spiaggia riservati.', NULL, 101, NULL, 1, 0, NULL, '45.494280, 12.614659', 'Via Zara, 32 - tra P.zza Mazzini e P.zza Aurora', NULL, NULL, NULL, NULL, NULL, NULL, '6'),
(81, 81, 4, 'Villa Gabbiano int 3A', '<p>Piccols casa composta da tre unit&agrave;, &nbsp;vicinissima al &nbsp;mare in &nbsp;posizione centrale, con ampio spazio comune, con &nbsp;parcheggio numerato e riservato &nbsp;e posto spiaggia. Appartamento al 2&deg; piano, composto da sogg/pranzo con angolo cottura, 3 camere da letto (6 posti letto) e &nbsp;bagno finestrato - &nbsp;No terrazza. Dotato di TV, aria ocndizionata, lavatrice e lavastoviglie.</p>', NULL, 'Piccola casa di  sole tre unit a 40 mt dal mare con parcheggio e posto spiaggia riservati.', NULL, 103, NULL, 1, 0, NULL, '45.494280, 12.614659', 'Via Zara, 32 - tra P.zza Mazzini e P.zza Aurora', NULL, NULL, NULL, NULL, NULL, NULL, '6'),
(82, 82, 4, 'Villa Mauro  int 12', '<p>Condominio in posit&igrave;zione centralissima a pochi passi dal mare. Dotato di parcheggio condominiale, non riservato e di posto spiaggia. &nbsp;Appartamento al 4&deg; piano, con ascensore, composto da soggiorno/pranzo con angolo cottura , camera da letto &nbsp;matrimoniale, bagno &nbsp;e terrazzino. Dotato di TV, di microonde, porta blindata &nbsp;ed aria condizionata.</p>', NULL, 'Condominio nella centralissima P.zza Mazzini , che si affaccia sul corso principale, dotato di parcheggio condominiale  e di posto spiaggia.', NULL, 104, NULL, 1, 0, NULL, '45.495985, 12.617670', 'Via Trentin, 13 -  P.zza Mazzini', NULL, NULL, NULL, NULL, NULL, NULL, '3'),
(83, 83, 4, 'Villa Mauro int 8', '<p>Condominio in posit&igrave;zione centralissima a pochi passi dal mare. Dotato di parcheggio condominiale, non riservato e di posto spiaggia. &nbsp;Appartamento al 3&deg; piano, con ascensore, composto da soggiorno/pranzo con angolo cottura, una camera con &nbsp;letto matrimoniale ed un letto a castello nella stassa, &nbsp; bagno finestrato con doccia &nbsp;e terrazzino. Dotato di TV , porta blindata ed aria condizionata.</p>', NULL, 'Condominio nella centralissima P.zza Mazzini , che si affaccia sul corso principale, dotato di parcheggio e di posto spiaggia.', NULL, 105, NULL, 1, 0, NULL, '45.495985, 12.617670', 'Via Trentin, 13 - pressi P.zza Mazzini', NULL, NULL, NULL, NULL, NULL, NULL, '4'),
(84, 84, 4, 'Villa Oliva monolocale  int 10', '<p>Condominio in posizione centralissima &nbsp;a soli &nbsp;100 mt dal mare , tra Piazza Mazzini e Piazza Aurora. Monolocale mansardato al secondo piano,&nbsp;la&nbsp; zona giorno &egrave; dotata di&nbsp;&nbsp;angolo cottura, mentre la zona notte di un letto matrimoniale e &nbsp; bagno finestrato con doccia. Il monolocale &egrave; dotato di TV, lavatrice ed aria condizionata.</p>', NULL, 'Condominio in posizione centralissima, tra Piazza Mazzini e Piazza Aurora,  a soli  100 mt dal mare.', NULL, 106, NULL, 1, 0, NULL, '45.495227, 12.615021', 'Via Trentin, 65 - pressi P.zza Mazzini', NULL, NULL, NULL, NULL, NULL, NULL, '2'),
(85, 85, 4, 'Villa Padova bilocale int. 6', '<p>Piccola costruzione a pochi passi dal mare nei pressi di Piazza Marina, dotato di parcheggio riservato e posto spiaggia. &nbsp;Appartamento al primo piano, composto da soggiorno/pranzo con angolo cottura e divano letto, camera da letto matrimoniale (in totale 3 posti letto), bagno finestrato con doccia e terrazzino. Il bilocale &egrave; dotato di TV ed aria condizionata.</p>', NULL, 'Piazza Marina - Condominio a pochi passi dal mare con parcheggio e posto spiaggia riservati.', NULL, 107, NULL, 1, 0, NULL, '45.490816, 12.606668', 'Via Padova, 2A - pressi Piazza Marina', NULL, NULL, NULL, NULL, NULL, NULL, '3'),
(86, 86, 4, 'Casa Rosa monolocale int D4', '<p>Piccola casa di poche unit&agrave; con parcheggio riservato. Posizione centrale ma protetta da rumori. Monolocale al primo piano con divano letto (max 2 posti letto), angolo cottura , bagno e terrazzino. Dotato di TV ed aria condizionata.</p>', NULL, 'Piccola casetta con poche unit in posizione centralissima  ma protetta dai rumori. Dispone di parcheggio chiuso e riservato.', NULL, 108, NULL, 1, 0, NULL, '45.497090, 12.616817', 'Via Vicenza, 1 vicolo n. 7 - pressi P.zza Mazzini', NULL, NULL, NULL, NULL, NULL, NULL, '2'),
(87, 87, 4, 'Casa Rosa bilocale int 1A', '<p>Piccola casa di poche unit&agrave; con parcheggio riservato. Posizione centrale ma protetta da rumori. Bilocale al primo piano, composto da camera da letto matrimoniale, sogg/pranzo con angolo cottura e divano letto (in totale 3 posti letto) , bagno e terrazzino. Dotato di TV , lavatrice ed aria condizionata.</p>', NULL, 'Piccola casetta con poche unit in posizione centrale ma protetta dai rumori. Dispone di parcheggio chiuso e riservato.', NULL, 109, NULL, 1, 0, NULL, '45.497090, 12.616817', 'Via Vicenza, 1 vicolo n. 7 - pressi P.zza Mazzini', NULL, NULL, NULL, NULL, NULL, NULL, '3'),
(88, 88, 4, 'Casa Rosa int 2A', '<p>Piccola casa di poche unit&agrave; con parcheggio riservato. Posizione centrale ma protetta da rumori. Bilocale al primo piano, composto da camera da letto matrimoniale, sogg/pranzo con angolo cottura e divano letto (in totale 3 posti letto) , bagno e terrazzino. Dotato di TV , lavatrice ed aria condizionata.</p>', NULL, 'Piccola casetta con poche unit in posizione centralissima. Dispone di parcheggio chiuso e riservato.', NULL, 110, NULL, 1, 0, NULL, '45.497090, 12.616817', 'Via Vicenza, 1 vicolo n. 7 - pressi P.zza Mazzini', NULL, NULL, NULL, NULL, NULL, NULL, '3'),
(89, 89, 4, 'Casa Rosa int 3C', '<p>Piccola casa di poche unit&agrave; con parcheggio riservato. Posizione centrale ma protetta da rumori. Bilocale al primo piano, composto da camera da letto con matrimoniale + un letto singolo (in totale 3 posti letto), sogg/pranzo con angolo cottura &nbsp;, bagno e terrazzino. Dotato di TV &nbsp;ed aria condizionata.</p>', NULL, 'Piccola casetta con poche unit in posizione centralissima con  parcheggio chiuso e riservato.', NULL, 111, NULL, 1, 0, NULL, '45.497090, 12.616817', 'Via Vicenza, 1 vicolo n. 7 - pressi P.zza Mazzini', NULL, NULL, NULL, NULL, NULL, NULL, '3');
