(90, 90, 4, 'Drago Village  int 10', '<p>Residence con piscina a 300 mt dal mare nei pressi di Piazza Drago con parcheggio coperto. Appartamento &nbsp;su due livelli, <strong>al primo piano:</strong> il&nbsp;sogg/pranzo con ancolo cottura. un bagno , una camera da letto matrimoniale ed ampia terrazza con vista piscina, <strong>al piano mansardato</strong> : camera matrimoniale e bagno. L''appartamento &egrave; dotato di TV, lavatrice ed aria condizionata.</p>', NULL, 'Residence a 300 mt dal mare con piscina  e parcheggio riservato e  coperto.', NULL, 112, NULL, 1, 1, NULL, '45.508484, 12.643478', 'Via Equilio, 1 - pressi di Piazza Drago', NULL, NULL, NULL, NULL, NULL, NULL, '5'),
(91, 91, 4, 'Le Residenze di Parco Equilio int. 100', '<p>Residence di recente costruzione immerso nel verde con due piscine ed ampio spazio verde. Bilocale al primo piano, composto da sogg/pranzo con angolo cottura, una &nbsp;camera da letto con matrimoniale ed un letto singolo, &nbsp;bagno finestrato con doccia e terrazzo abitabile attrezzato. Dispone di lavatrice, TV, aria condizionata e due posti auto.</p>', NULL, 'Residence di recente costruzione alle spalle di Piazza Aurora, circa 800 mt dal mare, con due piscine ed ampio spazio verde', NULL, 113, NULL, 1, 0, NULL, '45.498905, 12.606445', 'Via C Porcia, 100 - alle spalle di P.zza Aurora', NULL, NULL, NULL, NULL, NULL, NULL, '3'),
