(100, 100, 4, 'La Vigna bilocale int 8', '<p>Residence nei pressi di Piazza Nember &nbsp;a 300 mt dal mare circondato dal verde con piscina. Bilocale al piano terra composto da soggiorno pranzo con angolo cottura, camera da letto con matrimoniale + un&nbsp;&nbsp;letto singolo, bagno finestrato con doccia e piccolo scoperto privato. Dotato di TV, lavatrice, aria condizionata , cassaforte e posto auto riservato.</p>', NULL, 'Residence con piscina a 300 mt. dal mare con piscina  circondato dal verde.', NULL, 122, NULL, 1, 1, NULL, NULL, 'Via Vespucci, 10 - pressi di Piazza Nember', NULL, NULL, NULL, NULL, NULL, NULL, '4'),
(102, 102, 4, 'Torre Blanca Residence int 102', '<p>Residence con piscina, in posizione centralissima, alle spalle di Piazza Mazzini, con parcheggio e posto spiaggia riservati. Trilocale al primo piano, composto da soggiorno pranzo con angolo cottura, camera da letto matrimoniale, cameretta con letto a castello, bagno finestrato con doccia e terrazzino. Dotato di TV, cassaforte, lavatrice &nbsp;ed aria condizionata.</p>', NULL, 'Residence con piscina alle spalle di Piazza Mazzini, con parcheggio e posto spiaggia riservati.', NULL, 124, NULL, 1, 0, NULL, '45.498911, 12.616792', 'Piazza Internazionale, 3 - vicino Piazza Mazzini', NULL, NULL, NULL, NULL, NULL, NULL, '5'),
(103, 103, 4, 'Torre Blanca Residence int T3', '<p>Residence con piscina, in posizione centralissima, alle spalle di Piazza Mazzini, con parcheggio e posto spiaggia riservati. Trilocale al piano terra, composto da soggiorno pranzo con angolo cottura, camera da letto matrimoniale, cameretta con letto a castello, bagno &nbsp;con doccia e piccolo scoperto privato. Dotato di TV &nbsp;ed aria condizionata.</p>', NULL, 'Residence con piscina alle spalle di Piazza Mazzini, con parcheggio e posto spiaggia riservati.', NULL, 125, NULL, 1, 0, NULL, '45.498911, 12.616792', 'Piazza Internazionale, 3 - pressi Piazza Mazzini', NULL, NULL, NULL, NULL, NULL, NULL, '5'),
(104, 104, 4, 'Villa Delfi bilocale int 6', '<p>Piccola costruzione a 250 mt dal mare con parcheggio e posto spiaggia riservati. Bilocale al 2&deg; piano composto da soggiorno pranzo con angolo cottura, camera con letto matrimoniale +&nbsp;letto a castello (un totale di 4 posti letto), bagno finestrato con doccia e terrazzino. Dotato di TV ed aria condizionata.</p>', NULL, 'Piazza Milano - Piccola costruzione a 250 mt dal mare con parcheggio e posto spiaggia riservati.', NULL, 126, NULL, 1, 0, NULL, '45.517141, 12.677631', 'Via Olanda, 163  - tra piazza Milano e Torino', NULL, NULL, NULL, NULL, NULL, NULL, '4'),
(105, 105, 4, 'Villaggio dei Gabbiani  int 1', '<p>Residence con due piscine a 300 mt dal mare, alle spalle di Piazza Marina. Trilocale al piano terra composto da soggiorno pranzo con angolo cottura, due camere da letto matrimoniali (totale 5 posti letto), bagno finestrato con doccia e scoperto privato attrezzato. Dotato di TV, lavatrice, lavastoviglie , aria condizionata e posto auto riservato.&nbsp;</p>', NULL, 'Residence con piscine a 300 mt dal mare, alle spalle di Piazza Marina ed ampio spazio verde', NULL, 127, NULL, 1, 0, NULL, '45.494675, 12.604253', 'Via Bunarroti, 18 - pressi Piazza Marina', NULL, NULL, NULL, NULL, NULL, NULL, '5'),
(106, 106, 4, 'CAVALLINO appartamento in vendita', '<p>CAVALLINO RESIDENCE di recente costruzione. In vendita appartamento al primo piano, composto da due camere da letto, soggiorno / pranzo con angolo cottura, bagno, due terrazze, arredamento completo. Posto auto riservato.</p>', NULL, 'Cavallino - Appartamento in vendita in residence di recente costruzione', 'RIF.CML', 128, NULL, 1, 0, 0, NULL, 'Cavallino', 'D', '185.000', NULL, '2004', 'Primo piano', '60', NULL),
(107, 107, 4, 'Appartamento bilocale Jesolo', '<p>Jesolo Lido - Residence con due &nbsp;piscine a 300 mt dal mare nei pressi di Piazza Marina &nbsp;. Appartamento al primo ed ultimo piano, &nbsp;con posto auto riservato. Bilocale &nbsp;composto da una camera da letto , soggiorno/ pranzo con angolo cottura e &nbsp;bagno finestrato. Ampio spazio verde in comune.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', NULL, 'Jesolo Lido - Residence con  due piscine a 300 mt dal mare. Appartamento al primo ed ultimopiano con posto auto riservato.', 'RIF. VG', 129, NULL, 1, 0, NULL, NULL, 'Piazza Marina - Jesolo Lido', 'G', '139.000', NULL, NULL, 'Primo piano', '40', NULL),
(108, 108, 4, 'Jesolo appartamento 2 camere', '<p>Jesolo Lido - Residence con due piscine a 300 mt dal mare nei pressi di Piazza Marina . Appartamento al piano terra con posto auto riservato. Trilocale composto da una camera da letto matrimoniale + un letto singolo, seconda camera con letto matrimoniale, soggiorno/ pranzo con angolo cottura, bagno finestrato e scoperto privato dotato di pompeiana. L''appartamento &egrave; fornito di aria condizionata, TV, lavatrice e lavastoviglie.</p>', NULL, 'Jesolo Lido - Residence con due piscine a 300 mt dal mare nei pressi di Piazza Marina . Appartamento al piano terra con posto auto riservato.', 'RIF. VG02', 130, NULL, 1, 0, NULL, NULL, 'Piazza Marina - Jesolo Lido', 'G', '240.000', NULL, NULL, 'Piano terra', '60', NULL),
(109, 109, 4, 'Jesolo  - P.zza Mazzini trilocale in vendita', '<p>Jesolo Lido - Condominio &nbsp;in posizione &nbsp;centralissima a pochi passi dal mare. Disponiamo di trilocale &nbsp;completamente ristrutturato, al 5&deg; piano, con ascensore, composto &nbsp;da ampio soggiorno / pranzo con angolo cottura, &nbsp;camera matrimoniale, seconda cameretta con due letti singoli, bagno finestrato e piccolo terrazzino. Completamente arredato e dotato di TV, lavatrice &nbsp;ed &nbsp;aria condizionata .</p>', NULL, 'Jesolo Lido - Condominio in posizione  centralissima a pochi passi dal mare.Trilocale completamente ristrutturato.', 'RIF.SHM03', 131, NULL, 1, 0, NULL, NULL, 'Piazza Mazzini - Jesolo Lido', 'G', '200.000', NULL, 'Ristrutturato', 'Quinto piano', '65', NULL),
(110, 110, 4, 'Jesolo Lido - FRONTEMARE - Piazza Mazzini', '<p>Jesolo Lido - Frontemare - Piazza Mazzini - Condominio &nbsp;sul mare con servizio di portineria. Monolocale al 4&deg; piano, con ascensore, &nbsp; completamente ristrutturato con soggiorno/pranzo ed angolo cottura, bagno ed ampia terrazza panoramica. Spese condominiali minime.</p>', NULL, 'Jesolo Lido - Condominio centralissimo sul mare con servizio di portineria. Monolocale  completamente ristrutturato con ampia terrazza panoramica.', 'RIF. CM01', 132, NULL, 1, 1, NULL, NULL, 'Piazza Mazzini - Jesolo Lido', 'G', '190.000', NULL, 'Ristrutturato', 'Quinto piano', '30', NULL),
(111, 111, 4, 'Jesolo Lido - FRONTEMARE -   Piazza Mazzini', '<p>Jesolo Lido - Condominio fronte mare in Piazza Mazzini con servizio di portineria. Bilocale al &nbsp;secondo piano, con ascensore, composto da ampio soggiorno / pranzo con angolo cottura, ampia camera matrimoniale, bagno con doccia e terrazza abitabile attrezzata. Dotato di TV, lavatrice ed aria condizionata.</p>', NULL, 'Jesolo Lido - Condominio fronte mare in Piazza Mazzini con servizio di portineria. Bilocale al  secondo piano.', 'RIF. CM 02', 133, NULL, 1, 0, NULL, NULL, 'Piazza Mazzini - Jesolo Lido', 'G', '240.000 tratt.', NULL, 'Ristrutturato', 'Secondo piano', '45', NULL),
(112, 112, 4, 'Jesolo Lido - GOLF CLUB', '<p>Jesolo Lido - Prestigioso residence con piscine, ampio spazio verde e campi da golf. Appartamento di recente costruzione al primo piano, composto da un soggiorno pranzo con angolo cottura, camera matrimoniale, cameretta con due letti singoli, bagno e terrazze con bellissima vista sul golf. Completamento arredato e dotato di riscaldamento autonomo ed aria condizionata. Due posti auto riservati e box golf car.&nbsp;</p>', NULL, 'Jesolo Lido - Prestigioso residence con piscine, ampio spazio verde e campi da golf. Appartamento di recente costruzione al primo piano.', 'RIF. GLF 01', 134, NULL, 1, 1, NULL, NULL, 'Piazza Aurora - Jesolo Lido', 'E', '220.000', NULL, '2006', 'Primo piano', '65', NULL),
(113, 113, 4, 'Jesolo Lido - GOLF CLUB', '<p>Prestigioso residence con piscine, ampio spazio verde e campi da golf. Appartamento su tre livelli, <strong>piano terra</strong> composto da soggiorno/ pranzo con angolo cottura. bagno e scoperto privato, <strong>primo piano</strong> composto da 2 camere da letto e bagno, <strong>secondo piano</strong> composto da solarium con splendida vista sul green. Arredato e completo di riscaldamento autonomo, aria condizionata, parcheggio privato e box golf car.</p>', NULL, 'Prestigioso residence con piscine, ampio spazio verde e campi da golf. Appartamento su tre livelli.', 'RIF. GLF02', 135, NULL, 1, 1, NULL, NULL, 'Piazza Aurora - Jesolo Lido', 'E', 'Trattative riservate', NULL, '2006', 'Piano terra, primo e secondo piano', '100', NULL),
(114, 114, 4, 'Jesolo - VILLA  SINGOLA  residence con piscine', '<p>Jesolo Lido VILLA SINGOLA in residence alle spalle di Piazza Aurora con ampio spazio verde e piscine. Villa singola composta da soggiorno / pranzo, due camere da letto, bagno finestrato con doccia, 2 pompeiane esterne, barbeque esterno, ampio giardino di circa 400 mq piantumato ed irrigato. Dotata &nbsp;di riscaldamento autonomo , aria condizionata, TV, lavatrice e lavastoviglie.&nbsp;</p>', NULL, 'Jesolo Lido VILLA SINGOLA   alle spalle di Piazza Aurora con ampio spazio verde e piscine.', 'RIF. PRC01', 136, NULL, 1, 1, NULL, NULL, 'Piazza Aurora - Jesolo Lido', 'E', '330.000', NULL, '2006', 'Piano terra', '65', NULL),
(115, 115, 4, 'Jesolo  NUOVA COSTRUZIONE Piazza Aurora', '<p>Jesolo Lido - Nuova costruzione alle spalle di Piazza Aurora. In una tranquilla zona residenziale, a poche centinaia di metri dal mare. Sono state ricavate 3 nuove unit&agrave; di ampie metrature. Disponibile porzione ad ovest con ingresso indipendente, area esclusiva per giardino e con la possibilit&agrave; di almeno due posti auto . Assolutamente adeguate ad una residenza stabile e comunque con caratteristiche non comuni ed apprezzabili da tutti coloro che desiderano, anche al mare, una vera casa.&nbsp;</p>', NULL, 'Jesolo Lido Nuova costruzione alle spalle di Piazza Aurora. Disponibile porzione ad ovest con ingresso indipendente.', 'RIF. AMD00', 137, NULL, 1, 0, NULL, NULL, 'Piazza Aurora - Jesolo Lido', 'C', '370.000', NULL, '2010', 'Piano terra, primo piano e mansardato', '150', NULL),
(117, 117, 4, 'Jesolo PRESTIGIOSA COSTRUZIONE', '<p>Jesolo Lido NUOVA PRESTIGIOSA COSTRUZIONE &nbsp; Piccolo fabbricato di &nbsp;sole 5 unit&agrave; residenziali. Ottime finiture, impianti autonomi, ampio garage e giardino privato. Ultime disponibilit&agrave;: appartamento al piano terra con ingresso indipendente, ampio sogg/pranzo, 3 camere da letto, doppi servizi, doppio garage, scoperto privato.</p>', NULL, 'Jesolo Lido NUOVA PRESTIGIOSA COSTRUZIONEpiccolo fabbricato di sole 5 unita residenziali.', 'RIF. MTG01', 139, NULL, 1, 1, NULL, NULL, 'Piazza Drago, Jesolo Lido', 'B', 'Trattative  riservate', '/uploads/planimetrie/appartamenti-vendite-rif.-mtg01-planimetria.pdf', '2012', 'Piano terra', '90', NULL),
(118, 118, 4, 'Jesolo PORZIONE  VILLETTA A SCHIERA', '<p>Jesolo Lido porzione di Villetta a schiera, posizione di testa, ripartita&nbsp;su pi&ugrave; livelli, terra, primo e sottotetto. Ampi spazi esterni con giardino. Impianti autonomi. Posizione centralissima.</p>', NULL, 'Jesolo Lido porzione di Villetta a schiera posizione di testa su pi livelli, terra, primo e sottotetto in vendita.', 'RIF. MTG 00', 140, NULL, 1, 0, NULL, NULL, 'Piazza Drago - Jesolo Lido', 'G', '350.000', NULL, NULL, 'Piano terra', '160', NULL),
(119, 119, 4, 'Jesolo - APPARTAMENTO in vendita Piazza Mazzini', '<p>Jesolo Lido - Condominio nella centralissima Piazza Mazzini a 50 m dal mare. Appartamento in vendita al terzo piano, con ascensore, composto da ingresso, cucina abitabile, soggiorno, due camere da letto, bagno finestrato, ripostiglio &nbsp;e due terrazzi.</p>', NULL, 'Jesolo Lido Condominio nella centralissima Piazza Mazzini. Appartamento in vendita al terzo piano.', 'RIF. ZMR 03', 141, NULL, 1, 1, NULL, NULL, NULL, 'G', '340.000', NULL, NULL, 'Terzo piano', '97', NULL),
(120, 120, 4, 'Jesolo Lido - CONDOMINIO FRONTEMARE', '<p>Jesolo Lido - Condominio fronte mare con servizio di portineria. Monolocale in vendita &nbsp;al piano rialzato, parzialmente ristrutturato con terrazzo laterale vista mare. Composto da zona notte con letto matrimoniale, zona giorno con angolo cottura, bagno con doccia. Dotato di TV, lavatrice ed aria condizionata.</p>', NULL, 'Jesolo Lido - Condominiofronte mare con servizio di portineria. Monolocale in vendita  al piano rialzato.', 'RIF. RVR 01', 142, NULL, 1, 0, NULL, NULL, 'Piazza Nember - Jesolo Lido', 'G', '160.000', NULL, 'Ristrutturato', 'Piano rialzato', '30', NULL),
(121, 121, 4, 'Jesolo  - APPARTAMENTO in vendita  Piazza Mazzini', '<p>Jesolo Lido - NUOVA COSTRUZIONE pressi di Piazza Mazzini in posizione centralissima ed a pochi passi dal mare. Disponibile attico al 2&deg; ed &nbsp;ultimo piano +&nbsp; mansarda. Ampio soggiorno con angolo cottura, bagno e camera da letto, in mansarda seconda camera e secondo bagno - terrazza e loggia.</p>', NULL, 'Jesolo Lido - NUOVA COSTRUZIONE pressi di Piazza Mazzini -  centralissimaed a pochi passi dal mare.', 'RIF. DM', 143, NULL, 1, 0, NULL, NULL, 'Piazza Mazzini - Jesolo Lido', 'B', '345.000', NULL, '2013', 'Secondo piano', NULL, NULL),
(122, 122, 4, 'Jesolo Lido - FRONTEMARE  NUOVO-   Piazza Mazzini', '<p>Jesolo Lido - FRONTEMARE recente costruzione &nbsp;con piscine. Condominio signorile con parcheggio coperto. Appartamento composto da sogg/pranzo con angolo cottura, due camere da letto, bagno finestrato con doccia, due terrazzi laterali vista mare. Dotato di TV, lavatrice, lavastoviglie, cassaforte, porta blindata, aria condizionata ed impianto riscaldamento autonomo.</p>', NULL, 'Jesolo Lido - vendesi nella centralissima Piazza Mazzini  appartamento in  condominio signorile FRONTEMARE con piscina.', 'RIF. VLL 02', 144, NULL, 1, 1, NULL, NULL, 'Piazza Mazzini - Jesolo Lido', 'E', 'Tratt. riservate', NULL, '2000', 'Terzo piano', '65', NULL),
(123, 123, 4, 'Jesolo Lido - FRONTEMARE  NUOVO -   Piazza Mazzini', '<p>Jesolo Lido - Vendesi nella centralissima Piazza Mazzini &nbsp;appartamento in condominio signorile &nbsp;FRONTEMARE con piscina. Appartamento al 4&deg;ed ultimo piano, composto da 3 camere da letto, soggiorno/pranzo con angolo cottura, due bagni, ampio terrazzo laterale vista mare. Appartamento dotato di aria condizionata, riscaldamento autonomo, TV, lavatrice, lavastoviglie, cassaforte, porta blindata e di due posti auto riservati.</p>', NULL, 'Jesolo Lido Vendesi nella centralissima Piazza Mazzini  appartamento in condominio signorile FRONTEMARE con piscina.', 'RIF. VLL03', 145, NULL, 1, 1, NULL, NULL, 'Piazza Mazzini - Jesolo Lido', 'E', 'Tratt. riservate', NULL, '2000', 'Terzo piano', '85', NULL),
(124, 124, 4, 'Jesolo Lido - Appartamento Frontemare ultimo piano', '<p>Jesolo Lido - appartamento fronte mare tra Piazza Marina e Nember con servizio di portineria. Appartamento al 5&deg; ed ultimo piano, con ascensore, composto da 3 camere da letto, ampio soggiorno con cucinotto separato, due bagni e terrazzo panoramico. Dotato di TV e lavatrice.</p>', NULL, 'Jesolo Lido - Appartamento  fronte mare tra Piazza Marina e Nember con servizio di portineria. Appartamento al 5 ed ultimo piano.', 'RIF. DRT54', 146, NULL, 1, 1, NULL, NULL, 'Piazza Marina - Jesolo Lido', 'G', '580.000', NULL, NULL, 'Quinto piano', '100', NULL),
(125, 125, 4, 'Jesolo - APPARTAMENTO in vendita  Piazza Aurora', '<p>Jesolo Lido - Piccolo fabbricato di sole 3 unit&agrave; in una posizione centralissima a 50 m&nbsp;&nbsp;dal mare. Appartamento al secondo ed ultimo piano, composto da ingresso, ampio soggiorno, cucina abitabile, due camere da letto, bagno e terrazzo. Posizione centralissima.</p>', NULL, 'Jesolo Lido - Piccolo fabbricato di sole 3 unit in una posizione centralissima a pochi passi dal mare. Appartamento al secondo ed ultimo piano.', 'RIF. SST', 147, NULL, 1, 0, NULL, NULL, 'Piazza Aurora - Jesolo Lido', 'G', '300.000', NULL, NULL, 'Secondo piano', '80', NULL),
(127, 127, 4, 'Jesolo - PORZIONE BIFAMILIARE vendesi', '<p>Jesolo Lido porzione Villa bifamiliare&nbsp;su due livelli con ampio spazio privato a disposizione. Piano terra: monovano ed un servizio, primo piano: &nbsp;due camere ed un servizio. Posto auto esterno riservato con copertura pompeiana e magazzino. Ottime finiture.Spese condominiali minime.</p>', NULL, 'Jesolo Lido - porzione Villa Bifamiliare  su due livelli con ampio spazio privato a disposizione.', 'RIF. PLL10', 149, NULL, 1, 0, NULL, NULL, 'Piazza Aurora - Jesolo Lido', 'E', '290.000', NULL, '2008', 'Piano terra e primo piano', '80', NULL),
(128, 128, 4, 'Jesolo - NUOVO RESORT con piscina', '<p>Jesolo - NUOVO RESORT con piscina &nbsp;in costruzione che coniuga elevatissimi standard costruttivi ad un design molto ricercato ed elegante. Progetto che prevede la costruzione di sole &nbsp;10 unit&agrave; e dove si spazia dalla villa singola con ampio giardino privato alla maisonette, tutte dotate di posto auto riservato e coperto.</p>', NULL, 'Jesolo - NUOVO RESORT con piscina  in costruzione che coniuga elevatissimi standard costruttivi ad un design molto ricercato ed elegante.', 'RIF.  NPR', 150, NULL, 1, 1, NULL, NULL, 'Jesolo Lido', 'Casa Clima', 'da 295.000', NULL, NULL, 'Piano terra e primo piano', NULL, NULL),
(129, 129, 4, 'Jesolo Paese SPLENDIDA VILLA SINGOLA', '<p>Jesolo Paese splendida Villa singola , costruzione signorile &nbsp;fine anni 80 su lotto di circa 1000 mq con ampio giardino. Superficie circa 450 mq su due piani.&nbsp;</p>', NULL, 'Jesolo Paese - Splendida Villa singola , costruzione fine anni 80 su lotto di circa 1000 mq con ampio giardino. Superficie circa 450 mq su due piani.', 'RIF. VMLL', 151, NULL, 1, 0, NULL, NULL, 'Jesolo Paese', 'E', 'Tratt. riservate', NULL, NULL, 'Piano terra e primo piano', '450', NULL),
(130, 130, 4, 'Albatros quadri int.B11', '<p>Condominio in zona centralissima con parcheggio riservato. &nbsp;Appartamento al 3&deg; piano, composto da &nbsp;3 camere da letto (6 posti letto), ampio soggiorno, cucina separata , 2 bagni ed ampio &nbsp;terrazzo panoramico . L''appartamento &egrave; dotato di lavatrice, aria condizionata e TV.</p>', NULL, 'Condominio in zona centralissima a pochi metri dal mare', NULL, 153, NULL, 1, 0, NULL, '45.493198, 12.611965', 'Pressi Piazza Aurora', NULL, NULL, NULL, NULL, NULL, NULL, '6'),
(131, 131, 4, 'Centromare  3 camere int 7', '<p>Condominio frontemare in Piazza Mazzini con parcheggio e posto spiaggia riservati. Quadrilocale &nbsp;al piano rialzato con 3 camere da letto (totale 7 posti letto) , sogg/pranzo, cucina separata, 2 bagni ed ampio terrazzo con vista mare frontale. Appartamento dotato di TV, lavatrice, lavastoviglie ed aria condizionata.</p>', NULL, 'Condominio frontemare in Piazza Mazzini,  con parcheggio e posto spiaggia riservati.', NULL, 154, NULL, 1, 0, NULL, '45.495492, 12.617747', 'Via Zara, 5', NULL, NULL, NULL, NULL, NULL, NULL, '7'),
(132, 132, 4, 'Jesolo Lido appartamento frontemare', '<p>Jesolo Lido appartamento su condominio frontemare, ristrutturato, compostao da soggiorno/pranzo, angolo cottura, 2 ampie camere da letto, doppi servizi, ropistiglio, terrazzo vista mare laterale, posto auto riservato. L''appartamento &egrave; dotato di impianti autonomi aria condizionata/pompa di calore. Il tutto ben arredato.</p>', NULL, 'Jesolo Lido, appartamento su condominio frontemare, ristrutturato, centralissimo', 'RIF. CSN01', 155, NULL, 1, 1, NULL, NULL, 'zona piazza Marconi', 'G', '330.000', NULL, NULL, '2', '75', NULL),
(133, 133, 4, 'Albatros 3 camere int B 11', '<p>Jesolo - Condominio nella centralissima Piazza Aurora a pochi passi dal mare con parcheggio e posto spiaggia. Appartamento al 3&deg; piano, con ascensore, composto da spazioso soggiorno, cucinotto separato, 3 camere da letto (un totale di 6 posti letto), due bagni ed ampio terrazzo abitabile e panoramico. L''appartamento &egrave; dotato di TV, lavatrice ed &nbsp;aria condizionata.</p>', NULL, 'Condominio  nella centralissima Piazza Aurora a pochi passi dal mare con parcheggio e posto spiaggia.', NULL, 156, NULL, 1, 0, NULL, NULL, 'Piazza Aurora - Via Foscolo n. 9', NULL, NULL, NULL, NULL, NULL, NULL, NULL),
