(140, 15, 1, 'Adriatico 54 (UK)', '<p>Condominio frontemare con parcheggio condominiale (non assegnato) e servizio spiaggia . Disponiamo di&nbsp;un appartamento al quinto ed ultimo piano, con ascensore, composto da ampio soggiorno con cucinotto separato, 3 camere da letto (un totale di 6 posti letto), due bagni e spazioso terrazzo frontale con spledida vista sul mare. L''appartamento &egrave; dotato di TV e lavatrice.</p>', '', 'Condominio frontemare con parcheggio condominiale e servizio spiaggia.', '', 22, '', 1, 0, 0, '45.489471, 12.603694', 'Via Padova, 21', '', '', '', '', '', '', '6'),
