(146, 21, 1, 'Helvetia int 64B (UK)', '<p>Condominio frontemare con parcheggio condominiale (non assegnato), spiaggia privata e servizio di portineria. Disponiamo di&nbsp;un appartamento al 4&deg; piano, con ascensore, composto &nbsp;ampio soggiorno con cucinotto separato, &nbsp;due ampie camere da letto matrimoniali &nbsp;ed un piccola cameretta con un letto singolo (in totale 7 posti letto), due bagni e terrazzo abitabile con vista frontale sul mare. L''appartamento &egrave; dotato di TV, lavatrice e lavastoviglie.</p>', '', 'Condominio frontemare con parcheggio condominiale, spiaggia privata e servizio di portineria.', '', 36, '', 1, 0, 0, '45.485115, 12.595051', 'Vicino a Piazza Nember  - Via Padova n. 53', '', '', '', '', '', '', '7'),
(147, 28, 1, 'Villa Elsa 2 camere (UK)', '<p>Recente costruzione fronte mare in Piazza Mazzini, con 2 piscine (una per adulti e per bimbi), parcheggio coperto, posto&nbsp;spiaggia riservato (due lettini ed un ombrellone per appartamento). Disponiamo di trilocali , al 3&deg; e 4&deg; piano, con ascensore, composti da &nbsp;due camere da letto (dai 4 ai 5 posti letto), &nbsp;bagno finestrato con doccia &nbsp;e due ampi terrazzi laterli vista mare. Gli appartamenti sono tutti &nbsp;dotati di TV, lavatrice, aria condizionata, lavastoviglie, mircoonde, cassaforte e &nbsp;porta blindata.</p>', '', 'Condominio di recente costruzione in posizione centralissima di Jesolo. Frontemare  con due piscine, parcheggio coperto e posto spiaggia riservato.', '', 50, '', 1, 0, 0, '45.496088, 12.619294', 'Piazza Mazzini, 8', '', '', '', '', '', '', '5'),
(148, 29, 1, 'Villa Emy 2 camere (UK)', '<p>Piccolo condominio frontemare in posizione centralissima, vicinanze Piazza Aurora, dotato di parcheggio &nbsp;riservato e di spiaggia privata. Disponiamo di trilocali (max 5 posti letto), tutti con terrazza panoramica frontale sul mare o piccolo scoperto privato, composti da soggiorno/pranzo con angolo cottura , camera matrimoniale, seconda &nbsp;cameretta con letto a castello e bagno finestrato con doccia. Sono dotati di aria condizionata, lavatrice, microonde, cassaforte, porta blindata, &nbsp;di un posto auto riservato e di un posto spiaggia nell''area privata (un ombrellone , una sedia sdraio ed un lettino per appartamento).</p>', '', 'Piccolo condominio di piccole dimensioni sul fronte mare con parcheggio  e spiaggia privata.', '', 51, '', 1, 0, 0, '45.493611, 12.614631', 'Via Carducci, 1', '', '', '', '', '', '', '4'),
(149, 30, 1, 'Desiree 10 (UK)', '<p>Condominio fronte mare in posizione centralissima, pressi di Piazza Mazzini, &nbsp;dotato di parcheggio riservato, posto spiaggia e piccola piscina per bimbi. Appartamento trilocale, al primo piano, con ascensore, &nbsp;composto da soggiorno/pranzo con angolo cottura, camera matrimoniale, seconda cameretta con letto a castello, &nbsp;bagno &nbsp;finestrato con doccia, terrazzo con vista mare frontale. Appartamento dotato di TV, lavatrice e pale di ventilazione al soffitto nella camera matrimoniale.</p>', '', 'Condominio fronte mare in posizione centralissima dotato di parcheggio riservato, posto spiaggia e piccola piscina per bimbi.', '', 52, '', 1, 0, 0, '45.497403, 12.624220', 'Via Bafile, 22 acc. mare - n.4', '', '', '', '', '', '', '5'),
