(152, 34, 1, 'Condominio Marconi (UK)', '<p>Condominio frontemare nei pressi di Piazza Nember con parcheggio condominiale (non assegnato) , posto spiaggia e servizio di portineria. Appartamento al 2&deg; piano, con ascensore, composto da ampio sogg/pranzo con angolo cottura, camera matrimoniale con letto a castello nella stessa, seconda cameretta con due letti singoli, 2 &nbsp;bagni, &nbsp; terrazzo con vista mare laterale est. L''appartamento &egrave; dotato di TV e lavatrice.</p>', '', 'Condominio frontemare con parcheggio condominiale , servizio spiaggia e portineria.', '', 56, '', 1, 0, 0, '45.485731, 12.596433', 'Vicino a Piazza Nember  - Via Dandolo n.5', '', '', '', '', '', '', '6'),
(153, 35, 1, 'Union 6 (UK)', '<p>Condominio fronte mare in zona centrale, pressi di Piazza Marconi, &nbsp;dotato di parcheggio &nbsp;e posto spiaggia riservati. Appartamento al piano rialzato, composto da soggiorno/pranzo con angolo cottura e divano letto, &nbsp;ampia camera con letto matrimoniale ed un singolo, &nbsp;bagno finestrato &nbsp;con doccia &nbsp;e terrazza vista mare laterale est. L''appartamento &egrave; dotato di TV.</p>', '', 'Condominio fronte mare con parcheggio e posto spiaggia riservati.', '', 57, '', 1, 0, 0, '45.504703, 12.646369', '2 Accesso al Mare Via Bafile n. 3', '', '', '', '', '', '', '4'),
(154, 36, 1, 'Union 9 FM (UK)', '<p>Condominio fronte mare in zona centrale, pressi di Piazza Marconi, &nbsp;dotato di parcheggio &nbsp;e posto spiaggia riservati. Appartamento al piano primo, con ascensore, &nbsp;composto &nbsp;da &nbsp;soggiorno/pranzo con angolo cottura ,ampia camera con letto matrimoniale +&nbsp;un singolo, seconda cameretta con due letti&nbsp;singoli, &nbsp;, bagno con doccia ed ampia terrazza con vista panoramica frontale sul mare. L''appartamento &egrave; dotato di TV e lavatrice.</p>', '', 'Condominio fronte mare con parcheggio e posto spiaggia riservati.', '', 58, '', 1, 0, 0, '45.504703, 12.646369', '2 Accesso al Mare Via Bafile n. 3', '', '', '', '', '', '', '5'),
(155, 37, 1, 'Puerto del Sol (UK)', '<p>Condominio frontemare con piscina, pressi di Piazza Milano, &nbsp;dotato di parcheggio coperto e posto spiaggia riservato nell''area della piscina. &nbsp;Appartamento al 4&deg; piano, con ascensore, composto da sogg/pranzo con angolo cottura, camera matrimoniale, seconda cameretta con letto a castello, &nbsp;bagno con doccia &nbsp;e terrazzino. L''appartamento &egrave; dotato di TV e lavatrice.</p>', '', 'Condominio frontemare con piscina, dotato di parcheggio riservato e coperto e posto spiaggia.', '', 59, '', 1, 0, 0, '45.512679, 12.667707', 'Via Levantina , 152', '', '', '', '', '', '', '4'),
(156, 38, 1, 'La Quercia  - app.  D24 (UK)', '<p>Jesolo - Piazza Mazzini - Costruzione fronte mare dotata di piscina, sia per adulti che&nbsp;&nbsp;una pi&ugrave; piccola per bimbi, di spiaggia riservata e servizio di portineria. Disponiamo di &nbsp;un appartamento al primo piano, con ascensore, composto &nbsp;da soggiorno con angolo cottura, due camere da letto (una matrimoniale + un singolo e la 2&deg; con un &nbsp;letto a castello, per un totale di 5 posti letto ), &nbsp;bagno finestrato con doccia e terrazzo NO vista mare. L''appartamento &egrave; dotato di TV, lavatrice, aria condizionata e di un posto auto riservato.</p>', '', 'Condominio centralissimo con piscina, dotato di posto spiaggia riservato e di parcheggio.', '', 60, '', 1, 1, 0, '45.495158, 12.616989', 'Via Zara, 9', '', '', '', '', '', '', '5'),
(157, 39, 1, 'La Quercia  - app.  D66 (UK)', '<p>Jesolo Lido - Costruzione fronte mare nella centralissima Piazza Mazzini &nbsp;dotata di piscina, per adulti ed una pi&ugrave; piccola per bimbi, di spiaggia riservata e servizio di portineria. Disponiamo di &nbsp;un appartamento al quarto piano, con ascensore, composto da due camere da letto (una matrimoniale + un letto singolo e la 2&deg; con letto a castello), soggiorno con angolo cottura e bagno e terrazzino NO &nbsp;vista mare.&nbsp;L''appartamento &egrave; dotato di TV, lavatrice ed aria condizionata.</p>', '', 'Condominio centralissimo in Piazza Mazzini sul fronte mare con piscina, dotato di posto spiaggia riservato , di parcheggio e di servizio di portineria.', '', 61, '', 1, 0, 0, '45.495158, 12.616989', 'Via Zara, 9', '', '', '', '', '4', '', '5'),
(158, 41, 1, 'La Quercia  - app.  D58 (UK)', '<p>Costruzione fronte mare nella centralissima Piazza Mazzini, &nbsp;dotata di piscina, per adulti ed una pi&ugrave; piccola per bimbi, di spiaggia riservata e servizio di portineria. Disponiamo di &nbsp;un appartamento al quarto piano, con ascensore, composto da due camere da letto (una matrimoniale + un singolo e la 2&deg; con due letti singoli), soggiorno con angolo cottura , bagno finestrato con doccia &nbsp;e terrazzo &nbsp;vista mare laterale est. L''appartamento &egrave; dotato di TV, lavatrice ed aria condizionata.</p>', '', 'Condominio centralissimo con piscina, dotato di posto spiaggia riservato e di parcheggio.', '', 63, '', 1, 0, 0, '45.495158, 12.616989', 'Via Zara, 9', '', '', '', '', '', '', '5'),
(159, 42, 1, 'Villa Elsa - app.  A3 (UK)', '<p>Residence di recente costruzione fronte mare nella centralissima Piazza Mazzini , con 2 piscine ( una per adulti ed una per bimbi), parcheggio coperto e posto spiaggia riservato. Disponiamo di un trilocale al piano terra, composto da due camere da letto (5 posti letto in totale), sogg/pranzo con angolo cottura, bagno con doccia ed ampio giardino privato ed attrezzato. L''appartamento &egrave; dotato di TV, lavatrice, lavastoviglie, cassaforte, porta blindata ed aria condizionata.</p>', '', 'Residence fronte mare,  di recente costruzione , posizione centralissima. Dotato di due piscine, parcheggio coperto e posto spiaggia riservato.', '', 64, '', 1, 0, 0, '45.496088, 12.619294', 'Piazza Mazzini, 8', '', '', '', '', '', '', '5'),
(160, 43, 1, 'Villa Elsa - app.  B12 (UK)', '<p>Recente costruzione fronte mare nella centralissima Piazza Mazzini, con 2 piscine (una per adulti ed una per bimbi), parcheggio coperto e posto spiaggia riservato. Disponiamo di un trilocale al piano primo, con ascensore, composto da sogg/pranzo con angolo cottura, &nbsp;camera &nbsp;da letto matrimoniale + un letto singolo, seconda cameretta con due letti singoli, &nbsp;bagno finestrato con doccia e due ampie terrazze vista mare laterale est. L''appartamento &egrave; dotato di TV, lavatrice, lavastoviglie, aria condizionata, cassaforte e porta blindata.</p>', '', 'Condominio frontemare in posizione centralissima. Dotato di  due piscine, parcheggio coperto e posto spiaggia riservato.', '', 65, '', 1, 0, 0, '45.496088, 12.619294', 'Piazza Mazzini, 8', '', '', '', '', '', '', '5'),
(161, 44, 1, 'Villa Elsa frontemare  3 camere (UK)', '<p>Appartamenti in&nbsp;condominio &nbsp;fronte mare in Piazza Mazzini, con 2 piscine ( una per adulti ed una &nbsp;per bimbi), parcheggio per due auto&nbsp;e posto spiaggia riservato. Disponiamo di quadrilocali , al 3&deg; e 4&deg; piano, con ascensore, composti da tre camere da letto (6 posti letto), due bagni ed ampio terrazzo panoramico con&nbsp;vista mare laterale o frontale. &nbsp;Gli appartamenti sono tutti&nbsp;dotati di aria condizionata, &nbsp;lavatrice, lavastoviglie, microonde, TV, cassaforte&nbsp; e &nbsp;porta blindata.</p>', '', 'Appartamento in condominio  fronte mare  in posizione centralissima di Jesolo, con 2  piscine, parcheggio coperto e posto spiaggia riservato.', '', 66, '', 1, 1, 0, '45.496088, 12.619294', 'Piazza Mazzini, 8', '', '', '', '', '', '', '6'),
(162, 45, 1, 'Villa Farina 3 camere (UK)', '<p>Piccola costruzione di poche unit&agrave; sul fronte mare, in posizione centralissima, &nbsp;con posto &nbsp;spiaggia e parcheggio riservato per due &nbsp;auto. Disponiamo di un appartamento al primo piano, &nbsp;completamente ristrutturato , composto da un ampio soggiorno con cucinotto separato, spaziosa &nbsp;terrazza panoramica fronte mare, &nbsp; 3 camere da letto (in totale 6 posti letto) e doppi servizi . L''appartamento &egrave; dotato di aria condizionata, lavatrice, lavastoviglie, TV.</p>', '', 'Piccola costruzione di poche unit sul fronte mare, con spiaggia privata e parcheggio riservato per due posti auto. Disponiamo di un ampio appartamento al primo piano fronte mare', '', 67, '', 1, 1, 0, '45.498201, 12.627233', 'Tra Piazza Mazzini e Piazza Brescia - 16 accesso al mare', '', '', '', '', '', '', '6'),
(163, 46, 1, 'Casa Alberti 2 camere - app.  int. 2 (UK)', '<p>Piccola costruzione circondata da giardino, posizione centralissima nei pressi di Piazza Aurora a pochi passi dal mare, con parcheggio comodo. Appartamento al primo piano, composto da due camere da letto (in totale 5 posti letto), sogg/pranzo con angolo cottura, bagno e terrazzino. L''appartamento &egrave; dotato di TV, lavatrice, cassaforte e pale ventilatrice al soffitto.</p>', '', 'Piccola costruzione circondata dal verde in posizione centralissima. Appartamenti con due camere, sogg/pranzo, bagno e terrazzo.', '', 68, '', 1, 0, 0, '45.494523, 12.610042', 'Vicino Piazza Aurora - Via Alberti, n 18', '', '', '', '', '', '', '5'),
