(166, 49, 1, 'Casa Amalia 2 camere - int.1 (UK)', '<p>Vicinanze piazza Nember piccola costruzione a pochi passi &nbsp;dal mare con parcheggio e posto spiaggia riservati. Appartamento al primo piano, completamente ristrutturato, composto da sogg/pranzo con angolo cottura, camera matrimoniale, cameretta con due letti singoli &nbsp;(in totale 5 posti letto), bagno con doccia ed ampia terrazza abitabile sul corso principale. L''appartamento &egrave; dotato di TV, lavatrice, aria condizionata e porta blindata.</p>', '', 'Piccola costruzione sul corso principale nei pressi di P.zza Nember a pochi passi dal mare. Disponiamo di trilocali con posto auto e posto spiaggia riservati.', '', 71, '', 1, 1, 0, '45.488381, 12.599654', 'Pressi Piazza Nember - Via Verdi, 111', '', '', '', '', '', '', '5');
