(168, 51, 1, 'Casa Amalia 2 camere - int. 4 (UK)', '<p>Piccola costruzione a pochi passi &nbsp;dal mare, nei pressi di Piazza Nember, &nbsp;con parcheggio e posto spiaggia riservati. Appartamento al primo piano, &nbsp;completamenti ristrutturato, composto da sogg/pranzo con angolo cottura, camera matrimoniale, cameretta con due letti (in totale 5 posti letto), bagno con doccia ed ampia terrazza abitabile. L''appartamento &egrave; dotato di TV, lavatrice, aria condizionata e porta blindata.</p>', '', 'Piccola costruzione sul corso princiaple a pochi passi dal mare. Disponiamo di trilocali con posto auto e posto spiaggia.', '', 73, '', 1, 0, 0, '', 'Pressi Piazza Nember - Via Verdi, 111', '', '', '', '', '', '', '5'),
(169, 52, 1, 'Casa Carlotta 3 camere - int. 2 (UK)', '<p>Piccola costruzione su accesso al mare vicino alla&nbsp;centralissima Piazza Mazzini con parcheggio e posto spiaggia riservati. Appartamento su due livelli: <strong>primo piano</strong> composto da sogg/pranzo con angolo cottura, camera matrimoniale , bagno ed ampia terrazza sul corso principale , <strong>piano mansardato</strong>:due camere da letto &nbsp;con bagno con doccia. L''appartamento &egrave; dotato di TV, lavatrice ed aria condizionata nella zona mansardata, due posti auto riservati ed un posto spiaggia.</p>', '', 'Piccola costruzione su accesso al mare in posizione centralissima. Trilocali, disponibili al primo piano con posto auto e posto spiaggia..', '', 74, '', 1, 0, 0, '45.497633, 12.622264', 'Pressi P.zza Mazzini 25 accesso al mare', '', '', '', '', '', '', '6'),
(170, 53, 1, 'Casa Carlotta 3 camere - int.3 (UK)', '<p>Jesolo Lido , pressi Piazza Mazzini &nbsp;piccola costruzione su accesso al mare in posizione centralissima con parcheggio e posto spiaggia riservati. Appartamento su due livelli: <strong>primo piano</strong> composto da sogg/pranzo con angolo cottura, camera da letto&nbsp;matrimoniale , bagno ed ampia terrazza sul corso principale <strong>, piano mansardato</strong>: due camere da letto &nbsp;con bagno (totale di 6 posti letto). L''appartamento &egrave; dotato di TV, lavatrice, lavastoviglie ed aria condizionata nella zona mansardata, due posti auto riservati ed un posto spiaggia.</p>', '', 'Piccola costruzione di poche unit su accesso al mare,  posizione centralissima . Appartamento disponibili con 3 camere da letto ,  posto auto  e posto spiaggia.', '', 75, '', 1, 0, 0, '45.497633, 12.622264', 'Pressi P.zza Mazzini 25 accesso al mare', '', '', '', '', '', '', '6'),
(171, 54, 1, 'Casa Trentin 2 camere (UK)', '<p>Piazza Aurora - Condominio ristrutturato sul corso principale &nbsp;a soli 50 mt dal mare con posto auto riservato. Disponiamo di appartamenti al primo e secondo piano, &nbsp;composti da &nbsp;2 camere da letto , sogg/pranzo con angolo cottura e divano letto (in totale 5 posti letti) , un &nbsp;bagno finestrato e terrazza. Tutti sono dotati di &nbsp;lavatrice, cassaforte, TV, aria condizionata &nbsp;e porta blindata.</p>', '', 'Piccola costruzione a 50 mt dal mare nella centralissima Piazza Aurora  con parcheggio riservato.', '', 76, '', 1, 0, 0, '45.494197, 12.613041', 'Vicino Piazza Aurora Via Trentin, 117', '', '', '', '', '', '', '5'),
(172, 55, 1, 'Casa Trentin 1 camera attico (UK)', '<p>Condominio ristrutturato in Piazza Aurora sul corso principale &nbsp;a soli 50 mt dal mare con posto auto riservato. Disponiamo di un bilocale al secondo ed ultimo piano attico, &nbsp; composto da &nbsp;1 camera da letto matrimoniale , sogg/pranzo con angolo cottura e divano letto (in totale 4 posti letti) , un &nbsp;bagno finestrato ed ampia terrazza panoramica di circa 60 mq. &nbsp; Dotato di &nbsp;aria condizionata, TV , lavatrice &nbsp;e porta blindata.</p>', '', 'Piccola costruzione a 50 mt dal mare in posizione centralissima  con parcheggio riservato.', '', 77, '', 1, 0, 0, '45.494197, 12.613041', 'Vicino Piazza Aurora Via Trentin, 117', '', '', '', '', '', '', '4'),
(173, 56, 1, 'Albatros bilocale int.9A (UK)', '<p>Condominio nella centralissima Piazza Aurora a pochi metri dal mare con posto spiaggia riservato e posto auto coperto. Appartamento al 3&deg;piano, con ascensore, composto da camera da letto matrimoniale, sogg/pranzo con angolo cottura e divano letto (totale di 4 posti letto) , bagno ed ampio terrazzo abitabile e &nbsp;panoramico rivolto a sud / ovest. &nbsp;L''appartamento &egrave; dotato di TV , lavatrice, cassaforte ed aria condizionata.</p>', '', 'Condominio nella  centralissima Piazza Aurora  a pochi metri dal mare con posto spiaggia.', '', 78, '', 1, 1, 0, '45.493198, 12.611965', 'Piazza Aurora', '', '', '', '', '', '', '4'),
(174, 57, 1, 'Albatros bilocale int.12A (UK)', '<p>Condominio nella centralissima Piazza Aurora&nbsp;a pochi metri dal mare con posto spiaggia riservato e parcheggio riservato a 200 mt dallo stabile. Appartamento al 4&deg;piano, con ascensore, composto da camera &nbsp;con letto matrimoniale + letto a castello nella stessa, sogg/pranzo con angolo cottura, bagno ed ampio terrazzo abitabile e &nbsp;panoramico rivolto verso sud / ovest. Posto auto e posto spiaggia riservati. L''appartamento &egrave; dotato di TV.</p>', '', 'Condominio nella centralissima Piazza Aurora  a pochi metri dal mare con posto spiaggia riservato.', '', 79, '', 1, 0, 0, '45.493198, 12.611965', 'Piazza Aurora - Via Foscolo, 9', '', '', '', '', '', '', '4'),
(175, 58, 1, 'Albatros  3 camere  int. B16 (UK)', '<p>Condominio nella&nbsp;centralissima Piazza Aurora a pochi passi dal mare con parcheggio e posto spiaggia riservati. &nbsp;Appartamento al 4&deg; piano, composto da &nbsp;3 camere da letto (6 posti letto), spazioso&nbsp;soggiorno, cucina separata , 2 bagni ed ampio &nbsp;terrazzo panoramico . L''appartamento &egrave; dotato di lavatrice, lavastoviglie, aria condizionata e TV.</p>', '', 'Condominio nella  centralissima Piazza Aurora  a pochi metri dal mare con posto auto e posto spiaggia riservati.', '', 80, '', 1, 0, 0, '45.493198, 12.611965', 'Piazza Aurora, Via Foscolo n. 9', '', '', '', '', '', '', '6'),
(176, 60, 1, 'Arena  2 camere (UK)', '<p>Condominio nella centralissima Piazza Aurora&nbsp;con parcheggio riservato. Appartamento al primo piano, composto da soggiorno/pranzo con angolo cottura, camera matrimoniale, seconda camera con due letti singoli, bagno con doccia ed ampia terrazza abitabile ed attrezzata che si affaccia sul corso principale. L''appartamento &egrave; dotato di TV, lavatrice ed aria condizionata.</p>', '', 'Condominio nella  centralissima Piazza Aurora con parcheggio riservato.', '', 82, '', 1, 0, 0, '45.494165, 12.612809', 'Piazza Aurora - Via Trentin,  123', '', '', '', '', '', '', '4'),
(177, 61, 1, 'Barracuda 3 camere (UK)', '<p>Condominio sul corso principale nei pressi di Piazza Marconi a pochi passi dal mare con parcheggio riservato. Appartamento al primo piano, composto da tre ampie camere matrimoniali (7 posti letto), due bagni, soggiorno, cucina separata &nbsp;ed ampia terrazza abitabile che si affaccia sul corso principale. L''appartamento &egrave; dotato di TV e lavatrice.</p>', '', 'Condominio sul corso principale a pochi passi dal mare  con parcheggio riservato.', '', 83, '', 1, 0, 0, '45.505186, 12.641660', 'Pressi P.Marconi - Via Barracuda, 4', '', '', '', '', '', '', '7'),
(178, 62, 1, 'Cristallo monolocale (UK)', '<p>Condominio in posizione centrale a 100 mt dal mare con parcheggio riservato e chiuso e posto spiaggia. Monolocale al primo piano, composto da una zona notte con un letto matrimoniale ed una zona giorno, con angolo cottura , bagno con doccia e terrazzino. Il monolocale &egrave; dotato di TV e di cassaforte.</p>', '', 'Piazza Aurora - Condominio  in posizione centrale con parcheggio e posto spiaggia riservati.', '', 84, '', 1, 0, 0, '45.493675, 12.610712', 'Piazza Aurora - Via Alberti,  12', '', '', '', '', '', '', '3'),
(179, 63, 1, 'Diana 2 camere (UK)', '<p>Condominio sul corso principale nelle vicinanze di Piazza Marina a soli 100 m dal mare &nbsp;con spiaggia riservato. Disponiamo di splendido attico al 5&deg; ed ultimo piano, con ascensore, composto da soggiorno/ pranzo con angolo cottura, ampio terrazzo panoramico, due camere da letto (totale di 5 posti letto) e &nbsp;bagno finestrato con doccia. Dispone di aria condizionata, TV e lavatrice.</p>', '', 'Condominio sul corso principale  nei pressi di Piazza Marina a 100 m dal mare con spiaggia riservata.', '', 85, '', 1, 0, 0, '45.490837, 12.605091', 'Pressi Piazza Marina - Via Verdi, 84', '', '', '', '', '', '', '5'),
(180, 64, 1, 'Flaminia 2 camere  int.2 (UK)', '<p>Condominio su accesso al mare a pochi passi dal mare in posizione centralissima, vicinanze Piazza Mazzini. Appartamento al piano rialzato, composto da ampio soggiorno con cucinotto, camera da letto con matrimoniale + un letto a castello, seconda camera con letto matrimoniale, bagno con doccia finestrato e terrazzo Dispone di un posto auto &nbsp;ed un posto spiaggia riservati inoltre &egrave; dotato di TV e lavatrice.&nbsp;</p>', '', 'Condominio su accesso al mare in posizione centralissima con posto auto e posto spiaggia riservati.', '', 86, '', 1, 0, 0, '45.498272, 12.624657', '20 acc mare Via Bafile, n. 359', '', '', '', '', '', '', '5'),
