(184, 68, 1, 'Parigi 2 camere  int.6 (UK)', '<p>Condominio su accesso al mare, in Piazza Mazzini, con &nbsp;parcheggio e posto &nbsp;spiaggia riservati. &nbsp;Appartamento al secondo piano, composto da &nbsp;camera matrimoniale , piccola cameretta conn letto letto a castello , sogg/pranzo con angolo cottura, bagno e terrazzino. Dotato di TV e di pale ventilatrici.</p>', '', 'Piazza Mazzini - Condominio su accesso al mare in posizione centralissima con posto auto e posto spiaggia riservati.', '', 90, '', 1, 0, 0, '45.497039, 12.620172', '29 accesso al mare, n 4  - pressi  Piazza Mazzini', '', '', '', '', '', '', '4'),
