(221, 107, 1, 'Appartamento bilocale Jesolo (UK)', '<p>Jesolo Lido - Residence con due &nbsp;piscine a 300 mt dal mare nei pressi di Piazza Marina &nbsp;. Appartamento al primo ed ultimo piano, &nbsp;con posto auto riservato. Bilocale &nbsp;composto da una camera da letto , soggiorno/ pranzo con angolo cottura e &nbsp;bagno finestrato. Ampio spazio verde in comune.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', '', 'Jesolo Lido - Residence con  due piscine a 300 mt dal mare. Appartamento al primo ed ultimopiano con posto auto riservato.', 'RIF. VG', 129, '', 1, 0, 0, '', 'Piazza Marina - Jesolo Lido', 'G', '139.000', '', '', 'Primo piano', '40', ''),
(222, 108, 1, 'Jesolo appartamento 2 camere (UK)', '<p>Jesolo Lido - Residence con due piscine a 300 mt dal mare nei pressi di Piazza Marina . Appartamento al piano terra con posto auto riservato. Trilocale composto da una camera da letto matrimoniale + un letto singolo, seconda camera con letto matrimoniale, soggiorno/ pranzo con angolo cottura, bagno finestrato e scoperto privato dotato di pompeiana. L''appartamento &egrave; fornito di aria condizionata, TV, lavatrice e lavastoviglie.</p>', '', 'Jesolo Lido - Residence con due piscine a 300 mt dal mare nei pressi di Piazza Marina . Appartamento al piano terra con posto auto riservato.', 'RIF. VG02', 130, '', 1, 0, 0, '', 'Piazza Marina - Jesolo Lido', 'G', '240.000', '', '', 'Piano terra', '60', ''),
(223, 109, 1, 'Jesolo  - P.zza Mazzini trilocale in vendita (UK)', '<p>Jesolo Lido - Condominio &nbsp;in posizione &nbsp;centralissima a pochi passi dal mare. Disponiamo di trilocale &nbsp;completamente ristrutturato, al 5&deg; piano, con ascensore, composto &nbsp;da ampio soggiorno / pranzo con angolo cottura, &nbsp;camera matrimoniale, seconda cameretta con due letti singoli, bagno finestrato e piccolo terrazzino. Completamente arredato e dotato di TV, lavatrice &nbsp;ed &nbsp;aria condizionata .</p>', '', 'Jesolo Lido - Condominio in posizione  centralissima a pochi passi dal mare.Trilocale completamente ristrutturato.', 'RIF.SHM03', 131, '', 1, 0, 0, '', 'Piazza Mazzini - Jesolo Lido', 'G', '200.000', '', 'Ristrutturato', 'Quinto piano', '65', ''),
(224, 110, 1, 'Jesolo Lido - FRONTEMARE - Piazza Mazzini (UK)', '<p>Jesolo Lido - Frontemare - Piazza Mazzini - Condominio &nbsp;sul mare con servizio di portineria. Monolocale al 4&deg; piano, con ascensore, &nbsp; completamente ristrutturato con soggiorno/pranzo ed angolo cottura, bagno ed ampia terrazza panoramica. Spese condominiali minime.</p>', '', 'Jesolo Lido - Condominio centralissimo sul mare con servizio di portineria. Monolocale  completamente ristrutturato con ampia terrazza panoramica.', 'RIF. CM01', 132, '', 1, 1, 0, '', 'Piazza Mazzini - Jesolo Lido', 'G', '190.000', '', 'Ristrutturato', 'Quinto piano', '30', ''),
(225, 111, 1, 'Jesolo Lido - FRONTEMARE -   Piazza Mazzini (UK)', '<p>Jesolo Lido - Condominio fronte mare in Piazza Mazzini con servizio di portineria. Bilocale al &nbsp;secondo piano, con ascensore, composto da ampio soggiorno / pranzo con angolo cottura, ampia camera matrimoniale, bagno con doccia e terrazza abitabile attrezzata. Dotato di TV, lavatrice ed aria condizionata.</p>', '', 'Jesolo Lido - Condominio fronte mare in Piazza Mazzini con servizio di portineria. Bilocale al  secondo piano.', 'RIF. CM 02', 133, '', 1, 0, 0, '', 'Piazza Mazzini - Jesolo Lido', 'G', '240.000 tratt.', '', 'Ristrutturato', 'Secondo piano', '45', ''),
(226, 112, 1, 'Jesolo Lido - GOLF CLUB (UK)', '<p>Jesolo Lido - Prestigioso residence con piscine, ampio spazio verde e campi da golf. Appartamento di recente costruzione al primo piano, composto da un soggiorno pranzo con angolo cottura, camera matrimoniale, cameretta con due letti singoli, bagno e terrazze con bellissima vista sul golf. Completamento arredato e dotato di riscaldamento autonomo ed aria condizionata. Due posti auto riservati e box golf car.&nbsp;</p>', '', 'Jesolo Lido - Prestigioso residence con piscine, ampio spazio verde e campi da golf. Appartamento di recente costruzione al primo piano.', 'RIF. GLF 01', 134, '', 1, 1, 0, '', 'Piazza Aurora - Jesolo Lido', 'E', '220.000', '', '2006', 'Primo piano', '65', ''),
(227, 113, 1, 'Jesolo Lido - GOLF CLUB (UK)', '<p>Prestigioso residence con piscine, ampio spazio verde e campi da golf. Appartamento su tre livelli, <strong>piano terra</strong> composto da soggiorno/ pranzo con angolo cottura. bagno e scoperto privato, <strong>primo piano</strong> composto da 2 camere da letto e bagno, <strong>secondo piano</strong> composto da solarium con splendida vista sul green. Arredato e completo di riscaldamento autonomo, aria condizionata, parcheggio privato e box golf car.</p>', '', 'Prestigioso residence con piscine, ampio spazio verde e campi da golf. Appartamento su tre livelli.', 'RIF. GLF02', 135, '', 1, 1, 0, '', 'Piazza Aurora - Jesolo Lido', 'E', 'Trattative riservate', '', '2006', 'Piano terra, primo e secondo piano', '100', ''),
(228, 114, 1, 'Jesolo - VILLA  SINGOLA  residence con piscine (UK)', '<p>Jesolo Lido VILLA SINGOLA in residence alle spalle di Piazza Aurora con ampio spazio verde e piscine. Villa singola composta da soggiorno / pranzo, due camere da letto, bagno finestrato con doccia, 2 pompeiane esterne, barbeque esterno, ampio giardino di circa 400 mq piantumato ed irrigato. Dotata &nbsp;di riscaldamento autonomo , aria condizionata, TV, lavatrice e lavastoviglie.&nbsp;</p>', '', 'Jesolo Lido VILLA SINGOLA   alle spalle di Piazza Aurora con ampio spazio verde e piscine.', 'RIF. PRC01', 136, '', 1, 1, 0, '', 'Piazza Aurora - Jesolo Lido', 'E', '330.000', '', '2006', 'Piano terra', '65', ''),
(229, 115, 1, 'Jesolo  NUOVA COSTRUZIONE Piazza Aurora (UK)', '<p>Jesolo Lido - Nuova costruzione alle spalle di Piazza Aurora. In una tranquilla zona residenziale, a poche centinaia di metri dal mare. Sono state ricavate 3 nuove unit&agrave; di ampie metrature. Disponibile porzione ad ovest con ingresso indipendente, area esclusiva per giardino e con la possibilit&agrave; di almeno due posti auto . Assolutamente adeguate ad una residenza stabile e comunque con caratteristiche non comuni ed apprezzabili da tutti coloro che desiderano, anche al mare, una vera casa.&nbsp;</p>', '', 'Jesolo Lido Nuova costruzione alle spalle di Piazza Aurora. Disponibile porzione ad ovest con ingresso indipendente.', 'RIF. AMD00', 137, '', 1, 0, 0, '', 'Piazza Aurora - Jesolo Lido', 'C', '370.000', '', '2010', 'Piano terra, primo piano e mansardato', '150', ''),
(230, 117, 1, 'Jesolo PRESTIGIOSA COSTRUZIONE (UK)', '<p>Jesolo Lido NUOVA PRESTIGIOSA COSTRUZIONE &nbsp; Piccolo fabbricato di &nbsp;sole 5 unit&agrave; residenziali. Ottime finiture, impianti autonomi, ampio garage e giardino privato. Ultime disponibilit&agrave;: appartamento al piano terra con ingresso indipendente, ampio sogg/pranzo, 3 camere da letto, doppi servizi, doppio garage, scoperto privato.</p>', '', 'Jesolo Lido NUOVA PRESTIGIOSA COSTRUZIONEpiccolo fabbricato di sole 5 unita residenziali.', 'RIF. MTG01', 139, '', 1, 1, 0, '', 'Piazza Drago, Jesolo Lido', 'B', 'Trattative  riservate', '/uploads/planimetrie/appartamenti-vendite-rif.-mtg01-planimetria.pdf', '2012', 'Piano terra', '90', ''),
(231, 118, 1, 'Jesolo PORZIONE  VILLETTA A SCHIERA (UK)', '<p>Jesolo Lido porzione di Villetta a schiera, posizione di testa, ripartita&nbsp;su pi&ugrave; livelli, terra, primo e sottotetto. Ampi spazi esterni con giardino. Impianti autonomi. Posizione centralissima.</p>', '', 'Jesolo Lido porzione di Villetta a schiera posizione di testa su pi livelli, terra, primo e sottotetto in vendita.', 'RIF. MTG 00', 140, '', 1, 0, 0, '', 'Piazza Drago - Jesolo Lido', 'G', '350.000', '', '', 'Piano terra', '160', ''),
(232, 119, 1, 'Jesolo - APPARTAMENTO in vendita Piazza Mazzini (UK)', '<p>Jesolo Lido - Condominio nella centralissima Piazza Mazzini a 50 m dal mare. Appartamento in vendita al terzo piano, con ascensore, composto da ingresso, cucina abitabile, soggiorno, due camere da letto, bagno finestrato, ripostiglio &nbsp;e due terrazzi.</p>', '', 'Jesolo Lido Condominio nella centralissima Piazza Mazzini. Appartamento in vendita al terzo piano.', 'RIF. ZMR 03', 141, '', 1, 1, 0, '', '', 'G', '340.000', '', '', 'Terzo piano', '97', ''),
(233, 120, 1, 'Jesolo Lido - CONDOMINIO FRONTEMARE (UK)', '<p>Jesolo Lido - Condominio fronte mare con servizio di portineria. Monolocale in vendita &nbsp;al piano rialzato, parzialmente ristrutturato con terrazzo laterale vista mare. Composto da zona notte con letto matrimoniale, zona giorno con angolo cottura, bagno con doccia. Dotato di TV, lavatrice ed aria condizionata.</p>', '', 'Jesolo Lido - Condominiofronte mare con servizio di portineria. Monolocale in vendita  al piano rialzato.', 'RIF. RVR 01', 142, '', 1, 0, 0, '', 'Piazza Nember - Jesolo Lido', 'G', '160.000', '', 'Ristrutturato', 'Piano rialzato', '30', ''),
(234, 121, 1, 'Jesolo  - APPARTAMENTO in vendita  Piazza Mazzini (UK)', '<p>Jesolo Lido - NUOVA COSTRUZIONE pressi di Piazza Mazzini in posizione centralissima ed a pochi passi dal mare. Disponibile attico al 2&deg; ed &nbsp;ultimo piano +&nbsp; mansarda. Ampio soggiorno con angolo cottura, bagno e camera da letto, in mansarda seconda camera e secondo bagno - terrazza e loggia.</p>', '', 'Jesolo Lido - NUOVA COSTRUZIONE pressi di Piazza Mazzini -  centralissimaed a pochi passi dal mare.', 'RIF. DM', 143, '', 1, 0, 0, '', 'Piazza Mazzini - Jesolo Lido', 'B', '345.000', '', '2013', 'Secondo piano', '', ''),
(235, 122, 1, 'Jesolo Lido - FRONTEMARE  NUOVO-   Piazza Mazzini (UK)', '<p>Jesolo Lido - FRONTEMARE recente costruzione &nbsp;con piscine. Condominio signorile con parcheggio coperto. Appartamento composto da sogg/pranzo con angolo cottura, due camere da letto, bagno finestrato con doccia, due terrazzi laterali vista mare. Dotato di TV, lavatrice, lavastoviglie, cassaforte, porta blindata, aria condizionata ed impianto riscaldamento autonomo.</p>', '', 'Jesolo Lido - vendesi nella centralissima Piazza Mazzini  appartamento in  condominio signorile FRONTEMARE con piscina.', 'RIF. VLL 02', 144, '', 1, 1, 0, '', 'Piazza Mazzini - Jesolo Lido', 'E', 'Tratt. riservate', '', '2000', 'Terzo piano', '65', ''),
(236, 123, 1, 'Jesolo Lido - FRONTEMARE  NUOVO -   Piazza Mazzini (UK)', '<p>Jesolo Lido - Vendesi nella centralissima Piazza Mazzini &nbsp;appartamento in condominio signorile &nbsp;FRONTEMARE con piscina. Appartamento al 4&deg;ed ultimo piano, composto da 3 camere da letto, soggiorno/pranzo con angolo cottura, due bagni, ampio terrazzo laterale vista mare. Appartamento dotato di aria condizionata, riscaldamento autonomo, TV, lavatrice, lavastoviglie, cassaforte, porta blindata e di due posti auto riservati.</p>', '', 'Jesolo Lido Vendesi nella centralissima Piazza Mazzini  appartamento in condominio signorile FRONTEMARE con piscina.', 'RIF. VLL03', 145, '', 1, 1, 0, '', 'Piazza Mazzini - Jesolo Lido', 'E', 'Tratt. riservate', '', '2000', 'Terzo piano', '85', ''),
(237, 124, 1, 'Jesolo Lido - Appartamento Frontemare ultimo piano (UK)', '<p>Jesolo Lido - appartamento fronte mare tra Piazza Marina e Nember con servizio di portineria. Appartamento al 5&deg; ed ultimo piano, con ascensore, composto da 3 camere da letto, ampio soggiorno con cucinotto separato, due bagni e terrazzo panoramico. Dotato di TV e lavatrice.</p>', '', 'Jesolo Lido - Appartamento  fronte mare tra Piazza Marina e Nember con servizio di portineria. Appartamento al 5 ed ultimo piano.', 'RIF. DRT54', 146, '', 1, 1, 0, '', 'Piazza Marina - Jesolo Lido', 'G', '580.000', '', '', 'Quinto piano', '100', ''),
(238, 125, 1, 'Jesolo - APPARTAMENTO in vendita  Piazza Aurora (UK)', '<p>Jesolo Lido - Piccolo fabbricato di sole 3 unit&agrave; in una posizione centralissima a 50 m&nbsp;&nbsp;dal mare. Appartamento al secondo ed ultimo piano, composto da ingresso, ampio soggiorno, cucina abitabile, due camere da letto, bagno e terrazzo. Posizione centralissima.</p>', '', 'Jesolo Lido - Piccolo fabbricato di sole 3 unit in una posizione centralissima a pochi passi dal mare. Appartamento al secondo ed ultimo piano.', 'RIF. SST', 147, '', 1, 0, 0, '', 'Piazza Aurora - Jesolo Lido', 'G', '300.000', '', '', 'Secondo piano', '80', ''),
(239, 127, 1, 'Jesolo - PORZIONE BIFAMILIARE vendesi (UK)', '<p>Jesolo Lido porzione Villa bifamiliare&nbsp;su due livelli con ampio spazio privato a disposizione. Piano terra: monovano ed un servizio, primo piano: &nbsp;due camere ed un servizio. Posto auto esterno riservato con copertura pompeiana e magazzino. Ottime finiture.Spese condominiali minime.</p>', '', 'Jesolo Lido - porzione Villa Bifamiliare  su due livelli con ampio spazio privato a disposizione.', 'RIF. PLL10', 149, '', 1, 0, 0, '', 'Piazza Aurora - Jesolo Lido', 'E', '290.000', '', '2008', 'Piano terra e primo piano', '80', ''),
(240, 128, 1, 'Jesolo - NUOVO RESORT con piscina (UK)', '<p>Jesolo - NUOVO RESORT con piscina &nbsp;in costruzione che coniuga elevatissimi standard costruttivi ad un design molto ricercato ed elegante. Progetto che prevede la costruzione di sole &nbsp;10 unit&agrave; e dove si spazia dalla villa singola con ampio giardino privato alla maisonette, tutte dotate di posto auto riservato e coperto.</p>', '', 'Jesolo - NUOVO RESORT con piscina  in costruzione che coniuga elevatissimi standard costruttivi ad un design molto ricercato ed elegante.', 'RIF.  NPR', 150, '', 1, 1, 0, '', 'Jesolo Lido', 'Casa Clima', 'da 295.000', '', '', 'Piano terra e primo piano', '', ''),
(241, 129, 1, 'Jesolo Paese SPLENDIDA VILLA SINGOLA (UK)', '<p>Jesolo Paese splendida Villa singola , costruzione signorile &nbsp;fine anni 80 su lotto di circa 1000 mq con ampio giardino. Superficie circa 450 mq su due piani.&nbsp;</p>', '', 'Jesolo Paese - Splendida Villa singola , costruzione fine anni 80 su lotto di circa 1000 mq con ampio giardino. Superficie circa 450 mq su due piani.', 'RIF. VMLL', 151, '', 1, 0, 0, '', 'Jesolo Paese', 'E', 'Tratt. riservate', '', '', 'Piano terra e primo piano', '450', ''),
(242, 130, 1, 'Albatros quadri int.B11 (UK)', '<p>Condominio in zona centralissima con parcheggio riservato. &nbsp;Appartamento al 3&deg; piano, composto da &nbsp;3 camere da letto (6 posti letto), ampio soggiorno, cucina separata , 2 bagni ed ampio &nbsp;terrazzo panoramico . L''appartamento &egrave; dotato di lavatrice, aria condizionata e TV.</p>', '', 'Condominio in zona centralissima a pochi metri dal mare', '', 153, '', 1, 0, 0, '45.493198, 12.611965', 'Pressi Piazza Aurora', '', '', '', '', '', '', '6');
