(243, 131, 1, 'Centromare  3 camere int 7 (UK)', '<p>Condominio frontemare in Piazza Mazzini con parcheggio e posto spiaggia riservati. Quadrilocale &nbsp;al piano rialzato con 3 camere da letto (totale 7 posti letto) , sogg/pranzo, cucina separata, 2 bagni ed ampio terrazzo con vista mare frontale. Appartamento dotato di TV, lavatrice, lavastoviglie ed aria condizionata.</p>', '', 'Condominio frontemare in Piazza Mazzini,  con parcheggio e posto spiaggia riservati.', '', 154, '', 1, 0, 0, '45.495492, 12.617747', 'Via Zara, 5', '', '', '', '', '', '', '7'),
(244, 132, 1, 'Jesolo Lido appartamento frontemare (UK)', '<p>Jesolo Lido appartamento su condominio frontemare, ristrutturato, compostao da soggiorno/pranzo, angolo cottura, 2 ampie camere da letto, doppi servizi, ropistiglio, terrazzo vista mare laterale, posto auto riservato. L''appartamento &egrave; dotato di impianti autonomi aria condizionata/pompa di calore. Il tutto ben arredato.</p>', '', 'Jesolo Lido, appartamento su condominio frontemare, ristrutturato, centralissimo', 'RIF. CSN01', 155, '', 1, 1, 0, '', 'zona piazza Marconi', 'G', '330.000', '', '', '2', '75', ''),
(245, 133, 1, 'Albatros 3 camere int B 11 (UK)', '<p>Jesolo - Condominio nella centralissima Piazza Aurora a pochi passi dal mare con parcheggio e posto spiaggia. Appartamento al 3&deg; piano, con ascensore, composto da spazioso soggiorno, cucinotto separato, 3 camere da letto (un totale di 6 posti letto), due bagni ed ampio terrazzo abitabile e panoramico. L''appartamento &egrave; dotato di TV, lavatrice ed &nbsp;aria condizionata.</p>', '', 'Condominio  nella centralissima Piazza Aurora a pochi passi dal mare con parcheggio e posto spiaggia.', '', 156, '', 1, 0, 0, '', 'Piazza Aurora - Via Foscolo n. 9', '', '', '', '', '', '', ''),
(246, 8, 2, 'Centromare 7 (DE)', '<p>Condominio frontemare in Piazza Mazzini con parcheggio e posto spiaggia riservati. Quadrilocale con 3 camere, sogg/pranzo, cucina separata, 2 bagni ed ampio terrazzo con vista mare frontale.</p>', '', 'Condominio frontemare in Piazza Mazzini,  con parcheggio e posto spiaggia riservati.', '', 15, '', 1, 0, 1, '45.495492, 12.617747', 'Via Zara, 5', '', '', '/uploads/planimetrie/appartamenti-case-vacanza-centromare-7-planimetria.pdf', '', '', '', ''),
(247, 11, 2, 'Centromare 11 (DE)', '<p>Condominio frontemare in Piazza Mazzini con parcheggio&nbsp;, posto spiaggia riservati e servizio di portineria. Monolocale al piano rialzato con terrazzo con vista mare laterale ovest, composto da una zona notte con letto matrimoniale, da una zona giorno con angolo cottura, bagno con doccia. L''appartamento &egrave; dotato di TV.</p>', '', 'Condominio frontemare in Piazza Mazzini,  con parcheggio e posto spiaggia riservati.', '', 18, '', 1, 0, 0, '45.495492, 12.617747', 'Via Zara, 5', '', '', '', '', 'rialzato', '', '3'),
(248, 12, 2, 'Centromare 29 (DE)', '<p><span style="color: #737373; font-family: Roboto, Tahoma, Arial, helvetica, sans-serif; font-size: 14px; line-height: 22.4px;">Condominio frontemare in Piazza Mazzini con parcheggio e posto spiaggia riservati. Trilocale al primo piano, con ascensore. composta da una camera matrmoniale, una seconda &nbsp;cameretta con due letti singoli, bagno con doccia, ripostiglio &nbsp;ed ampio terrazzo abitabile &nbsp;con vista mare laterale est. L''appartamento &egrave; dotato, di TV, lavatrice ed aria condizionata.</span></p>', '', 'Condominio frontemare in Piazza Mazzini,  con parcheggio e posto spiaggia riservati.', '', 19, '', 1, 0, 0, '45.495492, 12.617747', 'Via Zara, 5', '', '', '', '', '', '', '4'),
(249, 13, 2, 'Centromare 49 (DE)', '<p>Condominio frontemare in Piazza Mazzini con parcheggio e posto spiaggia riservati. Bilocale al terzo piano, con ascensore, composto &nbsp;da una camera matr. + 1 letto singolo nella stessa, soggiorno/pranzo con angolo cottura ed ampio terrazzo abitabile con vista mare laterale ovest. L''appartamento &egrave; dotato di TV, lavatrice ed aria condizionata.</p>', '', 'Condominio frontemare in Piazza Mazzini,  con parcheggio e posto spiaggia riservati.', '', 20, '', 1, 0, 0, '45.495492, 12.617747', 'Via Zara, 5', '', '', '', '', '', '', '4'),
(250, 14, 2, 'Adriatico 42 (DE)', '<p>Condominio frontemare con parcheggio condominiale (non assegnato) e servizio spiaggia. Disponiamo di &nbsp;un appartamento al secondo piano, con ascensore. composto da &nbsp;ampio soggiorno con cucinotto separato, 3 camere da letto (un totale di 6 posti letto), due bagni ed ampio terrazzo panoramico fronte mare. L''appartamento &egrave; dotato di TV, lavatrice e microonde.</p>', '', 'Condominio frontemare con parcheggio condominiale e servizio spiaggia.', '', 21, '', 1, 0, 2, '45.489471, 12.603694', 'Via Padova, 21', '', '', '', '', '', '', '6'),
(251, 15, 2, 'Adriatico 54 (DE)', '<p>Condominio frontemare con parcheggio condominiale (non assegnato) e servizio spiaggia . Disponiamo di&nbsp;un appartamento al quinto ed ultimo piano, con ascensore, composto da ampio soggiorno con cucinotto separato, 3 camere da letto (un totale di 6 posti letto), due bagni e spazioso terrazzo frontale con spledida vista sul mare. L''appartamento &egrave; dotato di TV e lavatrice.</p>', '', 'Condominio frontemare con parcheggio condominiale e servizio spiaggia.', '', 22, '', 1, 0, 0, '45.489471, 12.603694', 'Via Padova, 21', '', '', '', '', '', '', '6'),
(252, 16, 2, 'Desiree 14 (DE)', '<p>Condominio fronte mare in posizione centralissima, vicinanze Piazza Mazzini, &nbsp;dotato di parcheggio riservato, posto spiaggia e piccola piscina per bimbi. L''appartamentosi trova &nbsp;al primo piano, con ascensore, &egrave; &nbsp;composto da sogg/pranzo con angolo cottura, una camera matr, &nbsp;bagno finestrato e terrazzo con vista mare laterale est. Il bilocale &egrave; dotato di TV, lavatrice e cassaforte.</p>', '', 'Condominio fronte mare in posizione centralissima dotato di parcheggio riservato, posto spiaggia e piccola piscina per bimbi.', '', 23, '', 1, 0, 0, '45.497403, 12.624220', 'Via Bafile, 22 acc. mare - n.4', '', '', '', '', '1', '', '4'),
