(293, 66, 2, 'Olimpo 2 camere  int.3 (DE)', '<p>Condominio sul corso principale in Piazza Brescia &nbsp;a pochi passi dal mare con parcheggio e posto spiaggia riservati. Appartamento al 1&deg;piano, con ascensore, composto &nbsp;da sogg/pranzo con angolo cottura, &nbsp;2 camere da letto ( la prima matrimoniale + un singolo e la seconda con due letti singoli - max 5 posti letto), bagno ed ampia terrazza abitabile che si affaccia sul corso principale. Dotato di TV ed aria condizionata.</p>', '', 'Piazza Brescia - Condominio sul corso principale con parcheggio e posto spiaggia riservati.', '', 88, '', 1, 0, 0, '45.502145, 12.635141', 'Via dei Pioppi n. 10 - pressi Piazza Brescia', '', '', '', '', '', '', '5'),
