(297, 70, 2, 'Sunny Home  int A19 (DE)', '<p>Jesolo - Piazza Mazzini Condominio sul corso principale in posizione centralissima. Appartamento al 4&deg; piano, con ascensore, composto da sogg/pranzo con angolo cottura, camera matrimoniale, cameretta con due letti, bagno finestrato e piccolo terrazzino. Dotato di TV, lavatrice ed aria condizionata.</p>', '', 'Condominio in Piazza Mazzini a due passi dal mare  con posto spiaggia riservato.', '', 92, '', 1, 0, 0, '45.496042, 12.616424', 'Via S. Trentin, 42   P.zza Mazzini', '', '', '', '', '', '', '5'),
(298, 71, 2, 'Toniolo Monolocale (DE)', '<p>Condominio in posizione centrale nei pressi di Piazza Marconi &nbsp;a pochi passi dal mare, dotato di parcheggio riservato e chiuso. Disponiamo di un monolocale al primo piano, &nbsp;con letto matrimoniale, zona con angolo cottura separata, bagno con doccia. Dotato di TV , aria condizionata e posto auto.</p>', '', 'Condominio sul corso principale nei pressi di Piazza Marconi a pochi passi dal mare con parcheggio riservato', '', 93, '', 1, 0, 0, '45.505233, 12.642646', 'Via Ninfee n.1, pressi Piazza Marconi', '', '', '', '', '', '', '2'),
(299, 72, 2, 'Toniolo 2 camere (DE)', '<p>Condominio in posizione centrale nei pressi di Piazza Marconi a soli &nbsp;pochi passi dal mare, dotato di parcheggio riservato e chiuso. Disponiamo di un trilocale&nbsp;&nbsp;al secondo piano, &nbsp;composto da soggiorno con angolo cottura, camera matrimoniale, seconda cameretta con letto a castello, bagno con doccia. L''appartamento &egrave; dotato di TV, lavatrice, di aria condizionata e di un posto auto riservato.</p>', '', 'Condominio sul corso principale nei pressi di Piazza Marconi ed a soli pochi passi dal mare con parcheggio riservato.', '', 94, '', 1, 0, 0, '45.505233, 12.642646', 'Via Ninfee n.1, pressi Piazza Marconi', '', '', '', '', '', '', '4'),
(300, 73, 2, 'Verdi 2 camere int  28 (DE)', '<p>Condominio sul corso principale nei pressi di Piazza Marina a 100 m dal mare con parcheggio e posto spiaggia riservati. Appartamento al 6&deg; piano, con ascensore, composto da 2 camere da letto (in totale 5 posti letto), sogg/pranzo con angolo cottura, bagno con doccia. Dotato di TV, lavatrice ed aria condizionata.</p>', '', 'Jesolo - Piazza Marina .Condominio sul corso principale a 100 m dal mare con parcheggio e posto spiaggia riservati.', '', 95, '', 1, 0, 0, '45.490403, 12.604140', 'Via Verdi , tra P.zza Marina e Nember', '', '', '', '', '6', '', '5'),
(301, 74, 2, 'Milano bilocale int  48 (DE)', '<p>Jesolo - Piazza Milano - Condominio in posizione centrale comoda al mare, con parcheggio riservato e coperto e posto spiaggia. Appartamento al 4&deg; piano, con ascensore, composto da camera matrimoniale, sogg/pranzo con angolo cottura e divano letto, bagno finestrato con doccia e terrazza abitabile. Dotato di TV, lavatrice, cassaforte &nbsp;, porta blindata ed aria condizionata.</p>', '', 'Piazza Milano - Condominio a pochi passi dal mare con parcheggio coperto e posto spiaggia.', '', 96, '', 1, 0, 0, '45.514127, 12.670922', 'Piazza Milano, 9', '', '', '', '', '', '', '3'),
(302, 75, 2, 'Everest bilocale int 37 (DE)', '<p>Jesolo / Piazza Nember . Condominio &nbsp;a pochi passi dal mare con piscina, posto auto e posto spiaggia riservati . Bilocale al 4&deg; piano, con ascensore, &nbsp;composto da sogg/pranzo con angolo cottura e terrazzino , camera da letto con &nbsp;matrimoniale + letto &nbsp;a a castello nella stessa &nbsp;e &nbsp;bagno con doccia. L''appartamento &egrave; dotato di Tv ed aria condizionata. &nbsp;</p>', '', 'Piazza Nember Condominio a 50 m dal mare con piscina , dotato di posto auto e posto spiaggia riservati.', '', 97, '', 1, 0, 0, '45.487131, 12.597290', 'Piazza Nember, 10', '', '', '', '', '', '', '4'),
