(304, 77, 2, 'Villa delle Robinie  int 5 (DE)', '<p>Costruzione centralissima, nelle vicinanze di Piazza Mazzini, &nbsp;a pochi passi dal mare con parcheggio riservato e chiuso e posto spiaggia. Bilocale al primo piano, composto da camera matrimoniale (3 letti), sogg/pranzo con angolo cottura , bagno con doccia e terrazzino. Dotato di TV.</p>', '', 'Condominio a pochi passi dal mare in posizione centralissima  con parcheggio e posto spiaggia riservati.', '', 99, '', 1, 0, 0, '45.495133, 12.616628', 'Via Zara,  18', '', '', '', '', '', '', '3'),
