(311, 85, 2, 'Villa Padova bilocale int. 6 (DE)', '<p>Piccola costruzione a pochi passi dal mare nei pressi di Piazza Marina, dotato di parcheggio riservato e posto spiaggia. &nbsp;Appartamento al primo piano, composto da soggiorno/pranzo con angolo cottura e divano letto, camera da letto matrimoniale (in totale 3 posti letto), bagno finestrato con doccia e terrazzino. Il bilocale &egrave; dotato di TV ed aria condizionata.</p>', '', 'Piazza Marina - Condominio a pochi passi dal mare con parcheggio e posto spiaggia riservati.', '', 107, '', 1, 0, 0, '45.490816, 12.606668', 'Via Padova, 2A - pressi Piazza Marina', '', '', '', '', '', '', '3'),
(312, 86, 2, 'Casa Rosa monolocale int D4 (DE)', '<p>Piccola casa di poche unit&agrave; con parcheggio riservato. Posizione centrale ma protetta da rumori. Monolocale al primo piano con divano letto (max 2 posti letto), angolo cottura , bagno e terrazzino. Dotato di TV ed aria condizionata.</p>', '', 'Piccola casetta con poche unit in posizione centralissima  ma protetta dai rumori. Dispone di parcheggio chiuso e riservato.', '', 108, '', 1, 0, 0, '45.497090, 12.616817', 'Via Vicenza, 1 vicolo n. 7 - pressi P.zza Mazzini', '', '', '', '', '', '', '2'),
(313, 87, 2, 'Casa Rosa bilocale int 1A (DE)', '<p>Piccola casa di poche unit&agrave; con parcheggio riservato. Posizione centrale ma protetta da rumori. Bilocale al primo piano, composto da camera da letto matrimoniale, sogg/pranzo con angolo cottura e divano letto (in totale 3 posti letto) , bagno e terrazzino. Dotato di TV , lavatrice ed aria condizionata.</p>', '', 'Piccola casetta con poche unit in posizione centrale ma protetta dai rumori. Dispone di parcheggio chiuso e riservato.', '', 109, '', 1, 0, 0, '45.497090, 12.616817', 'Via Vicenza, 1 vicolo n. 7 - pressi P.zza Mazzini', '', '', '', '', '', '', '3'),
(314, 88, 2, 'Casa Rosa int 2A (DE)', '<p>Piccola casa di poche unit&agrave; con parcheggio riservato. Posizione centrale ma protetta da rumori. Bilocale al primo piano, composto da camera da letto matrimoniale, sogg/pranzo con angolo cottura e divano letto (in totale 3 posti letto) , bagno e terrazzino. Dotato di TV , lavatrice ed aria condizionata.</p>', '', 'Piccola casetta con poche unit in posizione centralissima. Dispone di parcheggio chiuso e riservato.', '', 110, '', 1, 0, 0, '45.497090, 12.616817', 'Via Vicenza, 1 vicolo n. 7 - pressi P.zza Mazzini', '', '', '', '', '', '', '3');
