(315, 89, 2, 'Casa Rosa int 3C (DE)', '<p>Piccola casa di poche unit&agrave; con parcheggio riservato. Posizione centrale ma protetta da rumori. Bilocale al primo piano, composto da camera da letto con matrimoniale + un letto singolo (in totale 3 posti letto), sogg/pranzo con angolo cottura &nbsp;, bagno e terrazzino. Dotato di TV &nbsp;ed aria condizionata.</p>', '', 'Piccola casetta con poche unit in posizione centralissima con  parcheggio chiuso e riservato.', '', 111, '', 1, 0, 0, '45.497090, 12.616817', 'Via Vicenza, 1 vicolo n. 7 - pressi P.zza Mazzini', '', '', '', '', '', '', '3'),
(316, 90, 2, 'Drago Village  int 10 (DE)', '<p>Residence con piscina a 300 mt dal mare nei pressi di Piazza Drago con parcheggio coperto. Appartamento &nbsp;su due livelli, <strong>al primo piano:</strong> il&nbsp;sogg/pranzo con ancolo cottura. un bagno , una camera da letto matrimoniale ed ampia terrazza con vista piscina, <strong>al piano mansardato</strong> : camera matrimoniale e bagno. L''appartamento &egrave; dotato di TV, lavatrice ed aria condizionata.</p>', '', 'Residence a 300 mt dal mare con piscina  e parcheggio riservato e  coperto.', '', 112, '', 1, 1, 0, '45.508484, 12.643478', 'Via Equilio, 1 - pressi di Piazza Drago', '', '', '', '', '', '', '5'),
(317, 91, 2, 'Le Residenze di Parco Equilio int. 100 (DE)', '<p>Residence di recente costruzione immerso nel verde con due piscine ed ampio spazio verde. Bilocale al primo piano, composto da sogg/pranzo con angolo cottura, una &nbsp;camera da letto con matrimoniale ed un letto singolo, &nbsp;bagno finestrato con doccia e terrazzo abitabile attrezzato. Dispone di lavatrice, TV, aria condizionata e due posti auto.</p>', '', 'Residence di recente costruzione alle spalle di Piazza Aurora, circa 800 mt dal mare, con due piscine ed ampio spazio verde', '', 113, '', 1, 0, 0, '45.498905, 12.606445', 'Via C Porcia, 100 - alle spalle di P.zza Aurora', '', '', '', '', '', '', '3'),
(318, 92, 2, 'Le Residenze di Parco Equilio 26 (DE)', '<p>Residence di recente costruzione immerso nel verde con due piscine. Villetta singola con ampio giardino di propriet&agrave;, composta da sogg/pranzo con angolo cottura, camera matrimoniale, cameretta con letto a castello, bagno finestrato con doccia. Dotato di TV, lavatrice, lavastoviglie, aria condizionata e cassaforte.</p>', '', 'Residence  di recente costruzione alle spalle di Piazza Aurora, circa 800 mt dal mare, con due piscine ed ampio spazio verde.', '', 114, '', 1, 0, 0, '45.498905, 12.606445', 'Via C Porcia, 100 - alle spalle di P.zza Aurora', '', '', '', '', '', '', '4'),
(319, 93, 2, 'Res. Equilio bilocale int B4 (DE)', '<p>Residence a 300 mt dal mare con due piscine (una per bimbi ed una per adulti), con posto spiaggia e posto auto. Bilocale al primo piano, composto da sogg/pranzo con angolo cottura, camera da letto con matrimoniale e letto a castello nella stessa, bagno con doccia e terrazzino. Dotato di TV, lavatrice ed aria condizionata.</p>', '', 'Residence alle spalle di Piazza Marconi a 300 mt dal mare con due piscine ed ampio  spazio verde.', '', 115, '', 1, 0, 0, '45.508198, 12.642788', 'Via Monaco, 41', '', '', '', '', '', '', '4'),
(320, 94, 2, 'Res. Equilio bilocale int B8 (DE)', '<p>Residence a 300 mt dal mare con due piscine (una per bimbi ed una per adulti), con posto spiaggia e posto auto. Bilocale al primo piano, composto da sogg/pranzo con angolo cottura, camera da letto con matrimoniale e letto singolo nella stessa, bagno con doccia e terrazzino. Dotato di TV.</p>', '', 'Residence alle spalle di Piazza Marconi a 300 mt dal mare con due piscine ed ampio  spazio verde.', '', 116, '', 1, 0, 0, '45.508198, 12.642788', 'Via Monaco, 28', '', '', '', '', '', '', '4'),
(321, 95, 2, 'Res. Equilio bilocale int B10 (DE)', '<p>Residence a 300 mt dal mare con due piscine (una per bimbi ed una per adulti), con posto spiaggia e posto auto. Bilocale al piano terra , composto da sogg/pranzo con angolo cottura, camera da letto con matrimoniale e letto singolo nella stessa, bagno con doccia e piccolo scoperto privato. Dotato di TV, lavatrice e pale ventilatrici al soffitto.</p>', '', 'Residence alle spalle di Piazza Marconi a 300 mt dal mare con due piscine e spazio verde.', '', 117, '', 1, 0, 0, '45.508198, 12.642788', 'Via Monaco, 36', '', '', '', '', '', '', '4'),
(322, 96, 2, 'Res. Equilio bilocale int B19 (DE)', '<p>Residence a 300 mt dal mare con due piscine (una per bimbi ed una per adulti), con posto spiaggia e posto auto. Bilocale al primo piano, composto da sogg/pranzo con angolo cottura, camera da letto con matrimoniale e letto a castello&nbsp;&nbsp;nella stessa, bagno con doccia e terrazzino. Dotato di TV.</p>', '', 'Residence alle spalle di Piazza Marconi a 300 mt dal mare con due piscine e spazio verde.', '', 118, '', 1, 0, 0, '45.508198, 12.642788', 'via Monaco, 45', '', '', '', '', '', '', '4'),
(323, 97, 2, 'Res. Equilio bilocale int B 20 (DE)', '<p>Residence a 300 mt dal mare con due piscine (una per bimbi ed una per adulti), con posto spiaggia e posto auto. Appartamento al primo piano composto da soggiorno/ pranzo con angolo cottura, camera da letto con matrimoniale + letto a castello, bagno finestrato con doccia e terrazzino. Il bilocale &egrave; dotato di TV.</p>', '', 'Residence alle spalle di Piazza Marconi a 300 mt dal mare con due piscine e spazio verde.', '', 119, '', 1, 0, 0, '45.508198, 12.642788', 'via Monaco, 46', '', '', '', '', '', '', '4'),
(324, 98, 2, 'Res. Equilio bilocale int F9 (DE)', '<p>Residence a 300 mt dal mare con due piscine (una per bimbi ed una per adulti), con posto spiaggia e posto auto. Appartamento al piano terra, composto da soggiorno con angolo cottura, camera da letto matrimoniale, bagno finestrato con doccia e giardino privato. Il bilocale &egrave; dotato di TV e lavatrice.</p>', '', 'Residence alle spalle di Piazza Marconi a 300 mt dal mare con due piscine e spazio verde.', '', 120, '', 1, 0, 0, '45.508198, 12.642788', 'Via Equilio, 5 - pressi Piazza Drago', '', '', '', '', '', '', '3'),
(325, 99, 2, 'Res. Equilio int D3 (DE)', '<p>Residence a 300 mt dal mare con due piscine (una per bimbi ed una per adulti), con posto spiaggia e posto auto.&nbsp;Trilocale al primo piano, composta da soggiorno/pranzo</p>', '', 'Residence alle spalle di Piazza Marconi a 300 mt dal mare con due piscine ed ampio spazio verde.', '', 121, '', 1, 0, 0, '45.508198, 12.642788', 'Via del Carabiniere', '', '', '', '', '', '', '5'),
(326, 100, 2, 'La Vigna bilocale int 8 (DE)', '<p>Residence nei pressi di Piazza Nember &nbsp;a 300 mt dal mare circondato dal verde con piscina. Bilocale al piano terra composto da soggiorno pranzo con angolo cottura, camera da letto con matrimoniale + un&nbsp;&nbsp;letto singolo, bagno finestrato con doccia e piccolo scoperto privato. Dotato di TV, lavatrice, aria condizionata , cassaforte e posto auto riservato.</p>', '', 'Residence con piscina a 300 mt. dal mare con piscina  circondato dal verde.', '', 122, '', 1, 1, 0, '', 'Via Vespucci, 10 - pressi di Piazza Nember', '', '', '', '', '', '', '4'),
(327, 102, 2, 'Torre Blanca Residence int 102 (DE)', '<p>Residence con piscina, in posizione centralissima, alle spalle di Piazza Mazzini, con parcheggio e posto spiaggia riservati. Trilocale al primo piano, composto da soggiorno pranzo con angolo cottura, camera da letto matrimoniale, cameretta con letto a castello, bagno finestrato con doccia e terrazzino. Dotato di TV, cassaforte, lavatrice &nbsp;ed aria condizionata.</p>', '', 'Residence con piscina alle spalle di Piazza Mazzini, con parcheggio e posto spiaggia riservati.', '', 124, '', 1, 0, 0, '45.498911, 12.616792', 'Piazza Internazionale, 3 - vicino Piazza Mazzini', '', '', '', '', '', '', '5'),
(328, 103, 2, 'Torre Blanca Residence int T3 (DE)', '<p>Residence con piscina, in posizione centralissima, alle spalle di Piazza Mazzini, con parcheggio e posto spiaggia riservati. Trilocale al piano terra, composto da soggiorno pranzo con angolo cottura, camera da letto matrimoniale, cameretta con letto a castello, bagno &nbsp;con doccia e piccolo scoperto privato. Dotato di TV &nbsp;ed aria condizionata.</p>', '', 'Residence con piscina alle spalle di Piazza Mazzini, con parcheggio e posto spiaggia riservati.', '', 125, '', 1, 0, 0, '45.498911, 12.616792', 'Piazza Internazionale, 3 - pressi Piazza Mazzini', '', '', '', '', '', '', '5'),
(329, 104, 2, 'Villa Delfi 6 (DE)', '<p>Piccola costruzione a 250 mt dal mare con parcheggio e posto spiaggia riservati. Bilocale al 2&deg; piano composto da soggiorno pranzo con angolo cottura, camera con letto matrimoniale +&nbsp;letto a castello (un totale di 4 posti letto), bagno finestrato con doccia e terrazzino. Dotato di TV ed aria condizionata.</p>', '', 'Piazza Milano - Piccola costruzione a 250 mt dal mare con parcheggio e posto spiaggia riservati.', '', 126, '', 1, 0, 0, '45.517141, 12.677631', 'Via Olanda, 163  - tra piazza Milano e Torino', '', '', '', '', '', '', '4'),
(330, 105, 2, 'Villaggio dei Gabbiani  int 1 (DE)', '<p>Residence con due piscine a 300 mt dal mare, alle spalle di Piazza Marina. Trilocale al piano terra composto da soggiorno pranzo con angolo cottura, due camere da letto matrimoniali (totale 5 posti letto), bagno finestrato con doccia e scoperto privato attrezzato. Dotato di TV, lavatrice, lavastoviglie , aria condizionata e posto auto riservato.&nbsp;</p>', '', 'Residence con piscine a 300 mt dal mare, alle spalle di Piazza Marina ed ampio spazio verde', '', 127, '', 1, 0, 0, '45.494675, 12.604253', 'Via Bunarroti, 18 - pressi Piazza Marina', '', '', '', '', '', '', '5'),
(331, 106, 2, 'CAVALLINO appartamento in vendita (DE)', '<p>CAVALLINO RESIDENCE di recente costruzione. In vendita appartamento al primo piano, composto da due camere da letto, soggiorno / pranzo con angolo cottura, bagno, due terrazze, arredamento completo. Posto auto riservato.</p>', '', 'Cavallino - Appartamento in vendita in residence di recente costruzione', 'RIF.CML', 128, '', 1, 0, 0, '', 'Cavallino', 'D', '185.000', '', '2004', 'Primo piano', '60', ''),
(332, 107, 2, 'Appartamento bilocale Jesolo (DE)', '<p>Jesolo Lido - Residence con due &nbsp;piscine a 300 mt dal mare nei pressi di Piazza Marina &nbsp;. Appartamento al primo ed ultimo piano, &nbsp;con posto auto riservato. Bilocale &nbsp;composto da una camera da letto , soggiorno/ pranzo con angolo cottura e &nbsp;bagno finestrato. Ampio spazio verde in comune.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', '', 'Jesolo Lido - Residence con  due piscine a 300 mt dal mare. Appartamento al primo ed ultimopiano con posto auto riservato.', 'RIF. VG', 129, '', 1, 0, 0, '', 'Piazza Marina - Jesolo Lido', 'G', '139.000', '', '', 'Primo piano', '40', ''),
(333, 108, 2, 'Jesolo appartamento 2 camere (DE)', '<p>Jesolo Lido - Residence con due piscine a 300 mt dal mare nei pressi di Piazza Marina . Appartamento al piano terra con posto auto riservato. Trilocale composto da una camera da letto matrimoniale + un letto singolo, seconda camera con letto matrimoniale, soggiorno/ pranzo con angolo cottura, bagno finestrato e scoperto privato dotato di pompeiana. L''appartamento &egrave; fornito di aria condizionata, TV, lavatrice e lavastoviglie.</p>', '', 'Jesolo Lido - Residence con due piscine a 300 mt dal mare nei pressi di Piazza Marina . Appartamento al piano terra con posto auto riservato.', 'RIF. VG02', 130, '', 1, 0, 0, '', 'Piazza Marina - Jesolo Lido', 'G', '240.000', '', '', 'Piano terra', '60', ''),
(334, 109, 2, 'Jesolo  - P.zza Mazzini trilocale in vendita (DE)', '<p>Jesolo Lido - Condominio &nbsp;in posizione &nbsp;centralissima a pochi passi dal mare. Disponiamo di trilocale &nbsp;completamente ristrutturato, al 5&deg; piano, con ascensore, composto &nbsp;da ampio soggiorno / pranzo con angolo cottura, &nbsp;camera matrimoniale, seconda cameretta con due letti singoli, bagno finestrato e piccolo terrazzino. Completamente arredato e dotato di TV, lavatrice &nbsp;ed &nbsp;aria condizionata .</p>', '', 'Jesolo Lido - Condominio in posizione  centralissima a pochi passi dal mare.Trilocale completamente ristrutturato.', 'RIF.SHM03', 131, '', 1, 0, 0, '', 'Piazza Mazzini - Jesolo Lido', 'G', '200.000', '', 'Ristrutturato', 'Quinto piano', '65', ''),
(335, 110, 2, 'Jesolo Lido - FRONTEMARE - Piazza Mazzini (DE)', '<p>Jesolo Lido - Frontemare - Piazza Mazzini - Condominio &nbsp;sul mare con servizio di portineria. Monolocale al 4&deg; piano, con ascensore, &nbsp; completamente ristrutturato con soggiorno/pranzo ed angolo cottura, bagno ed ampia terrazza panoramica. Spese condominiali minime.</p>', '', 'Jesolo Lido - Condominio centralissimo sul mare con servizio di portineria. Monolocale  completamente ristrutturato con ampia terrazza panoramica.', 'RIF. CM01', 132, '', 1, 1, 0, '', 'Piazza Mazzini - Jesolo Lido', 'G', '190.000', '', 'Ristrutturato', 'Quinto piano', '30', ''),
(336, 111, 2, 'Jesolo Lido - FRONTEMARE -   Piazza Mazzini (DE)', '<p>Jesolo Lido - Condominio fronte mare in Piazza Mazzini con servizio di portineria. Bilocale al &nbsp;secondo piano, con ascensore, composto da ampio soggiorno / pranzo con angolo cottura, ampia camera matrimoniale, bagno con doccia e terrazza abitabile attrezzata. Dotato di TV, lavatrice ed aria condizionata.</p>', '', 'Jesolo Lido - Condominio fronte mare in Piazza Mazzini con servizio di portineria. Bilocale al  secondo piano.', 'RIF. CM 02', 133, '', 1, 0, 0, '', 'Piazza Mazzini - Jesolo Lido', 'G', '240.000 tratt.', '', 'Ristrutturato', 'Secondo piano', '45', ''),
(337, 112, 2, 'Jesolo Lido - GOLF CLUB (DE)', '<p>Jesolo Lido - Prestigioso residence con piscine, ampio spazio verde e campi da golf. Appartamento di recente costruzione al primo piano, composto da un soggiorno pranzo con angolo cottura, camera matrimoniale, cameretta con due letti singoli, bagno e terrazze con bellissima vista sul golf. Completamento arredato e dotato di riscaldamento autonomo ed aria condizionata. Due posti auto riservati e box golf car.&nbsp;</p>', '', 'Jesolo Lido - Prestigioso residence con piscine, ampio spazio verde e campi da golf. Appartamento di recente costruzione al primo piano.', 'RIF. GLF 01', 134, '', 1, 1, 0, '', 'Piazza Aurora - Jesolo Lido', 'E', '220.000', '', '2006', 'Primo piano', '65', ''),
(338, 113, 2, 'Jesolo Lido - GOLF CLUB (DE)', '<p>Prestigioso residence con piscine, ampio spazio verde e campi da golf. Appartamento su tre livelli, <strong>piano terra</strong> composto da soggiorno/ pranzo con angolo cottura. bagno e scoperto privato, <strong>primo piano</strong> composto da 2 camere da letto e bagno, <strong>secondo piano</strong> composto da solarium con splendida vista sul green. Arredato e completo di riscaldamento autonomo, aria condizionata, parcheggio privato e box golf car.</p>', '', 'Prestigioso residence con piscine, ampio spazio verde e campi da golf. Appartamento su tre livelli.', 'RIF. GLF02', 135, '', 1, 1, 0, '', 'Piazza Aurora - Jesolo Lido', 'E', 'Trattative riservate', '', '2006', 'Piano terra, primo e secondo piano', '100', ''),
(339, 114, 2, 'Jesolo - VILLA  SINGOLA  residence con piscine (DE)', '<p>Jesolo Lido VILLA SINGOLA in residence alle spalle di Piazza Aurora con ampio spazio verde e piscine. Villa singola composta da soggiorno / pranzo, due camere da letto, bagno finestrato con doccia, 2 pompeiane esterne, barbeque esterno, ampio giardino di circa 400 mq piantumato ed irrigato. Dotata &nbsp;di riscaldamento autonomo , aria condizionata, TV, lavatrice e lavastoviglie.&nbsp;</p>', '', 'Jesolo Lido VILLA SINGOLA   alle spalle di Piazza Aurora con ampio spazio verde e piscine.', 'RIF. PRC01', 136, '', 1, 1, 0, '', 'Piazza Aurora - Jesolo Lido', 'E', '330.000', '', '2006', 'Piano terra', '65', ''),
(340, 115, 2, 'Jesolo  NUOVA COSTRUZIONE Piazza Aurora (DE)', '<p>Jesolo Lido - Nuova costruzione alle spalle di Piazza Aurora. In una tranquilla zona residenziale, a poche centinaia di metri dal mare. Sono state ricavate 3 nuove unit&agrave; di ampie metrature. Disponibile porzione ad ovest con ingresso indipendente, area esclusiva per giardino e con la possibilit&agrave; di almeno due posti auto . Assolutamente adeguate ad una residenza stabile e comunque con caratteristiche non comuni ed apprezzabili da tutti coloro che desiderano, anche al mare, una vera casa.&nbsp;</p>', '', 'Jesolo Lido Nuova costruzione alle spalle di Piazza Aurora. Disponibile porzione ad ovest con ingresso indipendente.', 'RIF. AMD00', 137, '', 1, 0, 0, '', 'Piazza Aurora - Jesolo Lido', 'C', '370.000', '', '2010', 'Piano terra, primo piano e mansardato', '150', ''),
(341, 117, 2, 'Jesolo PRESTIGIOSA COSTRUZIONE (DE)', '<p>Jesolo Lido NUOVA PRESTIGIOSA COSTRUZIONE &nbsp; Piccolo fabbricato di &nbsp;sole 5 unit&agrave; residenziali. Ottime finiture, impianti autonomi, ampio garage e giardino privato. Ultime disponibilit&agrave;: appartamento al piano terra con ingresso indipendente, ampio sogg/pranzo, 3 camere da letto, doppi servizi, doppio garage, scoperto privato.</p>', '', 'Jesolo Lido NUOVA PRESTIGIOSA COSTRUZIONEpiccolo fabbricato di sole 5 unita residenziali.', 'RIF. MTG01', 139, '', 1, 1, 0, '', 'Piazza Drago, Jesolo Lido', 'B', 'Trattative  riservate', '/uploads/planimetrie/appartamenti-vendite-rif.-mtg01-planimetria.pdf', '2012', 'Piano terra', '90', ''),
(342, 118, 2, 'Jesolo PORZIONE  VILLETTA A SCHIERA (DE)', '<p>Jesolo Lido porzione di Villetta a schiera, posizione di testa, ripartita&nbsp;su pi&ugrave; livelli, terra, primo e sottotetto. Ampi spazi esterni con giardino. Impianti autonomi. Posizione centralissima.</p>', '', 'Jesolo Lido porzione di Villetta a schiera posizione di testa su pi livelli, terra, primo e sottotetto in vendita.', 'RIF. MTG 00', 140, '', 1, 0, 0, '', 'Piazza Drago - Jesolo Lido', 'G', '350.000', '', '', 'Piano terra', '160', ''),
(343, 119, 2, 'Jesolo - APPARTAMENTO in vendita Piazza Mazzini (DE)', '<p>Jesolo Lido - Condominio nella centralissima Piazza Mazzini a 50 m dal mare. Appartamento in vendita al terzo piano, con ascensore, composto da ingresso, cucina abitabile, soggiorno, due camere da letto, bagno finestrato, ripostiglio &nbsp;e due terrazzi.</p>', '', 'Jesolo Lido Condominio nella centralissima Piazza Mazzini. Appartamento in vendita al terzo piano.', 'RIF. ZMR 03', 141, '', 1, 1, 0, '', '', 'G', '340.000', '', '', 'Terzo piano', '97', ''),
(344, 120, 2, 'Jesolo Lido - CONDOMINIO FRONTEMARE (DE)', '<p>Jesolo Lido - Condominio fronte mare con servizio di portineria. Monolocale in vendita &nbsp;al piano rialzato, parzialmente ristrutturato con terrazzo laterale vista mare. Composto da zona notte con letto matrimoniale, zona giorno con angolo cottura, bagno con doccia. Dotato di TV, lavatrice ed aria condizionata.</p>', '', 'Jesolo Lido - Condominiofronte mare con servizio di portineria. Monolocale in vendita  al piano rialzato.', 'RIF. RVR 01', 142, '', 1, 0, 0, '', 'Piazza Nember - Jesolo Lido', 'G', '160.000', '', 'Ristrutturato', 'Piano rialzato', '30', ''),
(345, 121, 2, 'Jesolo  - APPARTAMENTO in vendita  Piazza Mazzini (DE)', '<p>Jesolo Lido - NUOVA COSTRUZIONE pressi di Piazza Mazzini in posizione centralissima ed a pochi passi dal mare. Disponibile attico al 2&deg; ed &nbsp;ultimo piano +&nbsp; mansarda. Ampio soggiorno con angolo cottura, bagno e camera da letto, in mansarda seconda camera e secondo bagno - terrazza e loggia.</p>', '', 'Jesolo Lido - NUOVA COSTRUZIONE pressi di Piazza Mazzini -  centralissimaed a pochi passi dal mare.', 'RIF. DM', 143, '', 1, 0, 0, '', 'Piazza Mazzini - Jesolo Lido', 'B', '345.000', '', '2013', 'Secondo piano', '', ''),
(346, 122, 2, 'Jesolo Lido - FRONTEMARE  NUOVO-   Piazza Mazzini (DE)', '<p>Jesolo Lido - FRONTEMARE recente costruzione &nbsp;con piscine. Condominio signorile con parcheggio coperto. Appartamento composto da sogg/pranzo con angolo cottura, due camere da letto, bagno finestrato con doccia, due terrazzi laterali vista mare. Dotato di TV, lavatrice, lavastoviglie, cassaforte, porta blindata, aria condizionata ed impianto riscaldamento autonomo.</p>', '', 'Jesolo Lido - vendesi nella centralissima Piazza Mazzini  appartamento in  condominio signorile FRONTEMARE con piscina.', 'RIF. VLL 02', 144, '', 1, 1, 0, '', 'Piazza Mazzini - Jesolo Lido', 'E', 'Tratt. riservate', '', '2000', 'Terzo piano', '65', ''),
(347, 123, 2, 'Jesolo Lido - FRONTEMARE  NUOVO -   Piazza Mazzini (DE)', '<p>Jesolo Lido - Vendesi nella centralissima Piazza Mazzini &nbsp;appartamento in condominio signorile &nbsp;FRONTEMARE con piscina. Appartamento al 4&deg;ed ultimo piano, composto da 3 camere da letto, soggiorno/pranzo con angolo cottura, due bagni, ampio terrazzo laterale vista mare. Appartamento dotato di aria condizionata, riscaldamento autonomo, TV, lavatrice, lavastoviglie, cassaforte, porta blindata e di due posti auto riservati.</p>', '', 'Jesolo Lido Vendesi nella centralissima Piazza Mazzini  appartamento in condominio signorile FRONTEMARE con piscina.', 'RIF. VLL03', 145, '', 1, 1, 0, '', 'Piazza Mazzini - Jesolo Lido', 'E', 'Tratt. riservate', '', '2000', 'Terzo piano', '85', ''),
(348, 124, 2, 'Jesolo Lido - Appartamento Frontemare ultimo piano (DE)', '<p>Jesolo Lido - appartamento fronte mare tra Piazza Marina e Nember con servizio di portineria. Appartamento al 5&deg; ed ultimo piano, con ascensore, composto da 3 camere da letto, ampio soggiorno con cucinotto separato, due bagni e terrazzo panoramico. Dotato di TV e lavatrice.</p>', '', 'Jesolo Lido - Appartamento  fronte mare tra Piazza Marina e Nember con servizio di portineria. Appartamento al 5 ed ultimo piano.', 'RIF. DRT54', 146, '', 1, 1, 0, '', 'Piazza Marina - Jesolo Lido', 'G', '580.000', '', '', 'Quinto piano', '100', ''),
(349, 125, 2, 'Jesolo - APPARTAMENTO in vendita  Piazza Aurora (DE)', '<p>Jesolo Lido - Piccolo fabbricato di sole 3 unit&agrave; in una posizione centralissima a 50 m&nbsp;&nbsp;dal mare. Appartamento al secondo ed ultimo piano, composto da ingresso, ampio soggiorno, cucina abitabile, due camere da letto, bagno e terrazzo. Posizione centralissima.</p>', '', 'Jesolo Lido - Piccolo fabbricato di sole 3 unit in una posizione centralissima a pochi passi dal mare. Appartamento al secondo ed ultimo piano.', 'RIF. SST', 147, '', 1, 0, 0, '', 'Piazza Aurora - Jesolo Lido', 'G', '300.000', '', '', 'Secondo piano', '80', ''),
(350, 127, 2, 'Jesolo - PORZIONE BIFAMILIARE vendesi (DE)', '<p>Jesolo Lido porzione Villa bifamiliare&nbsp;su due livelli con ampio spazio privato a disposizione. Piano terra: monovano ed un servizio, primo piano: &nbsp;due camere ed un servizio. Posto auto esterno riservato con copertura pompeiana e magazzino. Ottime finiture.Spese condominiali minime.</p>', '', 'Jesolo Lido - porzione Villa Bifamiliare  su due livelli con ampio spazio privato a disposizione.', 'RIF. PLL10', 149, '', 1, 0, 0, '', 'Piazza Aurora - Jesolo Lido', 'E', '290.000', '', '2008', 'Piano terra e primo piano', '80', ''),
(351, 128, 2, 'Jesolo - NUOVO RESORT con piscina (DE)', '<p>Jesolo - NUOVO RESORT con piscina &nbsp;in costruzione che coniuga elevatissimi standard costruttivi ad un design molto ricercato ed elegante. Progetto che prevede la costruzione di sole &nbsp;10 unit&agrave; e dove si spazia dalla villa singola con ampio giardino privato alla maisonette, tutte dotate di posto auto riservato e coperto.</p>', '', 'Jesolo - NUOVO RESORT con piscina  in costruzione che coniuga elevatissimi standard costruttivi ad un design molto ricercato ed elegante.', 'RIF.  NPR', 150, '', 1, 1, 0, '', 'Jesolo Lido', 'Casa Clima', 'da 295.000', '', '', 'Piano terra e primo piano', '', ''),
(352, 129, 2, 'Jesolo Paese SPLENDIDA VILLA SINGOLA (DE)', '<p>Jesolo Paese splendida Villa singola , costruzione signorile &nbsp;fine anni 80 su lotto di circa 1000 mq con ampio giardino. Superficie circa 450 mq su due piani.&nbsp;</p>', '', 'Jesolo Paese - Splendida Villa singola , costruzione fine anni 80 su lotto di circa 1000 mq con ampio giardino. Superficie circa 450 mq su due piani.', 'RIF. VMLL', 151, '', 1, 0, 0, '', 'Jesolo Paese', 'E', 'Tratt. riservate', '', '', 'Piano terra e primo piano', '450', ''),
(353, 130, 2, 'Albatros quadri int.B11 (DE)', '<p>Condominio in zona centralissima con parcheggio riservato. &nbsp;Appartamento al 3&deg; piano, composto da &nbsp;3 camere da letto (6 posti letto), ampio soggiorno, cucina separata , 2 bagni ed ampio &nbsp;terrazzo panoramico . L''appartamento &egrave; dotato di lavatrice, aria condizionata e TV.</p>', '', 'Condominio in zona centralissima a pochi metri dal mare', '', 153, '', 1, 0, 0, '45.493198, 12.611965', 'Pressi Piazza Aurora', '', '', '', '', '', '', '6'),
(354, 131, 2, 'Centromare  3 camere int 7 (DE)', '<p>Condominio frontemare in Piazza Mazzini con parcheggio e posto spiaggia riservati. Quadrilocale &nbsp;al piano rialzato con 3 camere da letto (totale 7 posti letto) , sogg/pranzo, cucina separata, 2 bagni ed ampio terrazzo con vista mare frontale. Appartamento dotato di TV, lavatrice, lavastoviglie ed aria condizionata.</p>', '', 'Condominio frontemare in Piazza Mazzini,  con parcheggio e posto spiaggia riservati.', '', 154, '', 1, 0, 0, '45.495492, 12.617747', 'Via Zara, 5', '', '', '', '', '', '', '7'),
(355, 132, 2, 'Jesolo Lido appartamento frontemare (DE)', '<p>Jesolo Lido appartamento su condominio frontemare, ristrutturato, compostao da soggiorno/pranzo, angolo cottura, 2 ampie camere da letto, doppi servizi, ropistiglio, terrazzo vista mare laterale, posto auto riservato. L''appartamento &egrave; dotato di impianti autonomi aria condizionata/pompa di calore. Il tutto ben arredato.</p>', '', 'Jesolo Lido, appartamento su condominio frontemare, ristrutturato, centralissimo', 'RIF. CSN01', 155, '', 1, 1, 0, '', 'zona piazza Marconi', 'G', '330.000', '', '', '2', '75', ''),
(356, 133, 2, 'Albatros 3 camere int B 11 (DE)', '<p>Jesolo - Condominio nella centralissima Piazza Aurora a pochi passi dal mare con parcheggio e posto spiaggia. Appartamento al 3&deg; piano, con ascensore, composto da spazioso soggiorno, cucinotto separato, 3 camere da letto (un totale di 6 posti letto), due bagni ed ampio terrazzo abitabile e panoramico. L''appartamento &egrave; dotato di TV, lavatrice ed &nbsp;aria condizionata.</p>', '', 'Condominio  nella centralissima Piazza Aurora a pochi passi dal mare con parcheggio e posto spiaggia.', '', 156, '', 1, 0, 0, '', 'Piazza Aurora - Via Foscolo n. 9', '', '', '', '', '', '', '');
