(14, 'privacy', 'textarea', 51, 'Privacy', 'a:4:{s:5:"value";s:4164:"Informazioni+sulla+Privacy%0D%0A%0D%0AInformativa+resa+ai+sensi+dell%27art.+13+del+d.lgs.+30+giugno+2003+n.+196+%28Codice+in+materia+di+Protezione+dei+Dati+Personali%2C+di+seguito+%22C.P.%22%29%0D%0A%0D%0AIl+Titolare+del+Trattamento%0D%0ANel+corso+o+a+seguito+della+consultazione+di+questo+sito+Internet%2C+possono+essere+trattati+dati+relativi+a+persone+identificate+o+identificabili.+Il+titolare+del+loro+trattamento+%E8+il+Gruppo+SME+srl+-+Via+Vittoria%2C+45+-+31040+Cessalto+%28TV%29+-+C.F.%2FP.IVA+e+Registro+Imprese+TV+n.+02041740271.%0D%0A%0D%0ALuogo+di+Trattamento+dei+Dati%0D%0AI+trattamenti+connessi+ai+servizi+web+di+questo+sito+hanno+luogo+presso+la+predetta+sede+e+sono+curati+solo+da+personale+incaricato+del+trattamento%2C+oppure+da+eventuali+incaricati+di+occasionali+operazioni+di+manutenzione.%0D%0AI+dati+personali+forniti+dagli+utenti+che+inoltrano+specifiche+richieste+sono+utilizzati+al+solo+fine+di+eseguire+il+servizio+o+la+prestazione+richiesta+e+sono+comunicati+a+terzi+nel+solo+caso+in+cui+ci%F2+sia+a+tal+fine+necessario.%0D%0A%0D%0ATipi+di+Dati+trattati%0D%0A%2F%2F+Dati+di+navigazione%0D%0AI+sistemi+informatici+e+le+procedure+software+preposte+al+funzionamento+di+questo+sito+Internet+acquisiscono%2C+nel+corso+del+loro+normale+esercizio%2C+alcuni+dati+personali+la+cui+trasmissione+%E8+implicita+nell%27uso+dei+protocolli+di+comunicazione+di+Internet.+Si+tratta+di+informazioni+che+non+sono+raccolte+per+essere+associate+a+interessati+identificati%2C+ma+che+per+loro+stessa+natura+potrebbero%2C+attraverso+elaborazioni+ed+associazioni+con+dati+detenuti+da+terzi%2C+permettere+di+identificare+gli+utenti.%0D%0AQuesti+dati+vengono+utilizzati+al+solo+fine+di+ricavare+informazioni+statistiche+anonime+sull%27uso+del+sito+e+per+controllarne+il+corretto+funzionamento.%0D%0A%0D%0A%2F%2F+Dati+forniti+volontariamente+dall%27utente%0D%0AL%27invio+facoltativo%2C+esplicito+e+volontario+di+posta+elettronica+agli+indirizzi+indicati+su+questo+sito+comporta+la+successiva+acquisizione+dell%27indirizzo+del+mittente%2C+necessario+per+rispondere+alle+richieste%2C+nonch%E9+degli+eventuali+altri+dati+personali+inseriti+nella+missiva.%0D%0ASpecifiche+informative+di+sintesi+verranno+progressivamente+riportate+o+visualizzate+nelle+pagine+del+sito+predisposte+per+particolari+servizi+a+richiesta.%0D%0A%0D%0A%2F%2F+Cookies%0D%0AI+cookies+sono+una+piccola+quantit%E0+di+dati+che+vengono+memorizzati+nella+RAM+del+computer+o+sul+disco+fisso%2C+ogni+volta+che+un+sito+web+viene+visitato.+Il+nostro+sito+Internet+utilizza+i+cookies+per+riconoscere+e+tenere+traccia+dei+visitatori%2C+al+fine+di+fornire+loro+un+accesso+pi%F9+veloce+al+sito+e+di+modificarne+i+contenuti+in+base+alle+preferenze.+I+cookies+non+consentono+in+alcun+modo+al+sito+visitato+di+avere+accesso+a+qualsiasi+altro+dato+presente+nel+computer+degli+utenti.%0D%0A%0D%0AFacoltativit%E0+del+conferimento+dei+Dati%0D%0AA+parte+quanto+specificato+per+i+dati+di+navigazione%2C+l%27utente+%E8+libero+di+fornire+i+dati+personali+qualora+richiesto+in+apposite+sezioni+del+sito.%0D%0AIl+loro+mancato+conferimento%2C+tuttavia%2C+pu%F2+comportare+l%27impossibilit%E0+di+ottenere+quanto+eventualmente+richiesto.%0D%0A%0D%0AModalit%E0+del+Trattamento%0D%0AI+dati+personali+sono+trattati+con+strumenti+automatizzati+per+il+tempo+strettamente+necessario+a+conseguire+gli+scopi+per+cui+sono+stati+raccolti.%0D%0ASpecifiche+misure+di+sicurezza+sono+osservate+per+prevenire+la+perdita+dei+dati%2C+usi+illeciti+o+non+corretti+ed+accessi+non+autorizzati.%0D%0A%0D%0ADiritti+degli+interessati%0D%0AAi+sensi+dell%27art.+7+del+C.P.%2C+i+soggetti+cui+si+riferiscono+i+dati+personali+hanno+il+diritto+in+qualunque+momento+di+ottenere+la+conferma+dell%27esistenza+o+meno+dei+medesimi+dati%2C+di+conoscerne+il+contenuto+e+l%27origine%2C+verificarne+l%27esattezza+o+chiederne+l%27integrazione%2C+l%27aggiornamento+o+la+rettificazione%2C+chiederne+la+cancellazione%2C+la+trasforma