(27, 123, 1, 'Privacy Policy', '', 0, 615, ',,', ',,', 1, 0, 0, '<div>This page describes the site management with reference to users'' personal data processing.<br />This information notice is given pursuant to Art. 13 of Italian Legislative Decree No. 196/2003 - Personal data protection code for those interacting with the web services of <strong>Comavit pali precompressi srl</strong>, accessible electronically at: www.comavit.it.<br /><br />This statement is also prompted by Recommendation No. 2/2001 that the European authorities for the protection of personal data, united in the Group established by Art. 29 of Directive No. 95/46/EC, adopted on 17 May 2001 to identify some minimum requirements for the collection of personal data online and, in particular, the manner, timing and nature of the information that data controllers must provide to users when the latter connect to web pages, regardless of the purpose of their connection.<br /><br />Those using this site for business purposes are required to comply with the requirements contained in the Code for the protection of personal data and, in particular, to those provided by Art. 130, on the subject of unsolicited communications (use of automated calling systems, email, fax, SMS or MMS type messages) and those laid down in Art. 130.3-bis, concerning the obligation of prior consultation of the "Do Not Call" registry borne by all those who intend to do telemarketing (both towards companies and consumers).<br /><br />However, as far as the possibility of being contacted is concerned, again for commercial purposes, but by using the phone number published on this site, please note that those who do not wish to be called for these purposes should explicitly express this desire by entering their phone number in the "Do Not Call Registry", (www.registrodelle opposizioni.it) governed by Presidential Decree 7/9/2010 No. 178. Therefore, the expression of consent previously given on this matter and according to which telephone numbers published on the lists could not be used for commercial communication purposes is not effective any longer, unless the subscriber has not expressly given his consent (by having the symbol of a telephone receiver inserted in the lists, next to the name).</div>\r\n<div><br /><strong>Data controller</strong><br />In the process of or following consultation of this web site, data pertaining to identified or identifiable persons may be processed. The entity authorized to perform such processing operations, data controller, is&nbsp; <strong>Comavit pali precompressi srl</strong>,&nbsp;Via Piave 27/A -&nbsp;Tezze di Vazzola - Treviso.</div>\r\n<p><strong>Where Data Is Processed</strong><br />The processing operations in connection with the services on this web site are performed at the aforementioned office only by staff specifically designated to the processing of data, or by such staff as should be appointed for non-routine maintenance operations. No data deriving from the web service is communicated or disseminated. The personal data supplied by users forwarding specific requests will be used for the sole purpose of performing the service or provision requested and will be communicated to third parties only where required in connection thereof.</p>\r\n<p><strong>TYPES OF DATA PROCESSED</strong><br /><span style="text-decoration: underline;"><strong>Navigation data</strong></span></p>\r\n<p>Information systems and the software procedures for running this web site acquire, in the ordinary course of operations, some personal data whose forwarding is implied in the use of the communication protocols of the Internet. This type of information is not collected for the purpose of being associated with identified interested parties; on account of its nature, however, by processing and reference to data held by third parties, it may lead to the user being identified.</p>\r\n<p>This category of data includes IP addresses or domain names of computers used by people who connect to the site, the URI (Uniform Resource Identifier) addresses ??of requested resources, the time of request, the method used to submit the request to the server, the size of the file received in reply, the numerical code indicating the status of the reply given by the server (successful, error, etc.) and other parameters regarding the operating system and computer environment of the user. These data are used for the sole purpose of obtaining anonymous statistical information on the use of the web site and to verify that it functions properly.</p>\r\n<p>The data could be used to ascertain responsibility in the event of hypothetical computer offences to the detriment of the site.</p>\r\n<p><span style="text-decoration: underline;"><strong>Data provided by the user on his own initiative</strong></span><br />The optional, specified and voluntary forwarding of electronic mail to the addresses shown on this web site entails the subsequent acquisition of the sender''s address, needed to reply to enquiries, as well as any further personal data entered in the mail. Specific summary information will be shown or visualized progressively on the web site pages designated for special services available upon request.</p>\r\n<p><strong>COOKIES</strong><br />A cookie is a small text file that stores some information about your browsing. Cookies allow you to be recognised by the website as a unique user. They are sent from the website to your terminal (computer, tablet, smartphone, notebook computer etc.) in order to be stored and then retransmitted at the following visit. Cookies provide a more efficient operation of the website, improving its browsing, for example, by remembering the entered settings, so as not to change them every time you access a new page; or by saving the entered information (such as username, language, browser type, etc.). The storage time of the acquired data depends on the types of cookies. Session cookie expire when the browser is closed. Persistent cookies have typical expiry dates ranging from two months to a couple of years.</p>\r\n<p><strong>Using cookies in this Site</strong><br />Our website uses the following types of cookies:</p>\r\n<ol>\r\n<li><strong>Browsing cookies:</strong> We use browsing cookies so you can view our website easily, create your account, log in to access restricted areas and proceed with purchases. These cookies are essential for the proper functioning of our site.<br /><br /></li>\r\n<li><strong>Functional cookies:</strong> We use functional cookies to remember your preferences and to help you use our website in the most effective way possible, for example by storing the products you previously displayed. Functional cookies are not essential to the operation of the website, but add services by improving the overall browsing experience.<br /><br /></li>\r\n<li><strong>Analytical cookies:</strong> We use analytical cookies to better understand how our users use the website, to optimize and improve the Site and to ensure that it is always effective and efficient for users. The data that we obtain concern the web pages you visit, the type of platform used, date and time information and data such as the number of clicks on a given page, the words you looked up and text input while using the site.</li>\r\n</ol>\r\n<p><strong><em>Disabling and Deleting cookies (opt-out)</em></strong></p>\r\n<p>The majority of Internet browsers are initially set to accept cookies automatically. This means that you can, at any time, set your browser to accept all cookies, only some, or to reject them, disabling their use from the sites. In addition, you can normally set the preferences of your browser so as to be notified whenever a cookie is stored in your computer.</p>\r\n<p>Finally, at the end of each browsing session you can delete the collected cookies from the hard disk of your device. If you want to delete the cookies installed in the cookie folder of your browser, you must remember that each browser has different procedures for managing settings.</p>\r\n<p>By selecting the links below you can get specific instructions for some of the major browsers. If you want</p>\r\n<ul>\r\n<li>Microsoft Windows Explorer: <a href="http://windows.microsoft.com/en-us/windows-vista/block-or-allow-cookies" target="_blank">http://windows.microsoft.com/en-us/windows-vista/block-or-allow-cookies</a></li>\r\n<li>Google Chrome: <a href="https://support.google.com/chrome/bin/answer.py?hl=en&amp;answer=95647&amp;p=cpn_cookies" target="_blank">https://support.google.com/chrome/bin/answer.py?hl=en&amp;answer=95647&amp;p=cpn_cookies</a></li>\r\n<li>Mozilla Firefox: <a href="http://support.mozilla.org/en-US/kb/Enabling%20and%20disabling%20cookies" target="_blank">http://support.mozilla.org/en-US/kb/Enabling%20and%20disabling%20cookies</a></li>\r\n<li>Apple Safari: <a href="http://docs.info.apple.com/article.html?path=Safari/5.0/en/9277.html" target="_blank">http://docs.info.apple.com/article.html?path=Safari/5.0/en/9277.html</a></li>\r\n<li>Google Analytics: <a href="https://tools.google.com/dlpage/gaoptout/">https://tools.google.com/dlpage/gaoptout/</a></li>\r\n</ul>\r\n<p>To know more about cookies in general visit the page <a href="http://www.allaboutcookies.org">www.allaboutcookies.org</a> and <a href="http://www.garanteprivacy.it/cookie/">www.garanteprivacy.it/cookie/</a></p>\r\n<p><strong>USE OF COOKIES FOR MONITORING, STATISTICS AND PLUGINS</strong></p>\r\n<p><strong><em>Piwik Cookies</em></strong></p>\r\n<p>This website uses the Web Analytics service provided by&nbsp; Piwik. The measurement system can make use of "cookies", which are stored on the PC''s browser to allow analysing anonymously how the site is used. The fully anonymous information stored in the cookies is: date and time you accessed the site, unique ID, session ID. This data is sent to the server where the software Piwik &nbsp;is installed to prepare reports on how the website is used, on the web marketing activities as well as to provide the browser with functionality and interaction while browsing. Piwik may transfer this information to third parties who process data in their name and account, or if this is imposed by mandatory standards.&nbsp; At any time, you can disable cookies from your PC by changing the Security and Privacy settings on the browser, but this option could limit many of the site''s browsing features. The complete information notice, pursuant to Art. 13 of Legislative Decree&nbsp; No. 196/03, is available on <a href="http://piwik.org/privacy/">http://piwik.org/privacy/</a></p>\r\n<p><strong><em>Google Analytics Cookies</em></strong></p>\r\n<p>This website may use Google Analytics, a web analysis service provided by Google Inc., 1600 Amphitheatre Parkway, Mountain View, California, 94043 USA, (hereinafter "Google"). Google Analytics uses the so-called "cookies", text files that are stored on your computer to help analyse how you use the website. The information about the use of the website (including your IP address) obtained through the cookies shall be sent and stored on a Google server in the United States. By using this website, you consent to the processing of your data by Google. It is possible to disable Google Analytics'' cookies by using the opt-out add-in provided by Google to the main browsers. <a href="https://tools.google.com/dlpage/gaoptout/">https://tools.google.com/dlpage/gaoptout/</a></p>\r\n<p>To consult the privacy policy of the company Google, concerning the Google Analytics service, please visit the website <a href="http://www.google.com/intl/en/analytics/privacyoverview.html">http://www.google.com/intl/en/analytics/privacyoverview.html</a>.</p>\r\n<p>To learn about the privacy policies of Google, you are invited to visit the website <a href="http://www.google.com/intl/it/policies/privacy/">http://www.google.com/intl/it/policies/privacy/</a></p>\r\n<p><strong><em>Google Adwords &amp; Google Remarketing Cookies</em></strong></p>\r\n<p>This website may use Google Adwords and Google Remarketing.&nbsp; Both services are managed by Google Inc .. The function that monitors AdWords conversions also uses cookies. To help us keep track of sales and other conversions, a cookie is added to a user''s computer when that user clicks on an ad. This cookie lasts 30 days and does not collect, nor monitor information able to personally identify a user. Users can disable Google conversion monitoring cookies in the settings of their Internet browser.</p>\r\n<p>Our site complies with the "Policy for advertising based on interests and location" of Google, available at the following link: <a href="https://support.google.com/adwordspolicy/answer/143465#sensitive">https://support.google.com/adwordspolicy/answer/143465#sensitive</a>.</p>\r\n<p>Users can disable the use of cookies by Google by visiting the page: <a href="http://www.google.com/settings/ads">http://www.google.com/settings/ads</a></p>\r\n<p>Alternatively, you can indicate to visitors to turn off the use of cookies by a third-party supplier by visiting the opt-out page of the Network Advertising Initiative: <a href="http://www.networkadvertising.org/managing/opt_out.asp">http://www.networkadvertising.org/managing/opt_out.asp</a></p>\r\n<p><strong><em>Facebook Cookies</em></strong></p>\r\n<p>Our website may use the so-called Plugins of the social network Facebook.com (hereinafter "Facebook"), managed by Facebook Inc., 1601 S. California Ave, Palo Alto, CA 94304, USA. After authentication, you will find a list of the main Facebook plugins at the following address:.</p>\r\n<p>When you recall a page that contains one of these plugins from our site, your browser loads and displays the contents of the Facebook server''s plugin. In this way, the page of our site you are visiting is notified to the Facebook server.</p>\r\n<p>If you have a Facebook profile and are connected to Facebook while visiting our website, it will recognise, through the information sent by the plugin, what page you''re visiting and assign the visit to your Facebook account. When you interact with the plugins, for example by clicking "Like" or by posting a comment, the information is sent to your Facebook account, where it will be stored. The information about the visit of our website is transmitted to Facebook regardless of whether or not you activate a plugin.</p>\r\n<p>To prevent the transmission and storage of data about yourself and your Internet browsing via Facebook, you must log out of Facebook before visiting our website.&nbsp; To block future collection and transmission of your data via Facebook plugins to the link below, you can download the add-on "Facebook Blocker" for your browser. We advise you not to delete the add-on until you want to block Facebook plugins: <a href="http://webgraph.com/resources/facebookblocker/">http://webgraph.com/resources/facebookblocker/</a></p>\r\n<p>You will&nbsp; find the privacy policy of Facebook at the Internet address below, containing further information on the collection and use of data by Facebook, on your rights in respect thereof, in addition to the setting options concerning privacy protection: <a href="http://www.facebook.com/policy.php">http://www.facebook.com/policy.php</a></p>\r\n<p><strong><em>Google Plus Cookies</em></strong></p>\r\n<p>Our website may use Google''s social network Google+ (Google Plus). When you recall a page that contains the "+1" button from our site, your browser loads and displays the contents of the related Google+ page. In this way, the Google server recognises the page of our site you are visiting. The browsing history is stored for a maximum period of two weeks.</p>\r\n<p>You will find the privacy policy of Google for the button "+1" at the Internet address below, containing further information on the collection, transmission and use of data by Google, on your rights in respect thereof and about the setting options of the profile: <a href="https://www.google.com/intl/de/+/policy/+1button.html">https://www.google.com/intl/de/+/policy/+1button.html</a></p>\r\n<p><strong>Optional provision of data</strong></p>\r\n<p>Without prejudice to the instructions provided with respect to navigation data, the user shall be free to decide whether or not to provide personal data, should it be so requested in special sections of the site.<br />However, failing to provide such data may result in us being unable to fulfil your request.</p>\r\n<p><strong>PROCESSING PROCEDURE</strong></p>\r\n<p>Personal data are processed by automated means only for such time as is strictly necessary to fulfil the purpose for which they are being held. Appropriate security measures have been taken against accidental loss of the data, unauthorized or unlawful uses and unauthorized access. The data collected may be used on behalf of the data controller, of the administrators in charge of performing processing services and proper conduct of the activities of the site.</p>\r\n<p><strong>TRANSFER OF YOUR INFORMATION ABROAD</strong></p>\r\n<p>The personal data provided, entered through this or other websites, could be transferred to other countries by us or our agents in order to comply with the contractual obligations and the mandatory requirements of intra-group and/or franchising communication.</p>\r\n<p><strong>RIGHTS OF THE PARTIES CONCERNED</strong></p>\r\n<p>Pursuant to section 7 of the P.C., the parties to whom the personal data refer may at any time request confirmation that their data is being held, be notified of the contents of such data and their origin, verify whether they are accurate or request that they be completed, updated, corrected, erased, demand that they be made anonymous or demand that data held in violation of law be blocked, and such parties may also object, for legitimate reasons, to the data being processed.<br />Any requests to the above-stated effect should be addressed to the data controller <strong>Comavit pali precompressi srl</strong>.<br />This privacy policy may be revised periodically and the use of the information collected is subject to the privacy policy in force at the time of use.</p>', 1, 'pippo (182.1.1.1)', 'testo_media_link.tpl', 0, '', '', '', '', '', '', '', ''),
