(137, 41, 2, 'Menu Riservato (DE)', '', 0, 58067, '', '1', 0, 0, 0, '<TABLE cellSpacing="0" cellPadding="0" width="691" summary="123" border="0">\n  <TBODY>\n    <TR> \n      <TD vAlign="top"><span style="   Font-Size:13px; "><BR>\n        <span style="  Font-family:Arial, Helvetica, sans-serif; ">Questa sezione \n        &egrave; riservata al personale della <br>\n        &quot;<B><span style=" color:#3f83a8; "><font color="#990000">Comavit</font></span></B>&quot;.<br>\n        <br>\n        Per accedere a queste aree inserite login e password nell''apposita area \n        a sinistra.<br>\n        Se non si possiedono questi dati e se si vogliono maggiori informazioni \n        sui servizi riservati contattate la <B><a href="/index.php?area=73&menu=23"><span style=" color:#3f83a8; "><font color="#990000">Comavit \n        Pali Precompressi srl</font></span></a></B><span style=" color:#000000; ">.</span></span></span> \n        <span style="   Font-Size:13px; "> \n        <P align="justify"><span style="  Font-family:Arial, Helvetica, sans-serif; ">. \n          <br>\n          Buona Navigazione. </span> </span></TD>\n      <TD width="50"> <P align="center"><IMG alt="." src="/public/linea.gif" align="middle"></TD>\n      <TD vAlign="top"><IMG alt="Studio Prisma" \nsrc="templates/area_riservata/foto_01.jpg" \nalign="right"></TD>\n    </TR>\n  </TBODY>\n</TABLE>', 1, 'pippo (182.1.1.1)', '', 0, NULL, NULL, NULL, NULL, NULL, NULL, '', ''),
(138, 15, 2, 'Cookie Policy (DE)', '', 0, 0, ',,', ',,', 1, 0, 0, '<p align="justify">Utilizzando il sito www.immobiliaremazzini.com (&ldquo;Sito&rdquo;) o ricevendo le nostre e-mail, date il vostro consenso all&rsquo;utilizzo di cookie in conformit&agrave; con la presente &laquo;Politica dei Cookie&raquo;.</p>\r\n<h3>Definizione e Scopo &ndash; Cosa sono i Cookie</h3>\r\n<p align="justify">Le pagine web non hanno funzione mnemonica. Navigando da una pagina all&rsquo;altra di un sito web, non sarai riconosciuto come lo stesso utente in ciascuna delle pagine. Un cookie &egrave; un file di testo di piccole dimensioni in cui sono memorizzate alcune informazioni riguardanti la tua navigazione. I cookie ti consentono di essere riconosciuto dal Sito web come utente unico. Vengono inviati dal Sito web al tuo terminale (computer, tablet, smartphone, notebook ecc.), per essere memorizzati e poi ritrasmessi nella visita successiva.</p>\r\n<p align="justify">I cookies garantiscono un funzionamento pi&ugrave; efficiente del Sito web, migliorandone la navigazione, ad esempio:</p>\r\n<ul>\r\n<li>\r\n<div align="justify">ricordando le impostazioni inserite, cos&igrave; da non doverle modificarle ogni volta che si accede a una nuova pagina;</div>\r\n<div align="justify">&nbsp;</div>\r\n</li>\r\n<li>\r\n<div align="justify">memorizzando le informazioni inserite (ad esempio il nome utente, la lingua, il tipo di browser etc.).</div>\r\n</li>\r\n</ul>\r\n<p class="MsoNormal" style="margin-bottom: 0pt;" align="justify">Per maggiori informazioni su cookie e privacy si pu&ograve; consultare la documentazione presente sul sito del Garante della privacy al seguente link:&nbsp;<a href="http://www.garanteprivacy.it/" target="_blank">http://www.garanteprivacy.it/</a>.</p>\r\n<p><span style="text-decoration: underline;">L&rsquo;accesso al Sito e la navigazione del medesimo esprimono il tuo consenso a ricevere i cookie.</span></p>\r\n<h3>Durata e Tipologia dei Cookie</h3>\r\n<p align="justify">Alcuni cookie vengono automaticamente eliminati al termine della sessione di navigazione, mentre altri restano memorizzati nei terminali, normalmente ospitati nel browser utilizzato (ad esempio: Google Chrome, Internet Explorer, Mozilla Firefox, etc). I cookie di durata sono quindi di due tipi:</p>\r\n<p align="justify"><span style="text-decoration: underline;"><strong>Cookie temporanei:</strong></span><br /> I cookie temporanei (o cookie della sessione) vengono rimossi dal computer alla chiusura del browser. Vengono utilizzati per archiviare informazioni temporanee, ad esempio gli articoli presenti nel carrello. Quasi tutti i cookie dei siti Web visualizzati sono cookie di sessione la cui attivit&agrave; termina alla chiusura del proprio Internet browser.</p>\r\n<p align="justify"><span style="text-decoration: underline;"><strong>Cookie persistenti:</strong></span><br /> I cookie persistenti sono cookie memorizzati nel computer o altro dispositivo degli utenti nel corso di una sessione di navigazione, ma che restano nel computer o altro dispositivo dopo la fine della suddetta sessione di navigazione. I cookie persistenti soddisfano a diverse funzionalit&agrave; nell&rsquo;interesse degli utenti (vengono utilizzati per archiviare informazioni, ad esempio il nome e la password di accesso, in modo da evitare che si debba riscriverli ogni volta che si visita lo stesso sito). Possono rimanere archiviati nel dispositivo per un lasso di tempo variabile, ma comunque determinato, in base alla funzione che stanno svolgendo.</p>\r\n<p align="justify">Queste due tipologie di cookie (di sessione e persistenti) possono a loro volta essere &ldquo;proprietari&rdquo; e &ldquo;di terzi&rdquo;. Quando parliamo di cookie proprietari, intendiamo i cookie trasmessi dal proprietario dei siti web. Quando parliamo di cookie di terzi, intendiamo i cookie trasmessi da soggetti terzi, quindi impostati da un sito web diverso da quello che si sta attualmente visitando. Questi ultimi ricadono sotto la diretta ed esclusiva responsabilit&agrave; del terzo gestore.</p>\r\n<p align="justify">In qualsiasi momento puoi cancellare tutti i cookie dal browser. Tuttavia, disabilitare permanentemente tutti i cookie pu&ograve; comportare difficolt&agrave; di navigazione o, talvolta, l&rsquo;impossibilit&agrave; di usufruire di alcune funzionalit&agrave; del Sito. Per esempio non potresti pi&ugrave;: utilizzare i negozi di e-commerce per fare i tuoi acquisti, entrare nell&rsquo;Area Clienti e gestire i prodotti che hai acquistato, utilizzare software web-based, etc.</p>\r\n<h3>Utilizzo di cookie in questo Sito</h3>\r\n<p>Il nostro Sito utilizza i seguenti tipi di cookie:</p>\r\n<ol>\r\n<li>\r\n<div align="justify"><!--[if !supportLists]--><strong><span style="text-decoration: underline;">Cookie di navigazione:</span></strong> utilizziamo i cookie di navigazione per consentirti di visualizzare il nostro sito web, di farlo funzionare correttamente, di creare il tuo account, di effettuare il login accedendo ad aree riservate e di poter procedere con gli acquisti. Questi cookie sono indispensabili per il corretto funzionamento del nostro Sito.</div>\r\n<div align="justify">&nbsp;</div>\r\n</li>\r\n<li>\r\n<div align="justify"><span style="text-decoration: underline;"><strong> Cookie funzionali:</strong></span> Utilizziamo i cookie funzionali per ricordare le tue preferenze e per aiutarti a usare il nostro Sito web in modo il pi&ugrave; efficace possibile, per esempio memorizzando i prodotti che hai visualizzato in precedenza. I cookie funzionali non sono indispensabili per il funzionamento del Sito web, ma aggiungono servizi migliorando l&rsquo; esperienza complessiva di navigazione.</div>\r\n<div align="justify">&nbsp;</div>\r\n</li>\r\n<li>\r\n<div align="justify"><span style="text-decoration: underline;"><strong> Cookie analitici:</strong></span> Utilizziamo i cookie analitici per capire meglio come i nostri utenti usano il Sito web, per ottimizzare e migliorare il Sito e per assicurarci che lo stesso sia sempre efficace ed efficiente per gli utenti. I dati che ricaviamo riguardano le pagine web visitate, il tipo di piattaforma utilizzata, informazioni su data e ora e dati come il numero di click su una determinata pagina, le parole cercate e i testi immessi durante l&rsquo;utilizzo del Sito.</div>\r\n</li>\r\n</ol>\r\n<h3>Disabilitazione e Cancellazione dei cookies (opt-out)</h3>\r\n<p align="justify">La maggioranza dei browser internet sono inizialmente impostati per accettare i cookie in modo automatico. Ci&ograve; significa che hai la possibilit&agrave;, in ogni momento, di impostare il tuo browser in modo da accettare tutti i cookie, solo alcuni, oppure di rifiutarli, disabilitandone l&rsquo;uso da parte dei siti. Inoltre puoi normalmente impostare le preferenze del tuo browser in modo tale da essere avvisato ogni volta che un cookie viene memorizzato nel tuo computer.</p>\r\n<p align="justify">Al termine di ogni sessione di navigazione, infine, puoi cancellare dal disco fisso del tuo dispositivo i cookie raccolti. Se vuoi eliminare i cookie installati nella cartella dei cookie del browser utilizzato, occorre rammentare che ciascun browser presenta procedure diverse per la gestione delle impostazioni.</p>\r\n<p align="justify">Selezionando i collegamenti sottostanti puoi ottenere istruzioni specifiche per alcuni dei principali browser.</p>\r\n<p class="western" style="orphans: 2; widows: 2;"><strong>Microsoft Windows Explorer:</strong><br /> <a title="http://windows.microsoft.com/en-us/windows-vista/block-or-allow-cookies" href="http://windows.microsoft.com/en-us/windows-vista/block-or-allow-cookies" target="_blank">http://windows.microsoft.com/en-us/windows-vista/block-or-allow-cookies</a></p>\r\n<p class="western" style="orphans: 2; widows: 2;"><strong>Google Chrome:</strong><br /> <a href="https://support.google.com/chrome/bin/answer.py?hl=en&amp;answer=95647&amp;p=cpn_cookies" target="_blank">https://support.google.com/chrome/bin/answer.py?hl=en&amp;answer=95647&amp;p=cpn_cookies</a></p>\r\n<p class="western" style="orphans: 2; widows: 2;"><strong>Mozilla Firefox:</strong><br /> <a href="http://support.mozilla.org/en-US/kb/Enabling%20and%20disabling%20cookies" target="_blank">http://support.mozilla.org/en-US/kb/Enabling%20and%20disabling%20cookies</a></p>\r\n<p class="western" style="orphans: 2; widows: 2;"><strong>Apple Safari:</strong><br /> <a href="http://docs.info.apple.com/article.html?path=Safari/5.0/en/9277.html" target="_blank">http://docs.info.apple.com/article.html?path=Safari/5.0/en/9277.html</a></p>\r\n<p class="western" style="orphans: 2; widows: 2;"><strong>Google Analytics:</strong> <br /> &egrave; possibile disabilitare soltanto i cookie di Google Analytics, utilizzando il componente aggiuntivo di opt-out fornito da Google per i browser principali&nbsp;<a href="https://tools.google.com/dlpage/gaoptout" target="_blank">https://tools.google.com/dlpage/gaoptout</a></p>\r\n<p>Se vuoi saperne di pi&ugrave; sui cookie in generale visita la pagina&nbsp;<a href="http://www.allaboutcookies.org" target="_blank">www.allaboutcookies.org</a>&nbsp; &nbsp;</p>\r\n<h3>Per maggiori informazioni puoi contattare:</h3>\r\n<p><strong>Immobiliare Mazzini<br /></strong>Piazza Mazzini - Jesolo Lido (Venezia)&nbsp;<br /> T. +39&nbsp;<strong>&nbsp;</strong>0421.972692<br />info@immobiliaremazzini.com&nbsp;|&nbsp;www.immobiliaremazzini.com</p>', 1, 'pippo (182.1.1.1)', '_interno_FW.tpl', 0, NULL, NULL, NULL, NULL, NULL, NULL, '', ''),
(139, 123, 2, 'Informazioni sulla Privacy  (DE)', '', 0, 615, ',,', ',,', 1, 0, 0, '<p class="MsoNormal" style="text-align: justify;" align="justify">In questa pagina si descrivono le modalit&agrave; di gestione del sito in riferimento al trattamento dei dati personali degli utenti che lo consultano.</p>\r\n<p align="justify">Si tratta di un''informativa che &egrave; resa anche ai sensi dell''art. 13 del d.lgs. n. 196/2003 - Codice in materia di protezione dei dati personali a coloro che interagiscono con i servizi web di <strong>Immobiliare Mazzini</strong>, accessibili per via telematica all''indirizzo: www.immobiliaremazzini.com.</p>\r\n<p align="justify">L''informativa s''ispira anche alla Raccomandazione n. 2/2001 che le autorit&agrave; europee per la protezione dei dati personali, riunite nel Gruppo istituito dall''art. 29 della direttiva n. 95/46/CE, hanno adottato il 17 maggio 2001 per individuare alcuni requisiti minimi per la raccolta di dati personali on-line e, in particolare, le modalit&agrave;, i tempi e la natura delle informazioni che i titolari del trattamento devono fornire agli utenti quando questi si collegano a pagine web, indipendentemente dagli scopi del collegamento.</p>\r\n<p align="justify">Coloro che utilizzano il presente sito per fini professionali sono tenuti all''osservanza delle prescrizioni contenute nel Codice per la protezione dei dati personali e, in particolare, a quelle previste dall''art. 130, in tema di comunicazioni indesiderate (uso di sistemi automatizzati di chiamata, posta elettronica, fax, messaggi di tipo Mms o Sms) e a quelle dettate dall''art. 130.3-bis, in tema di obbligo di preventiva consultazione del registro delle opposizioni a carico di tutti coloro che intendono fare tele-marketing (sia verso imprese che verso consumatori).</p>\r\n<p align="justify">Per quanto, invece, riguarda la possibilit&agrave; di essere contattati, sempre per fini commerciali, ma mediante utilizzo del numero di telefono pubblicato sul presente sito, si ricorda che coloro che non vogliono essere contattati telefonicamente per tali fini devono manifestare espressamente tale volont&agrave; iscrivendo il proprio numero telefonico nel Registro delle Opposizioni (<a href="http://www.registrodelleopposizioni.it" target="_blank">www.registrodelleopposizioni.it</a>), disciplinato con D.P.R. 7/9/2010 n. 178. Di conseguenza non &egrave; pi&ugrave; efficace l''espressione di consenso resa al riguardo in precedenza ed in base alla quale i numeri telefonici pubblicati sugli elenchi non potevano essere utilizzati per fini di comunicazione commerciale, salvo che l''abbonato non vi avesse espressamente consentito (facendo inserire sugli elenchi, accanto al proprio nominativo, il simbolo di una cornetta telefonica).</p>\r\n<h3>Il "titolare" del trattamento</h3>\r\n<p align="justify">A seguito della consultazione di questo sito possono essere trattati dati relativi a persone identificate o identificabili.<br /> Il &ldquo;titolare&rdquo; del loro trattamento &egrave; <strong>Immobiliare Mazzini</strong>,&nbsp;Piazza Mazzini - Jesolo Lido (Venezia).</p>\r\n<h3>Luogo di Trattamento dei Dati</h3>\r\n<p align="justify">I trattamenti connessi ai servizi web di questo sito hanno luogo presso la predetta sede della societ&agrave; e sono curati solo da personale autorizzato, o da eventuali incaricati di occasionali operazioni di manutenzione. Nessun dato derivante dal servizio web viene comunicato o diffuso. <br /> I dati personali forniti dagli utenti che inoltrano richieste di invio di materiale informativo (mailing list, newsletter, risposte a quesiti, ecc.) sono utilizzati al solo fine di eseguire il servizio o la prestazione richiesta e non sono comunicate a terzi.</p>\r\n<h3>Tipi di Dati trattati</h3>\r\n<p align="justify"><em>Dati di navigazione</em><br /> I sistemi informatici e le procedure software preposte al funzionamento di questo sito web acquisiscono, nel corso del loro normale esercizio, alcuni dati personali la cui trasmissione &egrave; implicita nell''uso dei protocolli di comunicazione di Internet. Si tratta di informazioni che non sono raccolte per essere associate a interessati identificati, ma che per loro stessa natura potrebbero, attraverso elaborazioni ed associazioni con dati detenuti da terzi, permettere di identificare gli utenti. In questa categoria di dati rientrano gli indirizzi IP o i nomi a dominio dei computer utilizzati dagli utenti che si connettono al sito, gli indirizzi in notazione URI (Uniform Resource Identifier) delle risorse richieste, l''orario della richiesta, il metodo utilizzato nel sottoporre la richiesta al server, la dimensione del file ottenuto in risposta, il codice numerico indicante lo stato della risposta data dal server (buon fine, errore, ecc.) ed altri parametri relativi al sistema operativo e all''ambiente informatico dell''utente.<br /> Questi dati vengono utilizzati al solo fine di ricavare informazioni statistiche anonime sull''uso del sito e per controllarne il corretto funzionamento.<br /> I dati potrebbero essere utilizzati per l''accertamento di responsabilit&agrave; in caso di ipotetici reati informatici ai danni del sito.</p>\r\n<p align="justify"><em>Dati forniti volontariamente dall&rsquo;utente</em></p>\r\n<div align="justify">L''invio facoltativo, esplicito e volontario di posta elettronica agli indirizzi indicati su questo sito comporta la successiva acquisizione dell''indirizzo del mittente, necessario per rispondere alle richieste, nonch&eacute; degli eventuali altri dati personali inseriti nella missiva.</div>\r\n<h3>Cookies</h3>\r\n<p align="justify">Un cookie &egrave; un file di testo di piccole dimensioni in cui sono memorizzate alcune informazioni riguardanti la tua navigazione. I cookie ti consentono di essere riconosciuto dal Sito web come utente unico. Vengono inviati dal Sito web al tuo terminale (computer, tablet, smartphone, notebook ecc.), per essere memorizzati e poi ritrasmessi nella visita successiva. <br /> I cookies garantiscono un funzionamento pi&ugrave; efficiente del Sito web, migliorandone la navigazione, ad esempio:</p>\r\n<ul>\r\n<li>ricordando le impostazioni inserite, cos&igrave; da non doverle modificarle ogni volta che si accede a una nuova pagina;&nbsp;</li>\r\n<li>memorizzando le informazioni inserite (ad esempio il nome utente, la lingua, il tipo di browser etc.).</li>\r\n</ul>\r\n<p align="justify">I tempi di conservazione dei dati acquisiti dipendono dai tipi di cookie. I cookie della sessione scadono quando viene chiuso il browser. I cookie persistenti, hanno date di scadenza tipiche che vanno da due mesi fino a un paio di anni.</p>\r\n<h3>Utilizzo di cookie in questo Sito</h3>\r\n<p>Il nostro Sito utilizza i seguenti tipi di cookie:</p>\r\n<ol>\r\n<li>\r\n<div align="justify"><strong>Cookie di navigazione</strong>: utilizziamo i cookie di navigazione per consentirti di visualizzare il nostro sito web in modo facile, di creare il tuo account, di effettuare il login accedendo ad aree riservate e di poter procedere con gli acquisti. Questi cookie sono indispensabili per il corretto funzionamento del nostro Sito.&nbsp;</div>\r\n</li>\r\n<li>\r\n<div align="justify"><strong>Cookie funzionali</strong>: Utilizziamo i cookie funzionali per ricordare le tue preferenze e per aiutarti a usare il nostro Sito web in modo il pi&ugrave; efficace possibile, per esempio memorizzando i prodotti che hai visualizzato in precedenza. I cookie funzionali non sono indispensabili per il funzionamento del Sito web, ma aggiungono servizi migliorando l'' esperienza complessiva di navigazione.&nbsp;</div>\r\n</li>\r\n<li>\r\n<div align="justify"><strong>Cookie analitici</strong>: Utilizziamo i cookie analitici per capire meglio come i nostri utenti usano il Sito web, per ottimizzare e migliorare il Sito e per assicurarci che lo stesso sia sempre efficace ed efficiente per gli utenti. I dati che ricaviamo riguardano le pagine web visitate, il tipo di piattaforma utilizzata, informazioni su data e ora e dati come il numero di click su una determinata pagina, le parole cercate e i testi immessi durante l''utilizzo del Sito.&nbsp;</div>\r\n</li>\r\n</ol>\r\n<h3>Disabilitazione e Cancellazione dei cookies (opt-out)</h3>\r\n<p align="justify">La maggioranza dei browser internet sono inizialmente impostati per accettare i cookie in modo automatico. Ci&ograve; significa che hai la possibilit&agrave;, in ogni momento, di impostare il tuo browser in modo da accettare tutti i cookie, solo alcuni, oppure di rifiutarli, disabilitandone l''uso da parte dei siti. Inoltre puoi normalmente impostare le preferenze del tuo browser in modo tale da essere avvisato ogni volta che un cookie viene memorizzato nel tuo computer.</p>\r\n<p align="justify">Al termine di ogni sessione di navigazione, infine, puoi cancellare dal disco fisso del tuo dispositivo i cookie raccolti. Se vuoi eliminare i cookie installati nella cartella dei cookie del browser utilizzato, occorre rammentare che ciascun browser presenta procedure diverse per la gestione delle impostazioni.</p>\r\n<p>Selezionando i collegamenti sottostanti puoi ottenere istruzioni specifiche per alcuni dei principali browser.</p>\r\n<p><strong>Microsoft Windows Explorer:</strong><br /> <a href="http://windows.microsoft.com/en-us/windows-vista/block-or-allow-cookies" target="_blank">http://windows.microsoft.com/en-us/windows-vista/block-or-allow-cookies</a></p>\r\n<p><strong>Google Chrome:</strong><br /> <a href="https://support.google.com/chrome/bin/answer.py?hl=en&amp;answer=95647&amp;p=cpn_cookies" target="_blank">https://support.google.com/chrome/bin/answer.py?hl=en&amp;answer=95647&amp;p=cpn_cookies</a></p>\r\n<p><strong>Mozilla Firefox:</strong><br /> <a href="http://support.mozilla.org/en-US/kb/Enabling%20and%20disabling%20cookies" target="_blank">http://support.mozilla.org/en-US/kb/Enabling%20and%20disabling%20cookies</a></p>\r\n<p><strong>Apple Safari:</strong><br /> <a href="http://docs.info.apple.com/article.html?path=Safari/5.0/en/9277.html" target="_blank">http://docs.info.apple.com/article.html?path=Safari/5.0/en/9277.html</a></p>\r\n<p><strong>Google Analytics: </strong><br /> E'' possibile disabilitare soltanto i cookie di Google Analytics, utilizzando il componente aggiuntivo di opt-out fornito da Google per i browser principali.&nbsp;<a href="https://tools.google.com/dlpage/gaoptout/" target="_blank">https://tools.google.com/dlpage/gaoptout/</a><br /> Se vuoi saperne di pi&ugrave; sui cookie in generale visita la pagina&nbsp;<a href="http://www.allaboutcookies.org/" target="_blank">www.allaboutcookies.org</a>e&nbsp;<a href="http://www.garanteprivacy.it/cookie" target="_blank">www.garanteprivacy.it/cookie</a></p>\r\n<h3>MONITORAGGIO, STATISTICHE E PLUGINS</h3>\r\n<p><strong>Utilizzo del servizio statistiche di navigazione PIWIK</strong></p>\r\n<p align="justify">Questo sito Web utilizza un servizio di Web Analytics fornito da PIWIK. Il sistema di misurazione pu&ograve; far uso di "cookies", piccoli file di testo che vengono depositati sul PC del navigatore per consentire di analizzare anonimamente le modalit&agrave; di utilizzo del sito. Le informazioni, completamente anonime, memorizzate nei cookies sono: data e ora di accesso al sito, ID univoco, ID di sessione Questi dati vengono inviati al server dove &egrave; stato installato il software PIWIK per elaborare report relativi alle modalit&agrave; di utilizzo di questo sito Web, alle attivit&agrave; di web marketing, nonch&egrave; per fornire al navigatore funzionalit&agrave; e interazione durante la navigazione. Piwik potrebbe trasferire queste informazioni a terzi che trattino dati per suo nome e conto, o qualora ci&ograve; sia imposto da norme imperative. In qualunque momento &egrave; possibile disabilitare i cookies dal PC modificando le impostazioni di Sicurezza e Privacy presenti sul browser, ma quest''opzione potrebbe limitare molte delle funzionalit&agrave; di navigazione del sito. <br /> L''informativa completa, resa ai sensi dell''art. 13 D. lgs. n. 196/03, &egrave; disponibile su&nbsp;<a href="http://piwik.org/privacy/" target="_blank">http://piwik.org/privacy/</a></p>\r\n<p><strong>Google Analytics Cookies</strong></p>\r\n<p>Questo sito web potrebbe utilizzare Google Analytics, un servizio di analisi web fornito da Google Inc., 1600 Amphitheatre Parkway, Mountain View, Kalifornien, 94043 USA, (di seguito "Google"). Google Analytics utilizza i cosiddetti "cookie", dei file di testo che vengono salvati sul vostro computer per consentire di analizzare come utilizzate il sito web. Le informazioni sull''utilizzo del sito web (incluso il vostro indirizzo IP) ottenute tramite i cookie verranno inviate e memorizzate in un server di Google negli Stati Uniti. Utilizzando il presente sito web, acconsentite al trattamento dei vostri dati da parte di Google. E'' possibile disabilitare i cookie di Google Analytics, utilizzando il componente aggiuntivo di opt-out fornito da Google per i browser principali.&nbsp;<a href="https://tools.google.com/dlpage/gaoptout/" target="_blank">https://tools.google.com/dlpage/gaoptout/</a>.<br /> Per consultare l''informativa privacy della societ&agrave; Google, relativa al servizio Google Analytics, si prega di visitare il sito Internet&nbsp;<a href="http://www.google.com/intl/en/analytics/privacyoverview.html" target="_blank">http://www.google.com/intl/en/analytics/privacyoverview.html</a>.<br /> Per conoscere le norme sulla privacy di Google, s''invita a vistare il sito Internet&nbsp;<a href="http://www.google.com/intl/it/policies/privacy/" target="_blank">http://www.google.com/intl/it/policies/privacy/</a></p>\r\n<p><br /> <strong>Google Adwords &amp; Google Remarketing Cookies</strong></p>\r\n<p>Questo sito internet potrebbe utilizzare Google Adwords e Google Remarketing. Entrambi i servizi sono gestiti da Google Inc.. Anche la funzione monitoraggio delle conversioni di AdWords utilizza i cookie. Per aiutarci a tenere traccia delle vendite e di altre conversioni, viene aggiunto un cookie al computer di un utente nel momento in cui quell''utente fa clic su un annuncio. Questo cookie dura 30 giorni e non raccoglie, ne'' monitora informazioni in grado di identificare personalmente un utente. Gli utenti possono disabilitare i cookie del monitoraggio delle conversioni di Google nelle impostazioni del proprio browser Internet.<br /> Il nostro sito rispetta le "Norme per la pubblicit&agrave; basata sugli interessi e sulla localit&agrave;" di Google, disponibili al seguente link:&nbsp;<a href="https://support.google.com/adwordspolicy/answer/143465#sensitive">https://support.google.com/adwordspolicy/answer/143465#sensitive</a>.<br /> Gli utenti possono disattivare l''utilizzo dei cookie da parte di Google visitando la pagina:&nbsp;<a href="http://www.google.com/settings/ads" target="_blank">http://www.google.com/settings/ads</a><br /> In alternativa, puoi indicare ai visitatori di disattivare l''uso dei cookie da parte di un fornitore di terze parti visitando la pagina di disattivazione della Network Advertising Initiative:&nbsp;<a href="http://www.networkadvertising.org/managing/opt_out.asp" target="_blank">http://www.networkadvertising.org/managing/opt_out.asp</a></p>\r\n<p><br /> <strong>Facebook Cookies</strong></p>\r\n<p>Il nostro sito web potrebbe utilizzare i cosiddetti Plugins del social network Facebook.com (di seguito "Facebook"), gestito dalla Facebook Inc., 1601 S. California Ave, Palo Alto, CA 94304, USA. Al seguente indirizzo Internet, previa autenticazione, trovate l''elenco dei principali plugins di Facebook:&nbsp;<a href="http://developers.facebook.com/plugins" target="_blank">http://developers.facebook.com/plugins</a>.<br /> Quando richiamate dal nostro sito una pagina che contiene uno di questi plugin, il vostro browser carica e riproduce il contenuto del plugin del server di Facebook. In questo modo al server di Facebook viene comunicata la pagina del nostro sito che state visitando.<br /> Se avete un profilo Facebook e mentre visitate il nostro sito web siete connessi a Facebook, questo riconosce, tramite le informazioni inviate dal plugin, quale pagina state visitando e assegna la visita al vostro account di Facebook. Quando interagite con i plugin, ad esempio cliccando sul tasto "Mi piace" o postando un commento, le informazioni vengono inviate al vostro account Facebook, dove saranno memorizzate. Le informazioni relative alla visita del nostro sito web vengono trasmesse a Facebook indipendentemente dal fatto che attiviate o meno un plugin.<br /> Per impedire la trasmissione e la memorizzazione dei dati relativi a voi e alla vostra navigazione Internet tramite Facebook, dovete disconnettervi da Facebook prima di visitare il nostro sito web. Per bloccare la futura raccolta e trasmissione dei vostri dati tramite i plugin di Facebook al link riportato di seguito, potete scaricare l''add-on "Facebook Blocker" per il vostro browser. Vi consigliamo di non cancellare l''add-on finche'' desiderate bloccare i plugin di Facebook:&nbsp;<a href="http://webgraph.com/resources/facebookblocker/" target="_blank">http://webgraph.com/resources/facebookblocker/</a><br /> All''indirizzo Internet riportato di seguito trovate l''informativa sulla privacy di Facebook, contenente maggiori informazioni sulla raccolta e sull''utilizzo dei dati da parte di Facebook, sui vostri diritti in merito a ci&ograve;, oltre alle opzioni di impostazione relative alla protezione della privacy:&nbsp;<a href="http://www.facebook.com/policy.php" target="_blank">http://www.facebook.com/policy.php</a></p>\r\n<p><strong>Google Plus Cookies</strong></p>\r\n<p>Il nostro sito web potrebbe utilizzare il social network Google+ (Google Plus) di Google. Quando richiamate dal nostro sito una pagina che contiene il pulsante "+1", il vostro browser carica e riproduce il contenuto della pagina di Google+ ad esso associata. In questo modo il server di Google riconosce la pagina del nostro sito che state visitando. La cronologia delle esplorazioni viene memorizzata per un periodo massimo di due settimane.</p>\r\n<p>All''indirizzo Internet riportato di seguito trovate l''informativa sulla privacy di Google relativa al pulsante "+1", contenente maggiori informazioni sulla raccolta, la trasmissione e l''utilizzo dei dati da parte di Google, sui vostri diritti in merito a ci&ograve; nonch&eacute; sulle opzioni di impostazione del profilo:&nbsp;<a href="https://www.google.com/intl/de/+/policy/+1button.html" target="_blank">https://www.google.com/intl/de/+/policy/+1button.html</a></p>\r\n<h3><strong>FACOLTATIVITA'' DEL CONFERIMENTO DEI DATI</strong></h3>\r\n<p>A parte quanto specificato per i dati di navigazione, l''utente &egrave; libero di fornire i dati personali riportati nei moduli di richiesta alla societ&agrave;. Il loro mancato conferimento pu&ograve; comportare l''impossibilit&agrave; di ottenere quanto richiesto.</p>\r\n<h3><strong>MODALITA'' DEL TRATTAMENTO</strong></h3>\r\n<p>I dati personali sono trattati con strumenti automatizzati e non, per gli scopi per cui sono stati raccolti. Specifiche misure di sicurezza sono osservate per prevenire la perdita dei dati, usi illeciti o non corretti ed accessi non autorizzati. I dati raccolti, potranno essere utilizzati per conto del titolare del trattamento, dagli amministratori incaricati di svolgere servizi di elaborazione e di corretto svolgimento delle attivit&agrave; del sito.</p>\r\n<h3><strong>TRASFERIMENTO DELLE TUE INFORMAZIONI ALL''ESTERO</strong></h3>\r\n<p>I dati personali forniti, immessi tramite questo o altri siti web, potrebbero essere trasferite ad altri paesi da noi o da nostri agenti allo scopo di assolvere agli obblighi contrattuali e dagli adempimenti obbligatori di comunicazione intra-gruppo e/o francising.</p>\r\n<h3><strong>DIRITTI DEGLI INTERESSATI</strong></h3>\r\n<p>I soggetti cui si riferiscono i dati personali hanno il diritto in qualunque momento di ottenere la conferma dell''esistenza o meno dei medesimi dati e di conoscerne il contenuto e l''origine, verificarne l''esattezza o chiederne l''integrazione o l''aggiornamento, oppure la rettificazione (art. 7 del d.lgs. n. 196/2003).</p>\r\n<p>Ai sensi del medesimo articolo si ha il diritto di chiedere la cancellazione, la trasformazione in forma anonima o il blocco dei dati trattati in violazione di legge, nonch&eacute; di opporsi in ogni caso, per motivi legittimi, al loro trattamento. Le richieste vanno rivolte alla societ&agrave; <strong>Immobiliare Mazzini</strong>.<br /> Questa informativa sulla privacy pu&ograve; essere modificata periodicamente e l''uso delle informazioni raccolte &egrave; soggetto all''informativa sulla privacy in effetto al momento dell''uso.</p>', 1, 'pippo (182.1.1.1)', '_pagina_privacy.tpl', 0, NULL, NULL, NULL, NULL, NULL, NULL, '', ''),
