(152, 124, 2, 'Richiedi informazioni (DE)', '', 4, 134, '1,', '', 0, 0, 0, '<div class="row">\r\n<div class="col-md-8">Compila il modulo per ricevere maggiori informazioni sui servizi offerti da Immobiliare Mazzini.<br />\r\n<p>Sarai ricontattato nel pi&ugrave; breve tempo possibile.</p>\r\n<p>##form_29##</p>\r\n</div>\r\n<div class="col-md-4">\r\n<aside class="sidebar-right">\r\n<ul class="address-list list">\r\n<li>\r\n<h5>Immobiliare Mazzini<br /><br /><img class="img-responsive" src="../../public/immobiliare-mazzini-jesolo.jpg" alt="Immobiliare Mazzini" /></h5>\r\n</li>\r\n<li>\r\n<h5>Indirizzo</h5>\r\n<address>Piazza Mazzini, 33<br />30016 Jesolo VENEZIA<br />Italia</address></li>\r\n<li>\r\n<h5>Email</h5>\r\n<a href="mailto:info@immobiliaremazzini.com">info@immobiliaremazzini.com</a></li>\r\n<li>\r\n<h5>Telefono</h5>\r\n<a href="tel:+390421972692">+39 0421 972692</a></li>\r\n<li>\r\n<h5>Orario estivo</h5>\r\nMattino 9.00 - 12.30<br />Pomeriggio 16.00 - 19.30<br /><strong>Aperto tutti i giorni</strong></li>\r\n<li>\r\n<h5>Orario invernale</h5>\r\nMattino 9.00 - 12.30<br />Pomeriggio 15.30 - 18.30<br /><strong>Chiuso luned&igrave; / Domenica su appuntamento</strong></li>\r\n</ul>\r\n</aside>\r\n</div>\r\n</div>', 1, 'pippo (182.1.1.1)', '_interno_richiedi_info.tpl', 0, NULL, NULL, NULL, NULL, NULL, NULL, '', ''),
(153, 125, 2, 'Agenzia Immobiliare a Jesolo (DE)', '', 1, 128, '1,', '', 0, 0, 0, '<div class=" col-xs-12 col-sm-12 col-md-12 no-padding margin-bottom-60">\r\n<div class=" col-xs-12 col-sm-6 col-md-6 padding-right-30">\r\n<h2>Appartamenti in affitto e in vendita per le tue vacanze a Jesolo Lido</h2>\r\nImmobiliare Mazzini opera da pi&ugrave; di trent''anni&nbsp;con professionalit&agrave; e dinamicit&agrave;, nel campo dell&rsquo;intermediazione immobiliare offrendo al Cliente una consulenza ed un&rsquo;assistenza ad ampio raggio sia nella <strong>locazione</strong> che nella <strong>compravendita di case e appartamenti a Jesolo</strong>. Le nostre attivit&agrave; si rivolgono prevalentemente al settore turistico, a&nbsp;coloro che vogliono trascorrere le vacanze al mare e per chiunque cerchi un solido investimento immobiliare.<br /> <br />Abbiamo una vasta scelta di opportunit&agrave; di affitti stagionali o annuali di case per le tue&nbsp;<strong>vacanze a Jesolo.<br /><br />Lasciatevi accompagnare nelle vostre scelte e affidatevi alla scrupolosit&agrave; di tutto il personale dell''Immobiliare Mazzini.</strong></div>\r\n<br /><br />\r\n<div class=" col-xs-12 col-sm-6 col-md-6"><img class="img-rounded" src="../../public/immobiliare-mazzini-jesolo.jpg" alt="Immobiliare Mazzini - Jesolo" /></div>\r\n</div>\r\n<div class=" col-xs-12 col-sm-12 col-md-12 no-padding margin-bottom-60">\r\n<div class=" col-xs-12 col-sm-6 col-md-6 padding-right-30"><img class="img-rounded" src="../../public/appartamenti-vacanze-jesolo.jpg" alt="Immobiliare Mazzini - Appartamenti vacanze a Jesolo" /></div>\r\n<div class=" col-xs-12 col-sm-6 col-md-6 padding-left-30">\r\n<h2>Garanzia di un servizio completo e affidabile</h2>\r\nGrazie all&rsquo;esperienza pluriennale, alla professionalit&agrave;, alla seriet&agrave;, alla trasparenza e alla disponibilit&agrave;, Immobiliare Mazzini sapr&agrave; <strong>accompagnarvi fino alla scelta migliore</strong> per la vostra compravendita&nbsp;e&nbsp;locazione, garantendo un&rsquo;assistenza costante nella ricerca dell&rsquo;immobile e nella gestione di tutte le pratiche burocratiche.</div>\r\n<div class=" col-xs-12 col-sm-6 col-md-6 padding-left-30">Siamo in grado di offrire a tutti coloro che hanno intenzione di acquistare,&nbsp;vendere o locare un immobile i seguenti servizi:&nbsp;la <strong>promozione pubblicitaria</strong> costante per una adeguata visibilit&agrave; dell&rsquo;immobile, la <strong>consulenza personalizzata</strong> per la ricerca e l&rsquo;acquisto anche a scopo d&rsquo;investimento, la <strong>gestione della vendita immobiliare</strong>, il <strong>reperimento e la verifica di documenti</strong> camerali, catastali e pratiche urbanistico/edilizie e l&rsquo; assistenza nelle trattative per la <strong>gestione della pratica di mutuo</strong> presso i principali istituti bancari.&nbsp;</div>\r\n</div>', 1, 'pippo (182.1.1.1)', '_interno_FW.tpl', 0, NULL, NULL, NULL, NULL, NULL, NULL, '', ''),
